                    { new Guid("105ba368-8a63-48a7-841a-8fa74fdea882"), 0, new Guid("a2d387ce-eec5-439b-9e2e-2ef38f0ff3fb"), "You are weighed down, either physically, magically or otherwise. You take a penalty to all your movement speeds, but your speed can never be reduced below 5 feet.", 0 },
