                    { new Guid("5803b272-2368-49ce-ba0b-8c97aa753885"), new Guid("3fa12bb8-7b63-4c36-8e6e-d3cdd81580b8"), false, new Guid("58ef6c11-b8bd-411e-8222-6434fa491d11"), null, 15, "Legendary Negotiation", null, null, null, null },
                    { new Guid("12456924-12d6-4f6e-bde1-100892c683b5"), new Guid("e3494cac-ca2b-41e5-9c3e-d260ebe2afc9"), false, new Guid("58ef6c11-b8bd-411e-8222-6434fa491d11"), null, 15, "Legendary Performer", null, null, null, null },
                    { new Guid("171b6ae6-cda9-45a7-8c0a-64672e338e0b"), new Guid("e3494cac-ca2b-41e5-9c3e-d260ebe2afc9"), false, new Guid("58ef6c11-b8bd-411e-8222-6434fa491d11"), null, 15, "Legendary Professional", null, null, null, null },
                    { new Guid("ff4b4b20-73c2-4a67-a1a5-e504c8aa2dc6"), new Guid("e3494cac-ca2b-41e5-9c3e-d260ebe2afc9"), false, new Guid("58ef6c11-b8bd-411e-8222-6434fa491d11"), null, 15, "Legendary Sneak", null, null, null, null },
                    { new Guid("c041f814-94c4-43a1-be45-3bcd2621f2bb"), new Guid("e3494cac-ca2b-41e5-9c3e-d260ebe2afc9"), false, new Guid("58ef6c11-b8bd-411e-8222-6434fa491d11"), null, 15, "Legendary Medic", null, null, null, null },
                    { new Guid("a1804dfb-e3e0-45aa-b735-2f37fed15779"), new Guid("e3494cac-ca2b-41e5-9c3e-d260ebe2afc9"), false, new Guid("58ef6c11-b8bd-411e-8222-6434fa491d11"), null, 1, "Intimidating Glare", null, null, null, null }
                });

            migrationBuilder.InsertData(
                table: "Heritages",
                columns: new[] { "Id", "Description", "Name", "RacesId", "RarityId" },
                values: new object[,]
                {
                    { new Guid("541986ae-7349-44fd-8004-c2e606e4f140"), "You have a remarkable adaptation to hot environments from ancestors who inhabited blazing deserts or volcanic chambers beneath the earth. This grants you fire resistance equal to half your level (minimum 1), and you treat environmental heat effects as if they were one step less extreme (incredible heat becomes extreme, extreme heat becomes severe, and so on).", "Forge Dwarf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("967429bb-5245-4a3c-8468-9177f9f1ff77"), "Your ancestors have been tomb guardians for generations, and the power they cultivated to ward off necromancy has passed on to you. If you roll a success on a saving throw against a necromancy effect, you get a critical success instead.", "Death Warden Dwarf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("6820eb19-bb58-4d56-9fdf-ce57f72b75d6"), "The blood of the fey is so strong within you that you're truly one of them. You gain the fey trait, in addition to the gnome and humanoid traits. Choose one cantrip from the primal spell list. You can cast this spell as a primal innate spell at will. A cantrip is heightened to a spell level equal to half your level rounded up. You can change this cantrip to a different one from the same list once per day by meditating to realign yourself with the First World; this is a 10-minute activity that has the concentrate trait.", "Fey-Touched Gnome", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("801fba4a-dd78-4f76-beca-ff51faac7b7a"), "Whether through a connection to Torag’s forge, the azers of the Plane of Fire, or another source, you can exude a burst of energy. Mbe’ke and Taralu dwarves of the Mwangi Expanse believe this heritage is a gift from dragons or elemental spirits. Choose one of the following damage types: acid, cold, electricity, or fire. Once chosen, this can’t be changed. You gain the Energy Emanation activity.", "Elemental Heart Dwarf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("4b699d38-c3fc-487c-a55b-f8d561897305"), "You live under the desert’s blazing heat, gaining incredible resilience to warm environments. You gain fire resistance equal to half your level (minimum 1), and environmental heat effects are one step less extreme for you (incredible heat becomes extreme, extreme heat becomes severe, and so on).", "Desert Elf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("4023db86-7064-4ad0-936e-e1f5c95e921b"), "Dwarven heroes of old could shrug off their enemies’ magic, and some of that resistance manifests in you. You gain the Call on Ancient Blood reaction.", "Ancient-Blooded Dwarf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("37a897ea-ac8a-407c-bf26-8443b948c8b3"), "The color of your hair and skin is mutable, possibly due to latent magic. You can slowly change the vibrancy and the exact color, and the coloration can be different across your body, allowing you to create patterns or other colorful designs. It takes a single action for minor localized shifts and up to an hour for dramatic shifts throughout your body. While you're asleep, the colors shift on their own in tune with your dreams, giving you an unusual coloration each morning. When you're in an area where your coloration is roughly similar to the environment (for instance, forest green in a forest), you can use the single action to make minor localized shifts designed to help you blend into your surroundings. This grants you a +2 circumstance bonus to Stealth checks until your surroundings shift in coloration or pattern.", "Chameleon Gnome", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("3623e7a3-e6e0-49d6-bddf-86374cd4e5d3"), "You were born or spent many years in underground tunnels or caverns where light is scarce. You gain darkvision.", "Cavern Elf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("62d5db67-945b-4cea-971f-9a2fa5038f2d"), "You dwell deep in the frozen north and have gained incredible resilience against cold environments, granting you cold resistance equal to half your level (minimum 1). You treat environmental cold effects as if they were one step less extreme (incredible cold becomes extreme, extreme cold becomes severe, and so on).", "Arctic Elf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("e019e11d-e494-49d6-8861-5c61a4768b6a"), "You are a descendant of a famed crafter and have your own amazing talent. Other dwarves might consider this a blessing from your ancestors or from the Forgefather himself, depending on where you grew up. You become trained in Crafting (or another skill if you were already trained in Crafting) and gain the Specialty Crafting skill feat, but you can pick two different specialties instead of one.", "Anvil Dwarf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("c7209f66-ad64-4356-bf03-aeb4e94bbd6f"), "In your long life, you’ve dabbled in many paths and many styles. Choose a class other than your own. You gain the multiclass dedication feat for that class, even though you don’t meet its level prerequisite. You must still meet its other prerequisites to gain the feat.", "Ancient Elf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("4ce3660b-c78a-4eb5-b487-e234132f4f34"), "Your family line is known for keeping a level head and staving off fear when the chips were down, making them wise leaders and sometimes even heroes. When you roll a success on a saving throw against an emotion effect, you get a critical success instead.", "Gutsy Halfling", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("b5615a58-0fc5-4b2d-87b7-b3f2e74e3a10"), "Your ancestors have always had a connection to fire and a thicker skin, which allows you to resist burning. You gain fire resistance equal to half your level (minimum 1). You can also recover from being on fire more easily. Your flat check to remove persistent fire damage is DC 10 instead of DC 15, which is reduced to DC 5 if another creature uses a particularly appropriate action to help.", "Charhide Goblin", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("a3b12707-a7f5-41f0-9f49-f41d1839d5f7"), "Either one of your parents was an elf, or one or both were half-elves. You have pointed ears and other telltale signs of elf heritage. You gain the elf trait, the half-elf trait, and low-light vision. In addition, you can select elf, half-elf, and human feats whenever you gain an ancestry feat.", "Half-Elf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("14a46d8b-148c-4671-90ec-622b746f75e0"), "Your family's teeth are formidable weapons. You gain a jaws unarmed attack that deals 1d6 piercing damage. Your jaws are in the brawling group and have the finesse and unarmed traits.", "Razortooth Goblin", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("2edffa58-9514-4e51-82f8-e1b08e427aeb"), "Accustomed to a calm life in the hills, your people find rest and relaxation especially replenishing, particularly when indulging in creature comforts. When you regain Hit Points overnight, add your level to the Hit Points regained. When anyone uses the Medicine skill to Treat your Wounds, you can eat a snack to add your level to the Hit Points you regain from their treatment.", "Hillock Halfling", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("7815fbcb-db7c-42fb-90fd-325aaee20d26"), "You descend from fiends or bear the mark of the fiendish realms, manifesting as some unusual feature that belies your heritage, such as horns or a tail. You gain the tiefling trait, in addition to the traits from your ancestry. You also gain low-light vision, or you gain darkvision if your ancestry already has low-light vision. You can choose from tiefling feats and feats from your ancestry whenever you gain an ancestry feat.", "Tiefling", null, new Guid("5bf3f422-ef4f-4b99-a129-4875ffdfcbd0") },
                    { new Guid("d40a90eb-140a-43b1-94f5-fb034f62d977"), "Thanks to an ancient bargain, your soul has been reborn as a duskwalker, a planar scion with a connection to psychopomps and the Boneyard. You gain the duskwalker trait in addition to the traits from your ancestry. You also gain low-light vision, or you gain darkvision if your ancestry already has low-light vision. Neither your body nor your spirit can ever become undead. You can choose from duskwalker feats and feats from your ancestry whenever you gain an ancestry feat.", "Duskwalker", null, new Guid("5bf3f422-ef4f-4b99-a129-4875ffdfcbd0") },
                    { new Guid("36db9153-1a83-46b1-b303-47a5f4665704"), "You are the scion of a vampire, half living and half undead, gifted with uncanny charm and grace, a bloodless pallor, and elongated incisors. You gain the dhampir trait, in addition to the traits from your ancestry. You have the negative healing ability, which means you are harmed by positive damage and healed by negative effects as if you were undead. You also gain low-light vision, or you gain darkvision if your ancestry already has low-light vision. You can choose from dhampir feats and feats from your ancestry whenever you gain an ancestry feat.", "Dhampir", null, new Guid("5bf3f422-ef4f-4b99-a129-4875ffdfcbd0") },
                    { new Guid("21a9fd8d-16db-43f2-af67-bd5a97b92d8e"), "Your mother was a hag. Your heterochromatic eyes are the most obvious signifier of this parentage, but you likely also have a slighter build, paler skin, and darker hair than most members of your other parent’s ancestry. You gain the changeling trait. You also gain low-light vision, or you gain darkvision if your ancestry already has low-light vision. You can select from changeling feats and feats from your other parent’s ancestry whenever you gain an ancestry feat.", "Changeling", null, new Guid("5bf3f422-ef4f-4b99-a129-4875ffdfcbd0") },
                    { new Guid("552b3bc3-c40c-42b6-a13b-436ba14e7c1e"), "You descend from celestials or were touched by the celestial realms, gaining an air of awe and grace, as well as features distinctive to your celestial forebears. You gain the aasimar trait, in addition to the traits from your ancestry. You also gain low-light vision, or you gain darkvision if your ancestry already has low-light vision. You can choose from aasimar feats and feats from your ancestry whenever you gain an ancestry feat.", "Aasimar", null, new Guid("5bf3f422-ef4f-4b99-a129-4875ffdfcbd0") },
                    { new Guid("03d1ff17-a448-47c9-b71f-5973a66e2563"), "The power of winter flows through you. This heritage is most common among the Jadwiga of Irrisen, due to their descent from Baba Yaga, and certain Erutaki touched by the spirits. You gain cold resistance equal to half your level (minimum 1), and you treat environmental cold effects as if they were one step less extreme (incredible cold becomes extreme, extreme cold becomes severe, and so on).", "Wintertouched Human", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("3cd57ab7-c57a-4287-82ce-e1473f75af48"), "You're adapted to life in the forest or the deep jungle, and you know how to climb trees and use foliage to your advantage. When Climbing trees, vines, and other foliage, you move at half your Speed on a success and at full Speed on a critical success (and you move at full Speed on a success if you have Quick Climb). This doesn't affect you if you're using a climb Speed. You can always use the Take Cover action when you are within forest terrain to gain cover, even if you're not next to an obstacle you can Take Cover behind.", "Whisper Elf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("f574f17b-2c71-4a9e-adba-a91a5f5f6e22"), "Some other source of magic has a greater hold on you than the primal magic of your fey lineage does. This connection might come from an occult plane or an ancient occult song; a deity, celestial, or fiend; magical effluent left behind by a mage war; or ancient rune magic. Choose arcane, divine, or occult.You gain one cantrip from that magical tradition's spell list. You can cast this spell as an innate spell at will, as a spell of your chosen tradition. A cantrip is heightened to a spell level equal to half your level rounded up. Whenever you gain a primal innate spell from a gnome ancestry feat, change its tradition from primal to your chosen tradition.", "Wellspring Gnome", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("0bde2b22-b4ee-484d-9052-6c4b47488624"), "You have an incredibly strong connection to the positive energy that flows through the First World, making it harder to attack your life force with negative energy. You gain negative resistance equal to half your level (minimum 1). When you have the doomed condition, the condition affects you as if its value was 1 lower than it actually is (doomed 1 has no effect, doomed 2 causes you to die at dying 3, and so on).", "Vivacious Gnome", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("03cbc90d-fbf1-488b-ab42-47a80884c75a"), "Humanity's versatility and ambition have fueled its ascendance to be the most common ancestry in most nations throughout the world. Select a general feat of your choice for which you meet the prerequisites (as with your ancestry feat, you can select this general feat at any point during character creation).", "Versatile Heritage", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("634935e2-14bd-4de5-b1d9-fcff13093d94"), "You’re able to bounce back from injuries easily due to an exceptionally thick skull, cartilaginous bones, or some other mixed blessing. You gain 10 Hit Points from your ancestry instead of 6. When you fall, reduce the falling damage you take as though you had fallen half the distance.", "Unbreakable Goblin", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("1109b6f8-33b0-4868-92f1-49e1ab8135d3"), "Whether from a connection to dark or shadowy fey, from the underground deep gnomes also known as svirfneblin, or another source, you can see in complete darkness. You gain darkvision.", "Umbral Gnome", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("b54692a4-5791-4971-9590-17889ca0cbaa"), "One of your parents was an orc, or one or both were half-orcs. You have a green tinge to your skin and other indicators of orc heritage. You gain the orc trait, the half-orc trait, and low-light vision. In addition, you can select orc, half-orc, and human feats whenever you gain an ancestry feat.", "Half-Orc", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("a8c3e70e-6eb6-4a5e-85cd-755eccc7677e"), "Your ancestors performed many secret acts under the concealing cover of dusk, whether for good or ill, and over time they developed the ability to see in twilight beyond even the usual keen sight of halflings. You gain low-light vision.", "Twilight Halfling", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("4a851a94-b9dd-4afe-b74e-4c3ef1407d9f"), "You have a powerful tail, likely because you descend from a community of monkey goblins. You gain a +2 circumstance bonus to Athletics checks to Climb, you gain Combat Climber as a bonus feat, and you reduce the number of free hands required to Climb or Trip by one.", "Tailed Goblin", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("635245e9-3230-4dab-8b0b-fac29a761c37"), "Your blood runs hearty and strong, and you can shake off toxins. You gain poison resistance equal to half your level (minimum 1), and each of your successful saving throws against a poison affliction reduces its stage by 2, or by 1 for a virulent poison. Each critical success against an ongoing poison reduces its stage by 3, or by 2 for a virulent poison.", "Strong-Blooded Dwarf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("e6c22bc6-bb97-480b-85c3-6d1b2dd3980a"), "You are acclimated to living in frigid lands and have skin ranging from sky blue to navy in color, as well as blue fur. You gain cold resistance equal to half your level (minimum 1). You treat environmental cold effects as if they were one step less extreme (incredible cold becomes extreme, extreme cold becomes severe, and so on).", "Snow Goblin", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("fdf36b32-00b2-457f-9aca-aa9378c0f92e"), "Your ingenuity allows you to train in a wide variety of skills. You become trained in one skill of your choice. At 5th level, you become an expert in the chosen skill.", "Skilled Heritage", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("d4c74254-f221-41a2-b2b9-2d8ad741cbc0"), "You see all colors as brighter, hear all sounds as richer, and especially smell all scents with incredible detail. You gain a special sense: imprecise scent with a range of 30 feet. This means you can use your sense of smell to determine the exact location of a creature. The GM will usually double the range if you're downwind from the creature or halve the range if you're upwind. In addition, you gain a + 2 circumstance bonus to Perception checks whenever you're trying to locate an undetected creature that is within the range of your scent.", "Sensate Gnome", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("f95169fa-400b-446e-8ba2-0dca02ada9bc"), "You have an inborn ability to detect and understand magical phenomena. You can cast the detect magic cantrip as an arcane innate spell at will. A cantrip is heightened to a spell level equal to half your level rounded up. In addition, you gain a + 1 circumstance bonus to checks to Identify Magic and to Decipher Writing of a magical nature.These skill actions typically use the Arcana, Nature, Occultism, or Religion skill.", "Seer Elf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("b9e766b7-d4e6-4f93-bc21-8020c2cc09bc"), "Your ancestors lived and worked among the great ancient stones of the mountains or the depths of the earth. This makes you solid as a rock when you plant your feet. You gain a +2 circumstance bonus to your Fortitude or Reflex DC against attempts to Shove or Trip you. This bonus also applies to saving throws against spells or effects that attempt to knock you prone. In addition, if any effect would force you to move 10 feet or more, you are moved only half the distance.", "Rock Dwarf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("cbaec7eb-4492-42a3-83ac-1e82a5658fb8"), "Your finely honed senses quickly clue you in to danger or trickery. You gain a +1 circumstance bonus to your Perception DC, though not to your Perception checks.", "Observant Halfling", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("88f9765e-66ed-4780-bb53-c23c27b4f8ad"), "Growing up, you never tried to lie to get what you wanted, and even when necessary, lying makes you uncomfortable. The especially faithful might even have thought that you were blessed by the dwarven god of duty, Kols. You gain a +1 circumstance bonus to Perception checks to Sense Motive and to Perception DCs against attempts to Lie to you. Furthermore, you gain a +2 circumstance bonus to Diplomacy checks to convince others you speak the truth when you are telling the truth, and you take a –4 circumstance penalty to Lie and to your Deception DC against Sense Motive.", "Oathkeeper Dwarf", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("dce19cbd-7be3-4fd6-939b-48712d5f6daa"), "Your ancestors have traveled from place to place for generations, never content to settle down. You gain two additional languages of your choice, chosen from among the common and uncommon languages available to you, and every time you take the Multilingual feat, you gain another new language.", "Nomadic Halfling", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("c2c39377-feae-4142-a4c9-6d0e458d355c"), "You were born with a strange blessing: bereft of the typical halfling luck, you can instead manipulate the fortunes of others. You can never take the Halfling Luck feat, and you gain the Jinx action.", "Jinxed Halfling", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("d1269abf-7396-4b72-8130-9a74f3253bfb"), "You can subsist on food that most folks would consider spoiled. You can keep yourself fed with poor meals in a settlement as long as garbage is readily available, without using the Subsist downtime activity. You can eat and drink things when you are sickened. You gain a + 2 circumstance bonus to saving throws against afflictions, against gaining the sickened condition, and to remove the sickened condition.When you roll a success on a Fortitude save affected by this bonus, you get a critical success instead.All these benefits apply only when the affliction or condition resulted from something you ingested.", "Irongut Goblin", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("35e10760-e9f1-4570-89f6-7fd2c3ecee42"), "You have adapted particularly well to living in forested environments. As long as you are in a forest or jungle, you gain a +2 circumstance bonus to Stealth checks to Hide and Sneak, Survival checks to Subsist, and your Survival DC to Cover Tracks.", "Treedweller Goblin", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("0b36fe08-7970-45a3-a816-05d187ae1709"), "You hail from deep in a jungle or forest, and you’ve learned how to use your small size to wriggle through undergrowth, vines, and other obstacles. You ignore difficult terrain from trees, foliage, and undergrowth.", "Wildwood Halfling", null, new Guid("52091c82-7a39-4a66-919e-ac268375b792") }
                });

            migrationBuilder.InsertData(
                table: "Languages",
                columns: new[] { "Id", "Name", "RacesId", "TypeId" },
                values: new object[,]
                {
                    { new Guid("6de09882-17f3-43f2-9c8d-81d78f75d988"), "Gnoll", null, new Guid("ddd66834-fd35-4361-b798-c389e81b12a0") },
                    { new Guid("956c9a02-b3db-41d2-83f3-3c27fa43e510"), "Jotun", null, new Guid("02fff45a-095f-4a5e-8c70-b5359692c1ac") },
                    { new Guid("e3f3ba6c-0589-4c16-b625-093a1fa1edce"), "Auran", null, new Guid("ddd66834-fd35-4361-b798-c389e81b12a0") },
                    { new Guid("fe8f7dca-685b-4595-8d0c-ee72e0239d58"), "Aquan", null, new Guid("ddd66834-fd35-4361-b798-c389e81b12a0") },
                    { new Guid("b968b2e8-1dc2-4c33-b108-5c58c36d85ed"), "Amurrun", null, new Guid("ddd66834-fd35-4361-b798-c389e81b12a0") },
                    { new Guid("59a55746-938a-459e-8ff3-ce201de0a452"), "Dwarven", null, new Guid("02fff45a-095f-4a5e-8c70-b5359692c1ac") },
                    { new Guid("7fba9655-f430-4ef1-acd7-996f398f4e60"), "Abyssal", null, new Guid("ddd66834-fd35-4361-b798-c389e81b12a0") },
