                    { new Guid("78900027-b7dc-42e8-b5bd-e2da081f7356"), 1, new Guid("a71929b0-9dff-492a-9bf9-8f9cadda198c"), "Will Saving Throw = d20 + Wisdom Modifier + Proficiency Bonus + Other Bonuses + Other Penalties", 4 },
                    { new Guid("c6213214-61d9-4f42-b3bd-6cad3d69df09"), 0, new Guid("a71929b0-9dff-492a-9bf9-8f9cadda198c"), "Will saving throws measure how well you can resist attacks to your mind and spirit. They use your Wisdom modifier and are calculated as shown in the formula below.", 0 },
                    { new Guid("e26a1fa8-a6b7-4703-9618-ce10204b5e1e"), 1, new Guid("5048e38a-a47c-4832-b37f-fd3818eced35"), "Reflex Saving Throw = d20 + Dexterity Modifier + Proficiency Bonus + Other Bonuses + Other Penalties", 4 },
                    { new Guid("44536dd5-2014-4d02-8216-094b8d14bc9f"), 1, new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), "Fortitude Saving Throw = d20 + Constitution Modifier + Proficiency Bonus + Other Bonuses + Other Penalties", 4 },
                    { new Guid("3b6fc2fa-73ab-4b02-b435-a6a9ae683458"), 0, new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), "Fortitude saving throws allow you to reduce the effects of abilities and afflictions that can debilitate the body. They use your Constitution modifier and are calculated as shown in the formula below.", 0 },
                    { new Guid("0247a36f-161f-4faf-8486-cc48fd55b554"), 0, new Guid("5048e38a-a47c-4832-b37f-fd3818eced35"), "Reflex saving throws measure how well you can respond quickly to a situation and how gracefully you can avoid effects that have been thrown at you. They use your Dexterity modifier and are calculated as shown in the formula below.", 0 }
                });

            migrationBuilder.InsertData(
                table: "Skills",
                columns: new[] { "Id", "DeitiesId", "Description", "HasArmorCheckPenalty", "HasRecallKnowledgeAction", "Name", "StatModifierId" },
                values: new object[,]
                {
                    { new Guid("13d2e35c-3829-4bab-85c1-de00ff96248a"), null, "Acrobatics measures your ability to perform tasks requiring coordination and grace. When you use the Escape basic action (page 470), you can use your Acrobatics modifier instead of your unarmed attack modifier.", true, false, "Acrobatics", new Guid("21b2cca1-66cd-48d1-a91b-085521659548") },
                    { new Guid("ca854fef-a519-472f-badd-f677cd8871fc"), null, "You are trained in a particular set of skills favored by thieves and miscreants.", true, false, "Thievery", new Guid("21b2cca1-66cd-48d1-a91b-085521659548") },
                    { new Guid("b41f214e-5d45-46fe-8495-263c3d117a86"), null, "You are skilled at a form of performance, using your talents to impress a crowd or make a living.", false, false, "Performance", new Guid("f4206177-80d3-4c9c-8f79-357a608897fa") },
                    { new Guid("a14f7dbb-8a76-4b6e-8e67-6adb4f1b39b2"), null, "You bend others to your will using threats.", false, false, "Intimidation", new Guid("f4206177-80d3-4c9c-8f79-357a608897fa") },
                    { new Guid("ab6c56d1-8f95-45db-b4a1-6bae20e30c47"), null, "You influence others through negotiation and flattery.", false, false, "Diplomacy", new Guid("f4206177-80d3-4c9c-8f79-357a608897fa") },
                    { new Guid("252ee579-951c-414e-bb69-7d2dfc324280"), null, "You are skilled at avoiding detection, allowing you to slip past foes, hide, or conceal an item.", true, false, "Stealth", new Guid("21b2cca1-66cd-48d1-a91b-085521659548") },
                    { new Guid("eeb5a099-361f-41ab-aafd-7672f47bf9c3"), null, "Perception measures your ability to be aware of your environment. Every creature has Perception, which works with and is limited by a creature’s senses (described on page 464). Whenever you need to attempt a check based on your awareness, you’ll attempt a Perception check. Your Perception uses your Wisdom modifier, so you’ll use the following formula when attempting a Perception check.", false, false, "Perception", new Guid("e9e25044-7005-48c7-81bc-372c8a9f829a") },
                    { new Guid("6f23369f-e91f-4472-a254-648ba3ed1850"), null, "Arcana measures how much you know about arcane magic and creatures. Even if you’re untrained, you can Recall Knowledge (page 238).", false, true, "Arcana", new Guid("37406a59-0dd9-4766-8713-33b13b7740fd") },
                    { new Guid("bef3fdab-348a-4024-9095-1ab69ded3fed"), null, "You can use this skill to create and repair items. Even if you’re untrained, you can Recall Knowledge (page 238).", false, true, "Crafting", new Guid("37406a59-0dd9-4766-8713-33b13b7740fd") },
                    { new Guid("feb60159-48a5-4164-b2e2-54b1f0a52a26"), null, "You know a great deal about ancient philosophies, esoteric lore, obscure mysticism, and supernatural creatures. Even if you’re untrained in Occultism, you can use it to Recall Knowledge (page 238).", false, true, "Occultism", new Guid("37406a59-0dd9-4766-8713-33b13b7740fd") },
                    { new Guid("641be10d-b069-45e9-b890-7f1254cd042c"), null, "You understand the people and systems that make civilization run, and you know the historical events that make societies what they are today. Further, you can use that knowledge to navigate the complex physical, societal, and economic workings of settlements. Even if you’re untrained in Society, you can use it for the following general skill actions (page 234).", false, true, "Society", new Guid("37406a59-0dd9-4766-8713-33b13b7740fd") },
                    { new Guid("8b35c13a-46fd-4018-bb18-11c0f156f708"), null, "Athletics allows you to perform deeds of physical prowess. When you use the Escape basic action (page 470), you can use your Athletics modifier instead of your unarmed attack modifier.", true, false, "Athletics", new Guid("3e44bfc5-4aeb-4b46-9bdd-d4da39d40137") },
                    { new Guid("b64e4795-0efe-4cf5-82e3-f4219c041137"), null, "You can patch up wounds and help people recover from diseases and poisons. Even if you’re untrained in Medicine, you can use it to Recall Knowledge (page 238).", false, true, "Medicine", new Guid("e9e25044-7005-48c7-81bc-372c8a9f829a") },
                    { new Guid("3707c645-9e77-4eb7-bf63-f4d65f471f25"), null, "You know about the natural world, and you command and train animals and magical beasts. Even if you’re untrained in Nature, you can use it to Recall Knowledge (page 238).", false, true, "Nature", new Guid("e9e25044-7005-48c7-81bc-372c8a9f829a") },
                    { new Guid("2f33e759-98f4-4a19-a955-e2133197de04"), null, "You can trick and mislead others using disguises, lies, and other forms of subterfuge.", false, false, "Deception", new Guid("f4206177-80d3-4c9c-8f79-357a608897fa") },
                    { new Guid("6a672190-7918-4fbd-a2d7-2d69f9d2a794"), null, "The secrets of deities, dogma, faith, and the realms of divine creatures both sublime and sinister are open to you. You also understand how magic works, though your training imparts a religious slant to that knowledge. Even if you’re untrained in Religion, you can use it to Recall Knowledge (page 238).", false, true, "Religion", new Guid("e9e25044-7005-48c7-81bc-372c8a9f829a") },
                    { new Guid("d8fd543c-7284-451d-8882-583970e9d917"), null, "You are adept at living in the wilderness, foraging for food and building shelter, and with training you discover the secrets of tracking and hiding your trail. Even if you’re untrained, you can still use Survival to Subsist (page 240).", false, false, "Survival", new Guid("e9e25044-7005-48c7-81bc-372c8a9f829a") }
                });

