                    { new Guid("e0daa940-678f-4ce5-8ee0-19bc7859799b"), "The sturdy plate provides no purchase for a cutting edge. You gain resistance to slashing damage equal to 1 + the value of the armor’s potency rune for medium armor, or 2 + the value of the armor’s potency rune for heavy armor.", "Plate", new Guid("49778592-4637-4573-ae09-f433586c87d3") },
