                    { new Guid("80a75f79-058a-4d69-a75a-1591d7e53a2e"), "There is no medium or heavy cloth armor, so there is no armor specialization effect for the cloth armor group.", "Cloth", new Guid("3df55bb0-de89-4344-8b24-c33bea54416d") },
