            migrationBuilder.InsertData(
                table: "HazardTypes",
                columns: new[] { "Id", "Description", "Name", "SourcePageId" },
                values: new object[,]
                {
                    { new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6"), "Traps are usually built or placed, though they can also form accidentally, such as if a magic portal, through millennia of disuse, malfunctions as its magic warps. Mechanical traps always have some physical component, whereas purely magical traps typically don’t. Magical traps can usually be counteracted by dispel magic, and those without a listed proficiency rank for Stealth can be found using detect magic. Thievery is the most common skill used to disable traps.", "Traps", new Guid("a5c9fa7a-a08c-4207-916e-d00b445fe0c5") },
                    { new Guid("9d0426d4-021e-4822-a114-04840f3bb9c4"), "Haunts are spiritual hazards, usually formed when the spiritual essence of a location is imprinted with the instincts and emotions from a living being’s demise. Because haunts lack matter, they rarely involve a physical component, and when they do, that component is generally incorporeal or might even be damaged only by positive energy. The skills and options used to disable haunts vary, though using Religion for an exorcism is common. However, even with a successful check to disable a haunt, it can reoccur until its unfinished business is resolved. Typically, successfully disabling or enduring a haunt provides clues to determine what it would take to lay it to rest permanently.", "Haunts", new Guid("dc57e77e-c622-475f-93f5-48283fcff21f") },
                    { new Guid("6b56b0d2-5b30-4ccf-b72c-532c244d9b73"), "Environmental hazards are either living things, like dangerous spores and molds, or simply features of the terrain or environment, like avalanches or rockslides. While they are always physical, some environmental hazards can’t reasonably be attacked or damaged, such as a cloud of poisonous gas or a patch of quicksand. Survival is the most common skill used to disable environmental hazards.", "Environmental Hazards", new Guid("1e1f4c55-f81c-4e02-a34b-170eaf519ad1") }
                });

