            migrationBuilder.InsertData(
                table: "AlchemicalBombs_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("f7f13e63-3728-470d-8a1f-b7cd65d855df"), 0, new Guid("e7825926-436e-4914-940a-09de6052cab1"), "A tanglefoot bag is filled with sticky substances. When you hit a creature with a tanglefoot bag, that creature takes a status penalty to its Speeds for 1 minute. Many types of tanglefoot bag also grant an item bonus on attack rolls.", 0 },
                    { new Guid("575fcbde-26ab-4b04-8856-d3ff1612f7f3"), 0, new Guid("05e7fbc0-da5c-4194-bd5a-daa6b05ba421"), "This flask filled with corrosive acid deals 1 acid damage, the listed persistent acid damage, and the listed acid splash damage. Many types grant an item bonus to attack rolls.", 0 },
                    { new Guid("670226b5-e794-4898-b2be-94c63cf5408e"), 0, new Guid("cdfc6ce6-04ca-4220-a5c6-73eee8d2f0d5"), "When this stone hits a creature or a hard surface, it explodes with a deafening bang. A thunderstone deals the listed sonic damage and sonic splash damage, and each creature within 10 feet of the space in which the stone exploded must succeed at a Fortitude saving throw with the listed DC or be deafened until the end of its next turn. Many types of thunderstone grant an item bonus to attack rolls.", 0 },
                    { new Guid("3d23b44a-67d3-4cbe-b73e-528f36790ac4"), 2, new Guid("e7825926-436e-4914-940a-09de6052cab1"), "The target can end any effects by Escaping or spending a total of 3 Interact actions to carefully remove the sticky substances. These Interact actions don’t have to be consecutive, and other creatures can provide the actions as well.", 0 },
                    { new Guid("3a949c9e-d4c8-4496-bb1a-71fea4bef008"), 0, new Guid("f121fc6c-44bd-4528-9673-709f81627688"), "The liquid reagents in this vial rapidly absorb heat when exposed to air. A frost vial deals the listed cold damage and cold splash damage. On a hit, the target takes a status penalty to its Speeds until the end of its next turn. Many types of frost vial also grant an item bonus to attack rolls.", 0 },
                    { new Guid("694ea8b3-8bd7-4a4e-b925-446ba77959f6"), 1, new Guid("e7825926-436e-4914-940a-09de6052cab1"), "On a critical hit, a creature in contact with a solid surface becomes stuck to the surface and immobilized for 1 round, and a creature flying via wings has its wings tangled, causing it to fall safely to the ground and become unable to Fly again for 1 round. Tanglefoot bags are not effective when used on a creature that is in water.", 0 },
                    { new Guid("d487c00d-1ea3-4f9a-83cd-eba70c9614fd"), 0, new Guid("2a6ab15a-5dd7-4c2c-b551-500821023ac7"), "Bottled lightning is packed with volatile reagents that create a blast of electricity when they are exposed to air. Bottled lightning deals the listed electricity damage and electricity splash damage. On a hit, the target becomes flat-footed until the start of your next turn. Many types grant an item bonus to attack rolls.", 0 },
                    { new Guid("7ea74824-5235-4b72-bc3e-813400c45c57"), 0, new Guid("3e95680d-1c87-457c-91b0-e6e5cf29bee8"), "Alchemist’s fire is a combination of volatile liquids that ignite when exposed to air. Alchemist’s fire deals the listed fire damage, persistent fire damage, and splash damage. Many types grant an item bonus to attack rolls.", 0 }
                });

