            migrationBuilder.InsertData(
                table: "AlchemicalPoisons_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("a7391054-edfc-4951-8efc-8b995fde8148"), 0, new Guid("427af463-394a-423e-be07-d4788fc27ec7"), "Concentrated sap of stinging weeds makes an effective toxin.", 0 },
                    { new Guid("765ca329-35c6-4f20-8d10-000b35ce1a78"), 0, new Guid("c55ad542-1fba-49e6-ab84-f95050cc3d7f"), "Mindfog mist can be used to undermine spellcasters, as its effect on a victim’s mental faculties are swift and powerful.", 0 },
                    { new Guid("42d4e1ff-92b4-4153-b3eb-42ea8d70eb41"), 0, new Guid("aef8461a-019a-4c5e-baeb-949f8ebd6e66"), "Malyass root paste sees use to impede opponents in athletic competitions, in addition to espionage and tracking.", 0 },
                    { new Guid("e61c1c37-3720-4a0d-8c2b-956bc8f7e9d1"), 0, new Guid("0e9adbb7-41e0-4935-8e1e-5339b7b076d0"), "Tears of death are among the most powerful of alchemical poisons, distilled from extracts of five other deadly poisons in just the right ratios.", 0 },
                    { new Guid("f8d404e3-12fb-4647-adb6-60888962e8f2"), 0, new Guid("b2e3f38f-f570-4cf8-ba74-633bdc0a1405"), "A mix of digestive juices and green dragon poison glands nauseates the victim as its flesh is digested from within.", 0 },
                    { new Guid("7045ff07-e29c-4f30-9a90-8d4b94e64335"), 0, new Guid("7c923c5c-7005-4f1b-9005-5c79b289b056"), "Concentrated hemlock is a particularly deadly toxin that halts muscle action—including that of the victim’s heart.", 0 },
                    { new Guid("e864228b-0a29-43de-bebb-175ea6468573"), 0, new Guid("25956d4a-b3ee-49fe-9660-b1ee2b67b1de"), "Wolfsbane appears in folklore for its link to werecreatures. If you are afflicted with lycanthropy and survive stage 3 of wolfsbane, you’re immediately cured of the lycanthropy.", 0 },
                    { new Guid("ce438b37-57d0-41eb-83ed-65302a63073b"), 0, new Guid("28f803a7-f093-4be7-a3d2-623a77560f93"), "Sometimes called “deadly nightshade,” belladonna is a widely available toxin produced from a plant similar to a tomato.", 0 },
                    { new Guid("ab9af6c8-886c-4cc4-8347-d5d5b6c520e5"), 0, new Guid("b28f4309-cc04-4522-8837-b653995b3028"), "This toxin is a compound of arsenic and other substances. You can’t reduce your sickened condition while affected.", 0 },
                    { new Guid("d4ce3729-a117-4501-b8b3-2526bfb0ff43"), 0, new Guid("949064c1-4862-4a51-a4fe-8ac7c91559d1"), "Dust salvaged from the remains of a destroyed lich has paralytic properties that make it a valuable poison.", 0 },
                    { new Guid("ed3a6476-d01d-44c9-a3a5-72e753c48be5"), 0, new Guid("ed3a6476-d01d-44c9-a3a5-72e753c48be5"), "Lethargy poison is commonly used in hit-and-run tactics by drow and others who want their victims alive; the ambusher retreats until the poison sets in and the victim falls unconscious. Further exposure to lethargy poison does not require the target to attempt additional saving throws; only failing an saving throw against an ongoing exposure can progress its stage.", 0 },
                    { new Guid("240bf270-cf24-434c-983a-4b5217b80772"), 0, new Guid("1f8e9d8a-52ba-4b7c-b041-6e797a91e25b"), "Properly harvested and preserved, the poison from a wyvern’s sting is effective and direct.", 0 },
                    { new Guid("0b7f7c29-9473-4281-8d95-5264cfe8b23d"), 0, new Guid("b445e986-a45a-4d3a-8089-a2d33fee60dc"), "The opaque white sap from the graveroot shrub clouds the mind.", 0 },
                    { new Guid("a7f2675e-38a7-4d2e-bb3f-a893a4538f22"), 0, new Guid("d493d861-70f0-4362-a954-2d0609869352"), "Purportedly sourced from any number of outlandish locales, nightmare vapor is most often created by boiling the sweat collected from humanoids caught in the throes of terrible nightmares.", 0 },
                    { new Guid("39eeb491-4cff-4764-89d2-9ce910775200"), 0, new Guid("7b143b21-75a9-4d41-9c09-1e4a872526b9"), "Scorpion venom is excruciating and its effects are somewhat debilitating.", 0 },
                    { new Guid("86a05df2-37ef-4162-9576-46a53b42e381"), 0, new Guid("ae0386af-cfaf-40c0-83b4-8dd5a8d80d9a"), "The toxic deathcap mushroom can be dried, ground, and treated to form a flavorless powder with accelerated effects.", 0 },
                    { new Guid("e9c5a72e-0a96-4f96-ba1f-a64036c4cfda"), 0, new Guid("acc877c9-ea44-4977-b0da-6bf6ec70922a"), "Giant centipede venom causes severe muscle stiffness.", 0 },
                    { new Guid("7891623b-6f09-4e17-b565-40ac365b6b59"), 0, new Guid("c4f4ddce-c112-44b3-90a5-06aaaed80f1e"), "A paste made by mashing the fine, threadlike roots of a certain creeper vine, spider root renders a victim clumsy and maladroit.", 0 },
                    { new Guid("a699aced-f89e-4a8e-b70e-f46ef9abdbd3"), 0, new Guid("1a0af776-3dc1-48f7-bc0a-17c676e4f044"), "Slumber wine sees its greatest use in games of intrigue, where an absence can be more devastating than injury. Characters unconscious from slumber wine can’t wake up by any means while the poison lasts, don’t need to eat or drink while unconscious in this way, and appear to be recently dead unless an examiner succeeds at a DC 40 Medicine check.", 0 },
                    { new Guid("4de33799-27d7-42f5-a3cc-1458b3aef42d"), 0, new Guid("0a713a66-44df-45ff-8917-5977c0c90e8f"), "Venom from enormous purple worms leaves a victim weakened.", 0 },
                    { new Guid("620d976a-9aa5-421e-a5a0-124b60cdc8db"), 0, new Guid("7d31dbce-9230-4960-99cc-71de51c18977"), "King’s sleep is an insidious long-term poison that can seem like a disease or even death from natural causes on a venerable target. The drained condition from king’s sleep is cumulative with each failed save and can’t be removed while the poison lasts.", 0 },
                    { new Guid("26dd2686-7c61-4c86-8724-6d2e336401a0"), 0, new Guid("c65fd194-6210-42c8-80a2-b54ff81b6585"), "Adder venom is a simple but effective way to enhance a weapon.", 0 },
                    { new Guid("c36e3697-6277-474e-b992-a95f955a857b"), 0, new Guid("fa11da7d-e05b-486b-a6e0-444dee34bae9"), "Black lotus extract causes severe internal bleeding.", 0 },
                    { new Guid("785aa516-6335-4df7-9078-4230d4bdf0e7"), 0, new Guid("dc73bb29-2a4e-429e-bc99-26d85ae74e1c"), "This tacky, hardened sap is harvested from trees infected by fungal blights and exposed to open flames.", 0 },
                    { new Guid("5b28e3fa-1348-41cb-ba9f-25f5230e45d3"), 0, new Guid("81b07f7b-2e70-4b38-80f7-0b28a4c6f399"), "Fumes from the forges of Hell drain health and strength alike.", 0 },
                    { new Guid("062e4990-d0b3-4931-9ee3-ede80d54ec72"), 0, new Guid("0381fe8b-2404-42fb-9abd-74e28f1401d5"), "This thick substance is distilled from the mind-robbing cytillesh fungus, though it lacks memory-altering capabilities.", 0 },
                    { new Guid("44e8074e-5cc8-46f9-8829-7ab92e42f176"), 0, new Guid("eec5e097-c60a-4a1d-91d3-57bcf30e6a31"), "Distilled from the Plane of Shadow, this oily substance imposes tenebrous effects. The enfeebled condition from shadow essence lasts for 24 hours.", 0 },
                    { new Guid("2d4bb8d3-f0fc-4e20-a407-a73f2824d244"), 0, new Guid("862bacf9-a11f-4f56-8c94-2452d636db79"), "Giant wasp venom interferes with a victim’s movement.", 0 },
                    { new Guid("84e7645e-26c9-436c-824e-f485cba68ba0"), 0, new Guid("1e830309-8b32-4860-85d0-a704be45b0f6"), "This venom erodes its target’s defenses, aiding the spider in securing prey.", 0 }
                });

