                {
                    { new Guid("e784b731-7bb1-4e51-b438-3e88eb542a41"), 10, new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "These projectiles are the ammunition for bows. The shaft of an arrow is made of wood. It is stabilized in flight by fletching at one end and bears a metal head on the other.", "Arrows", 10, new Guid("77284f4c-a449-4276-99df-e9aa9222ff5b"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("c51ef03b-db9b-44ac-92ac-39a0c7834b95"), 10, new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "Shorter than traditional arrows but similar in construction, bolts are the ammunition used by crossbows.", "Bolts", 10, new Guid("73692529-4560-47a6-988d-7e43046a44ba"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("5ee1520e-e377-4855-8e73-81ebee4c146d"), 5, new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "A typical repeating hand crossbow magazine holds five bolts.", "Repeating Hand Crossbow Magazine", 90, new Guid("91b5e6aa-fe9b-4f36-8a57-d7588c7b876f"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("2981098c-b7f9-40bd-83a4-624eec7ef483"), 10, new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "No description was provided for this ammunition.", "Wooden Taws", 10, new Guid("f1971ded-4ed2-4256-9dc7-4887b0867100"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("9230c1f0-09ea-4dd2-b6d4-bb0cfcbeabdd"), 10, new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "These thin, light darts are typically made of hardwood and stabilized with fletching of down or fur. They are often hollow so they can be used to deliver poison.", "Blowgun Darts", 5, new Guid("867680b0-acc3-44c6-9e1d-0abd095af230"), new Guid("79516d2f-0c2d-47d3-b411-5b02ae26022f") },
