                    { new Guid("aa6891cb-39ce-4647-b7f9-c7252ab598a1"), 0, new Guid("76e3db46-6f8a-4a56-9459-58d0b14e2059"), "An ethereal rune replicates armor on the Ethereal Plane.", 0 },
                    { new Guid("575329d6-6e3b-4bf0-af7c-a2f4f2598a35"), 0, new Guid("d21ec6e1-b491-49e8-ba45-64abfdce9da8"), "These symbols convey protective forces from the Elemental Planes. You gain resistance 5 to acid, cold, electricity, or fire. The crafter chooses the damage type when creating the rune. Multiple energy-resistant runes can be etched onto a suit of armor; rather than using only the highest-level effect, each must provide resistance to a different damage type. For instance, a +2 acid-resistant greater fire-resistant breastplate would give you acid resistance 5 and fire resistance 10.", 0 },
                    { new Guid("f9c96673-ed3c-491c-96e1-52de805aefdc"), 0, new Guid("5bbaaa06-0e1b-4418-acd3-8b16548ac945"), "Armor with this rune becomes hazy black.", 0 },
                    { new Guid("425f1a21-6e3b-4422-8ba5-a4011936a40f"), 0, new Guid("42cd3663-a683-4549-90f5-8d5d24195060"), "This property makes armor slippery, as though it were coated with a thin film of oil.", 0 },
                    { new Guid("8f63efb2-6386-411c-999e-d0344722aae9"), 0, new Guid("aaaa1bfc-1a6f-4a5a-b2e7-3b9c779aa014"), "This intricate rune displaces spell energy.", 0 },
                    { new Guid("9b5141e5-b893-4888-9173-33d15860de6c"), 0, new Guid("2dcf90ee-e52e-4e69-a809-6790cf49a622"), "A ready rune draws component pieces of a suit of armor toward one another, making it easier and faster to get into.", 0 },
                    { new Guid("6036a2f4-03fd-44a3-9a76-ece5df9fe42a"), 0, new Guid("8adaa470-41e9-4308-bd26-d8d3188d02f4"), "This rune is a swirling glyph on the front of the armor. A large pair of transparent, ephemeral wings floats out from the back of the armor.", 0 },
                    { new Guid("bfa5187b-92f9-4342-b5cd-9a3f4e0f6fd0"), 0, new Guid("0b5a1049-2565-40ac-8364-1a040cc62375"), "This armor can be disguised with a mere thought.", 0 },
                    { new Guid("d27ca5bd-e42f-4d6b-8432-838373be0fa3"), 0, new Guid("1add97fa-232b-4aed-a710-d41d42352ae1"), "Rock-braced armor makes you as hard to move as a boulder. ", 0 },
                    { new Guid("cdcf5422-2d5d-4724-a17b-f09f6094bc65"), 0, new Guid("a3e92834-573a-417f-9ffa-710c6ac73bff"), "A set of soaring armor helps you fly faster and protects you and nearby allies from falling.", 0 }
