                {
                    { new Guid("e2bc8486-9d73-401e-8048-60736949186d"), 0, new Guid("aac52ac8-ae3d-4386-a81d-05f38ae1372f"), "This legendary curse sends you into a sleep indistinguishable from death.", 0 },
                    { new Guid("3b1acf9a-6f81-4321-8c2f-9ac27a9cc810"), 0, new Guid("cb8e0c92-9867-4cf1-b70c-dbff7df35ef4"), "Even the most experienced combat veteran becomes as reckless as a rookie when suffering from sellsword’s folly.", 0 },
                    { new Guid("f26e7863-eee9-455c-aed8-c5dbb95e46f7"), 0, new Guid("377a9414-6b18-4634-a5e2-35ac9225a2da"), "This curse prevents your soul from moving on after death.", 0 },
                    { new Guid("d84fc50c-1e94-4484-b4c3-108ec8336188"), 0, new Guid("f9059558-883a-4d04-a080-5d5511da93de"), "A reviling earth curse usually appears across a specific geographical region, such as a ruined town, a necromancer’s domain, or a similar area.", 0 },
                    { new Guid("7d41b7d7-e6cf-44cd-a315-9c166d15b06e"), 0, new Guid("777ae2c9-85e4-444a-9bce-8ef9af37eee4"), "With divine intervention, followers of a deity can bestow this curse upon an enemy of the faith.", 0 },
                    { new Guid("32de8d51-a3fb-42a8-b2cf-210ea45f2233"), 0, new Guid("7df1d5bf-f713-4416-a429-aaf001da62c9"), "This curse makes the hunter into the hunted, drawing the ire of animals wherever you go.", 0 },
                    { new Guid("a7e417fa-a6a3-40d4-93d8-f4e9b149b85c"), 0, new Guid("a2866bc7-990e-4735-8090-ec6351a5cad1"), "You find all courage stolen from your heart. When faced with something frightening, you flee in terror or stand frozen in place.", 0 },
                    { new Guid("121b00ad-33e7-443c-94eb-ed4c3a3d6032"), 0, new Guid("2638d791-3e60-457d-8450-bf0a09099568"), "When you swear an oath, you must obey that oath or suffer terrible consequences.", 0 },
                    { new Guid("94a1353c-3d3a-4a3d-9bf5-8e1d0e7ee0a2"), 0, new Guid("debd8716-f744-4e4c-9e3a-4b6cdbdfc581"), "You are haunted by all those you have killed.", 0 },
                    { new Guid("21c4576f-e92a-4e83-83c4-2e122e7bd7a6"), 0, new Guid("db1b4014-4933-49fb-919d-843c3fbeb5fb"), "This curse plagues you with terrible nightmares whenever you sleep, preventing you from resting properly.", 0 },
                    { new Guid("366d3a0d-d1a3-4d52-8d12-67188cafd7b6"), 0, new Guid("a93f6011-ae01-4927-9e74-485dd52be9e1"), "This curse protects a single book and activates against any creature who Steals it.", 0 },
                    { new Guid("60ad7f53-018d-4c7d-bc83-a74d72cb9608"), 0, new Guid("9a5c5a35-e734-4557-ba0c-0b1d8cbea242"), "This punishment causes you to lose something dear to you whenever you rob or steal. If you have nothing to lose, the curse exacts its punishment upon your body instead.", 0 },
                    { new Guid("9f951938-a7f4-4070-bd17-24a449a8675a"), 0, new Guid("cc8c8901-28c6-49d0-b157-5e360182bd46"), "A wizard’s ward is placed upon a single book, usually a spellbook. If you damage the book, you must attempt a save against the curse’s effect.", 0 },
                    { new Guid("d002e496-9977-4e9d-9570-e213a6f0db43"), 0, new Guid("65c44561-e8b0-4f7a-b65c-3a42d458721e"), "This curse kills through dehydration in the same vein as the curse of the ravenous, but with deadly speed.", 0 },
                    { new Guid("b78f271b-262c-4e0a-9ad1-fce546c27091"), 0, new Guid("c9d8ee02-8f76-42a8-a95a-fc0d05c073d5"), "A grave curse punishes you for stealing from a tomb or other resting place.", 0 },
                    { new Guid("265d0468-003e-439f-ae86-71d69ff57357"), 0, new Guid("8f8119cf-ecf8-412d-ad29-04df287396bc"), "This hideous curse kills through constant hunger. You become gaunt and repeatedly gnash your teeth.", 0 }
                });

