            migrationBuilder.InsertData(
                table: "ItemCurses_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("5fe7530b-0555-4b3e-88a0-6bd6f28e08cc"), 0, new Guid("247f52a1-f309-4e64-9020-6cec69d2a048"), "An item affected by an arrow attracting curse protects you normally, but it draws ranged attacks like a magnet. Whenever a creature within 120 feet misses with a ranged attack, it must immediately reroll the attack against your AC, affecting you depending on the result of the new attack roll. The arrow attraction curse activates only if you could have been a legitimate target. Creatures that intentionally attempt to miss a ranged attack do not activate an arrow attraction curse. Once the curse has activated for the first time, the item fuses to you.", 0 },
                    { new Guid("44a99ce1-b79a-4110-963d-fabbe80784d1"), 0, new Guid("77b3847f-7cb6-4d8e-9eb0-8c348b0b755c"), "An arsonous curse creates flaws in the mystic pathways that channel magic through an item, allowing excess power to escape as sparks. Whenever you activate the magic item, a random ally within 30 feet takes 1d10 persistent fire damage. If no ally is in range, you take the damage instead. At the GM’s discretion, this curse might ignite an unattended object or the surrounding environment instead.", 0 },
                    { new Guid("72bbc67f-8a60-42ed-bf86-820ee0f80fae"), 0, new Guid("c1881624-ab21-4295-bdf7-81617c04b051"), "A ravenous curse draws power from the wielder’s body. Whenever you activate the item, you become incredibly hungry and immediately begin to starve. You require 10 times as much food as normal for the next day.", 0 },
                    { new Guid("e50b741a-3b1e-49f6-8a19-d6d6d18b9678"), 0, new Guid("53cbef47-8c65-4869-9494-4bc53daa4475"), "The weapon flashes excessive light with each attack. On a critical hit with the weapon, you are blinded until the end of your turn and take the effects of a faerie fire spell until the start of your next turn.", 0 },
                    { new Guid("f889ad21-5731-4546-bd72-71d323d5be54"), 0, new Guid("8170f8c0-0cdb-4c14-8cb3-2e208ae58552"), "This property is associated with a specific color, which is defined at the time of the curse’s creation. Whenever you use the affected equipment while taking a manipulate action with another object, the second object is permanently stained the associated color. For instance, if you used a set of yellow staining lockpicks to open a door, the lock would permanently become yellow. This color change does not otherwise unnaturally persist and can be changed via any normal mundane or magical means.", 0 },
                    { new Guid("bbc4deb5-bd7e-4dce-aa0d-90d32db6da92"), 0, new Guid("578a1f3e-8039-4342-a2b1-bcfa67035d7a"), "Weapons with the grandstanding curse inspire overconfidence in their wielders, demanding style over pragmatism. Whenever you reduce a foe to 0 Hit Points, you lose all remaining actions on your turn, as you are compelled to flourish, gloat, pose, or otherwise waste your time in response.", 0 },
                    { new Guid("58b2dbcb-9d2c-4c0d-9b9f-894c7365accb"), 0, new Guid("369897ab-d7b6-4077-ad4e-69580e0b95fa"), "This curse bursts with uncontrolled teleportation magic when activated, unreliably transporting creatures across the battlefield. On a critical hit with the affected weapon, you and an ally within 60 feet (chosen randomly) teleport to switch places with one another. If either of the affected creatures is unable to entirely fit within its new space, the creature is placed in the nearest available squares instead.", 0 },
                    { new Guid("654b78d5-5f42-44fa-930a-25120edfb0d4"), 0, new Guid("9d831fff-4d11-444f-b90d-0d3b3d393703"), "A withering curse shrivels vulnerable flesh. Whenever you activate the item, one of your fingers turns black and falls off. You take a –1 status penalty to Thievery checks and Dexterity-based attack rolls with a hand missing two or three fingers; if you lose more than four fingers on one hand, you can’t use that hand to hold objects or use manipulate actions. These fingers can be replaced by magic but are otherwise gone forever. The GM has the final say on how creatures with unusual appendages or numbers of fingers are affected by this curse.", 0 },
                    { new Guid("f5ae85ad-0ab5-4862-a27f-9d6813003af0"), 0, new Guid("b2f407cf-7fe0-42fa-ac0e-2524621e8a3b"), "A bloodbiter weapon is awakened by violence and fueled by blood. When you make a successful attack with the weapon, it inflicts a wound that deals 1d6 persistent bleed damage (in addition to its normal damage), but it also deals 1d6 persistent bleed damage to you. The curse remains dormant until the weapon hits a creature, at which point black thorns protrude from the weapon and dig into your body; the weapon fuses to you and you can’t use the hand that holds the weapon for any other purpose. If the weapon is two-handed, it attaches itself to only a single hand (GM’s choice).", 0 },
                    { new Guid("d2124045-cd88-43c5-985d-f62755d34242"), 0, new Guid("6e4d1c6a-b506-4a2f-8ab0-03a1ebea1696"), "The dependent curse makes an item function properly only under certain circumstances. Whenever you use the item to perform a skill check or use the weapon in combat, your degree of success is one worse than the result you rolled unless those specific conditions are met. The most common types of dependent curses are nocturnal or diurnal—functioning normally only at night or only during the day, respectively—but more restrictive curses do exist, such as a curse that restricts the item’s use to underground or a curse that allows the item to function effectively only during autumn.", 0 },
                    { new Guid("76a4cd2a-762d-4674-b7b4-bc23f240b295"), 0, new Guid("ec2335e5-bcde-44c4-b9a6-c352b1c02073"), "Failure makes the weapon crumble. Whenever you critically fail an attack roll with the weapon, the degenerating curse deals 1d10 acid damage to the weapon, ignoring its Hardness and resistances.", 0 },
                    { new Guid("0a648746-7fea-4db6-a7e9-14adb15467ec"), 0, new Guid("11d686ec-2c9a-4c0f-b7da-d8318c38bc64"), "A weapon with the backbiting curse warps space in response to catastrophic mishaps. Whenever you critically fail at a Strike with this weapon, the weapon curls around (or its projectile swerves through the air) to strike you in the back as though you hit yourself, automatically dealing maximum damage to you.", 0 },
                    { new Guid("df529fb2-6e29-4350-b747-012e2d9400b8"), 0, new Guid("75b47175-fb61-4cf2-90dd-466970f59b76"), "When you invest this armor, a personal-sized cloud appears over your head and begins to rain on you, and the armor fuses to you. This extinguishes uncovered flames and soaks other objects you are carrying or holding, potentially ruining them. Cold conditions are one step worse under the cloud, and at the GM’s discretion it might cause other problems, such as interfering with sleep.", 0 },
                    { new Guid("8aeba1cd-97c8-4c5d-92f9-6a48781efa95"), 0, new Guid("dade2400-c464-4171-a0f4-5367292b51a3"), "A weapon with the backbiting curse warps space in response to catastrophic mishaps. Whenever you critically fail at a Strike with this weapon, the weapon curls around (or its projectile swerves through the air) to strike you in the back as though you hit yourself, automatically dealing maximum damage to you.", 0 }
                });

            migrationBuilder.InsertData(
                table: "MeleeWeapon",
                columns: new[] { "Id", "BulkId", "Damage", "DamageTypeId", "Description", "Hands", "Level", "Name", "Price", "SourcePageId", "TraitsId", "WeaponCategoryId", "WeaponGroupId" },
                values: new object[,]
                {
                    { new Guid("7f512734-c802-4d3e-bb53-4a4314b5807c"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "A pair of these metal gloves comes with full plate, half plate, and splint armor; they can also be purchased separately and worn with other types of armor. They not only protect your hands but also transform your hands into lethal weapons.", "1", null, "Gauntlet", 20, new Guid("8fc6c729-bb8a-4bf2-953f-f1e9063afd6d"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("55158194-ce53-4931-818b-5c36289e4dba") },
                    { new Guid("0863cda6-3b63-4eea-a31d-51d3da39e6ed"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "Providing the same defensive function as a standard gauntlet, this version has a group of spikes protruding from the knuckles to deliver piercing damage with a punch.", "1", null, "Spiked Gauntlet", 30, new Guid("45507c8c-9c14-4105-bee1-8d74f35c2779"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("55158194-ce53-4931-818b-5c36289e4dba") },
                    { new Guid("9966d8d0-e1ae-4e62-9411-988d67474769"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This strong but slender staff is tapered at the ends and well balanced. It’s designed to be an offensive and defensive weapon.", "2", null, "Bo Staf", 20, new Guid("195ba1fc-dbcf-4884-8d33-b0c40b8c9e42"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("ade86474-5118-4236-81c2-a69905ff4d25"), null, "1d4", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "No description was provided for this weapon.", "1", null, "Fist", 0, new Guid("12830f77-7c87-420a-9a31-d439c3f6f7d1"), null, new Guid("9cfcad6d-a7e2-4833-ba41-86d88bee6fc7"), new Guid("55158194-ce53-4931-818b-5c36289e4dba") },
                    { new Guid("32823fbd-8598-4fc3-a9d9-769043cbce0f"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "Four curved blades attached to a sturdy handlebar give the wielder of this close-combat weapon the illusion of having claws that extend from their fist. Adherents of Bastet favor the tekko-kagi for catching their foes off guard.", "1", null, "Tekko-Kagi", 20, new Guid("d59eec71-20e8-49a6-82d4-9e5b309fa763"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("55158194-ce53-4931-818b-5c36289e4dba") },
                    { new Guid("0776b01d-d10c-41fa-8832-a7c718b7ff8e"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This kobold wire is thin and hard to see, making it perfect for an ambush. The wielder wraps the wire around a vulnerable spot, such as the neck, and twists it to inflict potentially fatal lacerations. The name derives from the use of a similar wire in traps, or slow fangs, with the word “slow” removed, as a fangwire gets quick results.", "1", null, "Fangwire", 400, new Guid("ae96e147-fe45-4bb1-821b-504c3658cd4a"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("55158194-ce53-4931-818b-5c36289e4dba") },
                    { new Guid("24f52641-1737-4761-8576-66710f258aab"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "The aklys is a throwing club with a hook on one end and a lengthy cord attached to the other. Though aklyses aren’t available in most shops, one might be purchased for 5 gp from a vendor that specializes in strange weapons.", "1", null, "Aklys", 500, new Guid("f87e5121-6a39-400e-898d-8a8e50faedba"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("08a0cd4f-fb35-497e-99ac-3949d11350e5"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d4", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This reinforced lute is suitable both for use as a handheld musical instrument and for bashing heads should a crowd turn sour. Its strings are finely braided wires that run along its sturdy metal neck.", "1", null, "Battle Lute", 1500, new Guid("4249a8a4-14e5-43e3-9d55-61065c75422b"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("3705d218-3b4f-4849-a69b-a04b0b94fa96"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "An exquisite sword cane is a sword sheathed inside a hollow cane, which itself can be used as a clubbing weapon with or without the sword sheathed inside.", "1", null, "Exquisite Sword Cane Sheath", 0, new Guid("7c07999f-a858-4646-be52-c7c6655b47e1"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("591ab477-94f8-40a2-9e03-217f7ebcf2a0"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "Many marsh giants fight with oversized gaffs—lengths of wood with a single metal spike affixed to the tip. Used often by fisherfolk to land fish, marsh giants use their gaffs as weapons.", "1", null, "Gaff", 100, new Guid("c2d4425b-1674-4596-828c-11d87458f016"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("f436ca8d-2f47-4935-8c36-f98c28d9fccf"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "While many greatclubs are intricately carved, others are little more than a sturdy tree branch. These massive clubs are too heavy to wield with only one hand.", "2", null, "Greatclub", 100, new Guid("0d581324-e4ad-48a2-97b1-aab565022eb8"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("8a71d87f-4e0a-4041-bb5c-a6902cd161f9"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "A juggling club is lighter than a typical club and balanced to be easily caught and thrown again by a juggler. While a juggling club deals less damage, the extra throwing distance its light weight allows is important for Juggling.", "1", null, "Juggling Club", 10, new Guid("2a4d437b-b98a-4786-b5cd-9e4fb0899bb5"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("50de7f64-76a6-4bf0-9d0e-0b57aea3ba85"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This staff is topped by a pointed metal circle from which hang several smaller rings that jingle and clang noisily as the staff is moved, allowing you to announce your presence and scare off wild animals as you walk.", "1", null, "Khakkara", 200, new Guid("9b0e10a8-cc3f-4639-b945-72c60f05bf5c"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("b40cb041-7b1c-49fc-8c54-8b66afce34ae"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "A light mace has a short wooden or metal shaft ending with a dense metal head. Used much like a club, it delivers heavy bludgeoning blows, but with extra power derived from the head’s metal ridges or spikes.", "1", null, "Light Mace", 40, new Guid("42c099df-55ea-40f8-81c5-6dfca855bbf2"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("d89d36ee-897d-4aa4-9a07-0689c276cbbc"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "With a stout haft and a heavy metal head, a mace is sturdy and allows its wielder to deliver powerful blows and dent armor.", "1", null, "Mace", 100, new Guid("56c7cb8f-9fb0-4fc9-95c3-09e592acd1bb"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("9ebc3552-f0fa-450e-96bc-a5d73d18c8ea"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This weapon has a short shaft ending in a metal ball studded with spikes.", "1", null, "Morningstar", 100, new Guid("a894bf57-ddd3-4cfa-a05c-0f886d627ae4"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("8dde67f3-49e5-4231-aa23-7e1d4abd63cc"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This collapsible baton consists of several nested, telescoping metal shafts that can be extended as a free action by flicking the wrist. Once extended to its full length (usually around 2 feet), the baton locks into shape until the wielder uses an Interact action to collapse it—a collapsed nightstick is 8 inches long, making it easily concealed. Lighter and more maneuverable than an ordinary club or truncheon, nightsticks are designed to subdue foes without causing permanent injury. A nightstick is an uncommon simple melee weapon.", "1", null, "Nightstick", 100, new Guid("1fc416c1-9963-4fc1-ba94-dab2a33c37ea"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("d1ad3308-48ce-4720-8d53-b1152ac0592f"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "The nunchaku is constructed of two wooden or metal bars connected by a short length of rope or chain.", "1", null, "Nunchaku", 20, new Guid("c957e89f-fb12-4dd2-a925-d5e7cb81e922"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("a460d789-3935-4629-a976-f9b71d96181c"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This heavy blade is favored by guardians of religious sites. It has a distinctive, crescent-shaped blade that seems to be a mix of a sickle and sword. It often has holes drilled into the blade or the pommel so that bells or other holy trinkets can be affixed to the weapon as an aid for prayer or mediation.", "1", null, "Temple Sword", 200, new Guid("210b63cd-cf1e-401e-9166-893d1b8bfb09"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("361b69e6-127f-4c0b-8a0a-b15f63778a76"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This specialized club is designed for throwing and is useful for both combat and hunting. Though gripplis didn't create the rungu originally, many grippli communities have adopted it as the weapon of choice for hunting creatures that hide high in treetops.", "1", null, "Rungu", 40, new Guid("4bb96701-ea4f-4e80-a828-fb86b3c81e4b"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("3f70b226-d857-45b6-9c37-6e00155566c5"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "A sap has a soft wrapping around a dense core, typically a leather sheath around a lead rod. Its head is wider than its grip to disperse the force of a blow, as the weapon’s purpose is to knock out its victim rather than to draw blood.", "1", null, "Sap", 10, new Guid("ff40af4d-5cff-4673-99c5-b7425edc948a"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("cda161dd-7e4a-4188-811d-41393677c421"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d4", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This long piece of wood can aid in walking and deliver a mighty blow.", "1", null, "Staff", 0, new Guid("c5a6f273-9672-4fdf-9202-727e5f9a3b01"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("3f47473d-20b7-44af-89d7-0b09b74e0665"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This weapon is a fully functional, lavish ink pen with a clip that can be attached to a pocket or bandoleer and easily retrieved as a free action. Using an action to Interact with the pen allows its wielder to disengage a stiletto blade that slides free of the upper body or reattach the previously removed blade.", "1", 1, "Stiletto Pen", 800, new Guid("83d1411d-23e1-4926-abd0-aa4ab8667b0c"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("79516d2f-0c2d-47d3-b411-5b02ae26022f") },
                    { new Guid("379c8c43-ea7f-4b62-884f-0a58a902d918"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This is a piece of stout wood shaped or repurposed to bludgeon an enemy. Clubs can be intricately carved pieces of martial art or as simple as a tree branch or piece of wood.", "1", null, "Club", 0, new Guid("b075bf13-2ed1-4686-837f-c5c511af261d"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b43977e7-788a-4a38-be49-2ed575e74362") },
                    { new Guid("9472e2e5-62d8-45b2-8885-af00f2dc2104"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This three-pronged, spear-like weapon typically has a 4-foot shaft. Like a spear, it can be wielded with one hand or thrown.", "1", null, "Trident", 100, new Guid("99fbb55f-8b58-4aa3-bf84-21ed96b51695"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("2a230c64-c4ef-4f84-ac75-a285f53bf115") },
                    { new Guid("1fab7871-c702-4a9f-b2f7-3571d96d5673"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This one-handed curved blade is sharp on one side.", "1", null, "Scimitar", 100, new Guid("45677aa9-d25c-4efe-bc7b-b78ccab28e12"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("897a279b-93d3-4467-8145-d3375067727b"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "These blades come in a variety of shapes and styles, but they are typically 2 feet long.", "1", null, "Shortsword", 90, new Guid("c42408e5-053d-4e50-8f97-2e50af1451b0"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("a6a7ebc7-6129-448c-8936-ae2bc8ceda7c"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This is a smaller version of an adze, useful for more delicate woodworking or projects in cramped spaces. Gripplis use the hand adze for crafting and as close quarters weapons.", "1", null, "Hand Adze", 50, new Guid("43895f3a-5f46-4fae-a25a-85dc5b30acbc"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("efc95190-6796-43f8-a457-743c988a0c3b") },
                    { new Guid("28896820-702d-47fa-8aa8-f3e6e5d9bf67"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This small axe can be used in close combat or thrown.", "1", null, "Hatchet", 40, new Guid("15df22c2-3d04-4e90-b348-13d104f28ec0"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("efc95190-6796-43f8-a457-743c988a0c3b") },
                    { new Guid("b40db133-eb32-4046-a667-61c7abcddd57"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "Also known as a hunga munga or danisco, this hybrid knife-axe consists of a hilt and a blade that curves backward toward the wielder. The curve of the blade is such that after a victim has been struck by a mambele, more damage is dealt as the weapon is extracted from the victim’s body.", "1", null, "Mambele", 60, new Guid("8c46b5bd-52f6-49bf-937a-dbc402a35f80"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("efc95190-6796-43f8-a457-743c988a0c3b") },
                    { new Guid("bb3d9d98-06cc-4e04-aedc-bcff42e9389b"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This single-bladed bearded axe has a jagged blade that’s perfect for separating bone from tendon and cartilage.", "1", null, "Orc Necksplitter", 200, new Guid("217fa626-b44b-4373-a436-41b4c4730380"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("efc95190-6796-43f8-a457-743c988a0c3b") },
                    { new Guid("f7b0c42c-87a4-45eb-8de6-12ca3fe71780"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This small axe sports a spike opposite the blade that aids in climbing and is useful in clearing obstacles, such as fallen rigging. This weapon is common in the High Seas region, on the Isle of Kortos and within azarketi settlements.", "1", null, "Boarding Axe", 100, new Guid("e677da1c-767e-4a45-9b62-af9984d2fa85"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("efc95190-6796-43f8-a457-743c988a0c3b") },
                    { new Guid("b4c97173-63ec-42a9-8605-b76a8ff0d352"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "These axes are designed explicitly as weapons, rather than tools. They typically weigh less, with a shaft reinforced with metal bands or bolts, and have a sharper blade, making them ideal for chopping limbs rather than wood.", "1", null, "Battle Axe", 100, new Guid("e6eb5ab1-dc03-406e-bcca-cef410baa276"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("efc95190-6796-43f8-a457-743c988a0c3b") },
                    { new Guid("7cd52d10-6bde-4be4-9435-2ab4d65f5390"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "A common cutting tool, an adze resembles an axe—but the cutting edge is horizontal, rather than vertical. The adze's shape makes it popular among wood workers, and grippli builders often use them to construct their treetop homes. The tool also serves as an effective weapon, due in part to the immense strength required to swing it.", "2", null, "Adze", 100, new Guid("fdc045a1-6bbd-4305-95a7-dfbab443580c"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("efc95190-6796-43f8-a457-743c988a0c3b") },
                    { new Guid("412f2018-c2f7-493f-b213-8fe8ca14b7ff"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "An Aldori dueling sword is a slim, single-bladed dueling sword with a slight curve and a sharp, reinforced point.", "1", 1, "Aldori Dueling Sword", 2000, new Guid("2a533ae3-a77e-4c69-8d1f-f65ca2ef0042"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("547dfb80-42d1-4cd0-8248-5a654cd4f0d5"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This broad-bladed sword, sometimes called the hand‑and‑a‑half sword, has a longer grip so it can be held in one hand or used with two hands to provide extra piercing or slashing power.", "1", null, "Bastard Sword", 400, new Guid("8356258e-e975-4a35-90c7-c4d7e5884ce7"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("09595caf-7209-4ffa-b4cc-524a9c9807c0"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "A blade of conrasu design, a buugeng has a unique, curved shape that allows it to rotate smoothly in the hand of a trained warrior. This spinning motion makes it easier to attack multiple foes at once with the weapon.", "1", null, "Buugeng", 400, new Guid("0df0f9b4-f422-4334-949b-0c62d75e5454"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("9bbc2b31-fae2-4ea1-8c7e-45896c24f111"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This short, curved, and crude makeshift blade often has holes drilled into it to reduce its weight. It’s a favored weapon of goblins.", "1", null, "Dogslicer", 10, new Guid("40e2f952-2c1f-4043-8f43-8c4f9f56a6bf"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("07b728c8-b6a9-4d6c-97ec-acda2ef83daa"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "Essentially a longer version of the scimitar, this traditional elven weapon has a thinner blade than its cousin.", "2", null, "Elven Curve Blade", 400, new Guid("6d40f8d4-0dfc-4bb0-9998-288dd43fcfea"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("32548452-7334-4260-b729-00272a3bd933"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This slender, rapier-like sword is concealed within a wooden or metal cane that serves as a sheath, making it an inconspicuous weapon easy to slip past inspections or into high-society events. A sword cane is typically 4 feet long when sheathed, and its hilt is usually capped with a wooden or metal decoration.", "1", null, "Sword Cane", 500, new Guid("0a469cd6-e92f-40c6-b7ee-916e412414b3"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("1ceff7bc-d37e-4931-9428-855519223128"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "A long metal shaft ending with a metal spike, a spear can be used one-handed as a melee weapon and can be thrown.", "1", null, "Spear", 10, new Guid("e70de524-eb29-4488-aedf-fe88c9332737"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("2a230c64-c4ef-4f84-ac75-a285f53bf115") },
                    { new Guid("ea69a9bc-a39b-4a43-90fc-c27ee0f776fd"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This weapon is a heavier, two-handed version of the curved-bladed scimitar. It is weighted toward the blade’s end, making it a powerful slashing weapon.", "2", null, "Falchion", 300, new Guid("232b9f8d-2696-4cb3-b52a-91973e6f4096"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("d68f9149-b9aa-48a1-b9a7-5469575ca977"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d12", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This immense two-handed sword is nearly as tall as its wielder. Its lower blade is often somewhat dulled to allow it to be gripped for extra leverage in close-quarter fights.", "2", null, "Greatsword", 200, new Guid("6ccbb228-7ac8-4df1-9092-fcc90f318197"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("b3b26911-43d7-4771-b374-19e3aac3033b"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "A katana is a curved, single-edged sword known for its wickedly sharped blade.", "1", null, "Katana", 200, new Guid("9079c6d1-f93b-4916-a0f0-20e0b8a0328d"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("c86b01ef-ff94-47a5-9f38-158665a053e1"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This curved sickle sword has a pointed tip, allowing it to be swung like a handaxe or thrust like a short sword. The tip of a khopesh is usually hooked so that it can be used to disarm an opponent’s shield or weapon.", "1", null, "Khopesh", 200, new Guid("c014a6c2-2d66-4026-b1ae-474a9cc92e8e"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("44cbf854-e9a3-4562-b5d5-f4b4ea583a76"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "Longswords can be one-edged or two‑edged swords. Their blades are heavy and they’re between 3 and 4 feet in length.", "1", null, "Longsword", 100, new Guid("d2c680c9-f47f-4bce-b8a8-d1c6690f11a4"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("afd07976-4043-4ab6-a964-43725fc49c3f"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This medium-length sword has a wide blade and long grip. Though it is typically used to hack through heavy foliage, the machete can also be used as a deadly weapon.", "1", null, "Machete", 70, new Guid("417e54fd-71ac-4621-83da-f139118aa46b"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("46dd2003-0ce1-492c-955b-508b574c4097"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This sword has a broad blade, along which are threaded nine heavy metal rings. The rings add weight to the weapon for downward swings, as well as clashing together to make noise.", "1", null, "Nine-Ring Sword", 90, new Guid("468fdb16-f40a-42fc-9956-77e507fd805e"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("24f3accf-0ba9-491d-94fc-4e8abe71ff23"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("3f2fe0bc-7952-4593-b9a6-d24b8aede62d"), "The polytool is a small metal rod with a number of simple tools folded inside. The user can extend a long ceramic blade, as well as an awl, a chisel, a file, flint and steel, a hook, an inkpen, a magnifying glass, pliers, scissors, and a small saw. The flint and steel can be used up to 10 times before needing to be replaced. Though inspired by advanced Numerian technology, the polytool is a simple enough feat of metalworking that any blacksmith could produce it— perfect for the goddess Casandalee to spread innovation farther than actual Numerian tech could reach.", "1", 1, "Polytool", 1000, new Guid("2f68749e-73f2-4fd7-81ad-440d303de9e5"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("15c3e1c8-357a-4c85-86c6-1c095482c6cf"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "The rapier is a long and thin piercing blade with a basket hilt. It is prized among many as a dueling weapon.", "1", null, "Rapier", 200, new Guid("329aeeb0-b8a9-4789-a3cc-b36c9f459b5a"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("c4d0ca3f-2c38-4603-ba33-205882d743a4"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "These dual-bladed swords are commonly used by urdefhan warriors.", "1", null, "Rhoka Sword", 400, new Guid("709fb88f-087b-4029-b388-d02ed75031b1"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("cc1b83d3-b2b8-4268-b434-e0d84b418d1b"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "The signature weapon of the Red Mantis assassins, this curved blade is serrated like a saw, hence the name.", "1", null, "Sawtooth Saber", 500, new Guid("f9fe72e6-dd0d-4721-9550-cdb6a86ec81f"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("4ac6f2cd-6fc3-400f-b524-fdaeaaaca2bc"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "These circular weapons are among the many strange weapons used by urdefhans. The sharp metal circle contains numerous protruding blades, while an angled central handle provides a decent grip that spins the weapon as it's thrown.", "1", null, "Tamchal Chakram", 500, new Guid("08b2d76c-3dd8-434f-be2e-87ab70369e8b"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("79516d2f-0c2d-47d3-b411-5b02ae26022f") },
                    { new Guid("8d2cf9bb-b236-417e-84b3-3710d02c6dbf"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "An exquisite sword cane is a sword sheathed inside a hollow cane, which itself can be used as a clubbing weapon with or without the sword sheathed inside.", "1", 4, "Exquisite Sword Cane", 9000, new Guid("c084b21a-06ee-4bc2-b30a-ac60369c99c1"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("3bf26277-c214-4a31-aa61-6ae3c3f75ea3"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This weapon consists of two bladed discs joined by a central axel, and is spun on a rope whose ends are attached to wand-like sticks. The wielder can hurl the diabolo from the rope like a stone from a sling, or swing it on the rope in melee.", "2", null, "Bladed Diabolo", 200, new Guid("f07df8e3-e1fa-4ca6-ae6b-6864594d348a"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("2c97c992-70f8-4dfa-950b-ebbaf0148267"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "The thin metal plates interwoven throughout this long scarf turn a fashion accessory into a deadly weapon.", "2", null, "Bladed Scarf", 300, new Guid("12be0d39-76bb-475b-b107-b2b4a8f87d48"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("6a5291fb-45dc-426b-8605-d808c123759c"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "Although grappling hooks typically serve as a climbing tool, this specially reinforced grapnel attached to a rope up to 10 feet long can be swung as a weapon. This is a martial melee weapon.", "2", 1, "Combat Grapnel", 90, new Guid("53c212b5-cb72-4f75-a597-98bdd4181af0"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("e3996bab-ff49-45d2-a295-c46fe7347717"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "These strange curved blades are jagged and deadly weapons made from the alchemically strengthened teeth of dead urdefhans. Each weapon is typically named for the urdefhan whose teeth were forged into the weapon, which are often carried (and revered) by that urdefhan's descendants. Magical shauth blades allow an urdefhan wielder to channel their Wicked Bite ability through shauth blade Strikes.", "1", null, "Shauth Blade", 200, new Guid("82483b0d-8bf1-4be2-a629-7d51914ce120"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("1b8c3bae-b8b0-4613-ab32-0103efb6bab0"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "No description was provided for this weapon.", "1", null, "Shears", 50, new Guid("8fe3990b-51c4-4f74-8279-6b2e7051b614"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("468f4c04-e696-47d6-a3e6-1f4e5f938ac9"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "Originally a farming tool used for reaping grain, this one-handed weapon has a short wooden handle ending in a curved blade, sometimes sharpened on both sides.", "1", null, "Sickle", 20, new Guid("3c1aa5df-53ee-428b-9aa6-d7d41b9a8dd0"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("46e21ee5-d51f-496f-861e-c50dbe21ccca"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "From a central metal ring, four tapering metal blades extend like points on a compass rose. When gripping a starknife from the center, the wielder can use it as a melee weapon. It can also be thrown short distances.", "1", null, "Starknife", 200, new Guid("c4485f05-26c5-4afa-9bd0-971c45bf9218"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("8c5fdda9-9bf1-44e1-9999-f09671d25abc"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This light knife is optimally balanced to be thrown accurately at a greater distance than a common dagger. While this comes at the cost of a significant cutting edge, the difference is worth it for characters focused on thrown weapons.", "1", null, "Throwing Knife", 30, new Guid("ea303bb0-d017-41a3-b9c3-58b6dc4cce0a"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("290046a3-6eac-414f-8374-d046ee27cfe9"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "A war razor is an exaggerated version of the barbers’ tool. It is a brittle but extremely sharp weapon that is very easy to slip into a pocket or sleeve.", "1", null, "War Razor", 30, new Guid("6d6a40c9-a864-4894-8d86-bba7d33c0dce"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("db430363-1e76-4b5c-ae80-8eae469a2fed"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "Much like a wish blade, the length of this knife is scored with intricate grooves capable of retaining energy. Wish knives are lighter than their counterparts, making them the weapon of choice for agile combatants.", "1", null, "Wish Knife", 200, new Guid("b1b09e15-ee47-4679-9b16-bb1a07a98e8b"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("35cbbb5f-ca93-4ddb-ae6d-e82b1505a446"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This pick has a longer handle and broader head than a regular pick. It is too heavy to wield in one hand.", "2", null, "Greatpick", 200, new Guid("bdaa0cbd-cd0d-4dc8-b129-d5891cecb88b"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("1c0f6d9d-1473-4505-8aa5-819a7fb94220") },
                    { new Guid("c723e7e5-5ee2-42c8-9aa8-3611cb1d5075"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "A light pick is a modified mining implement with a wooden shaft ending in a pick head crafted more to pierce armor and flesh than chip rocks.", "1", null, "Light Pick", 40, new Guid("867acff8-88aa-4b8c-a9a0-22f60ce34c83"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("1c0f6d9d-1473-4505-8aa5-819a7fb94220") },
                    { new Guid("5249b6ac-9cf9-4a95-9e28-e13f50cbc473"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "Ogres are known for using immense, curved picks called ogre hooks.", "2", null, "Ogre Hook", 100, new Guid("7830364d-bfa3-48a4-9848-3bb4f19de2b8"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("1c0f6d9d-1473-4505-8aa5-819a7fb94220") },
                    { new Guid("308d3bca-107b-4273-b235-1c6a98715e2b"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "A pick designed solely for combat has a sturdy wooden shaft and a heavy, pointed head to deliver devastating blows.", "1", null, "Pick", 70, new Guid("d4874f3d-88d6-4e29-989a-a32c49adda2a"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("1c0f6d9d-1473-4505-8aa5-819a7fb94220") },
                    { new Guid("c4b2cc2b-36d9-459f-9361-1660a0243944"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("3f2fe0bc-7952-4593-b9a6-d24b8aede62d"), "This ingenious kobold pick conceals several hidden traps, which the wielder can activate to trick and befuddle foes with a variety of damaging blades and bludgeoning surfaces.", "1", null, "Tricky Pick", 1000, new Guid("8bf406fa-0c9f-4013-a491-d0ef11f6cc6e"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("1c0f6d9d-1473-4505-8aa5-819a7fb94220") },
                    { new Guid("c0c4e1e1-fc1c-4a9e-8797-8f2eabaeec50"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "Taking the form of a longspear fitted with crossbars or hooks, a boarding pike provides its wielder a sharp implement that's as adept at shoving enemies off a ship's railings as facilitating the boarding of other vessels. This is a martial melee weapon.", "2", 1, "Boarding Pike", 80, new Guid("aa76307d-e009-4ee4-96a5-17aa0bbfa921"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("edfa81fd-1aca-46de-a75b-deb0465712ad") },
                    { new Guid("4b438ba2-4e10-4b00-bf4a-7ebb128a26be"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This piercing dagger is a metal spike flanked by a pair of prongs that can be used to trap an enemy’s weapon.", "1", null, "Sai", 60, new Guid("9cd382d1-77f8-4f36-9ca2-cb1851de819f"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("875d97cc-2d8f-4498-8659-00251e3f969c"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "A fauchard is similar to a glaive, save that its cutting edge is along the concave side. Fauchards are favored by Crimson Reclaimers for hacking through waves of zombies. The fauchard is a martial melee weapon.", "2", null, "Fauchard", 100, new Guid("2084884d-e0ed-4656-ab81-14730a7d2607"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("edfa81fd-1aca-46de-a75b-deb0465712ad") },
                    { new Guid("164fced7-fbaa-4e79-8eb2-5ea61cfa4f5e"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This polearm bears a long, often one‑sided, curved blade with a hook protruding from the blunt side of the blade, which can allow its wielder to trip opponents at a distance. Its shaft is usually 8 feet long.", "2", null, "Guisarme", 200, new Guid("ad92e182-3b2f-4b0a-80c2-b3d8fa404015"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("edfa81fd-1aca-46de-a75b-deb0465712ad") },
                    { new Guid("1aebb2a7-67df-47ed-b4f8-cceffc0b6662"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This polearm has a relatively short, 5-foot shaft. The business end is a long spike with an axe blade attached.", "2", null, "Halberd", 200, new Guid("7745b6f3-65fc-4ac1-b6b1-4d53754b0a99"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("edfa81fd-1aca-46de-a75b-deb0465712ad") },
                    { new Guid("c3d2c58d-904d-4fb5-9246-bc292a95ba8e"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "Created by goblins to battle horses, this weapon is essentially a long shaft ending in a blade with a large hook.", "2", null, "Horsechopper", 90, new Guid("4bde76d4-71e5-40d2-994e-473c24c1f2d5"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("edfa81fd-1aca-46de-a75b-deb0465712ad") },
                    { new Guid("cea48192-0fda-4dc9-a0ec-5df4ea926d35"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This 6-foot staff has a 2-foot-long, slightly curved, swordlike blade attached at one end. The long pole helps keep the wielder out of reach of swords and shorter weapons.", "2", null, "Naginata", 300, new Guid("a3653698-fe26-4e9d-a5ac-d528f42c6375"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("edfa81fd-1aca-46de-a75b-deb0465712ad") },
                    { new Guid("ba3999d5-d8fa-4263-b1f7-8d5913a080c0"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This polearm is a long trident with a central prong that’s longer than the other two.", "2", null, "Ranseur", 200, new Guid("e7a1dd57-3093-44ef-97de-085239426d5d"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("edfa81fd-1aca-46de-a75b-deb0465712ad") },
                    { new Guid("ebb0387b-9ca4-4031-b4b2-33ea47f77ebc"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "Derived from a farming tool used to mow down long grains and cereals, this weapon has a long wooden shaft with protruding handles, capped with a curved blade set at a right angle.", "2", null, "Scythe", 200, new Guid("b7173ed0-6293-4046-ad79-a70cebef4b1e"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("edfa81fd-1aca-46de-a75b-deb0465712ad") },
                    { new Guid("135ab393-82a4-4e63-9422-bac0c4586e10"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "1d4", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "A shield bash is not actually a weapon, but a maneuver in which you thrust or swing your shield to hit your foe with an impromptu attack.", "1", null, "Shield Bash", 0, new Guid("69470b82-09b8-4fd7-a4f2-8bc6fc1130ce"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("01553c8f-e4df-449c-8be8-cb8b30e1569d") },
                    { new Guid("144ba3e5-2778-4c37-ab98-7bd61556f902"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "Typically a round, convex, or conical piece of thick metal attached to the center of a shield, a shield boss increases the bludgeoning damage of a shield bash.", "1", null, "Shield Boss", 50, new Guid("ece86339-9bf6-4c12-8b41-3c6ab6ff6f13"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("01553c8f-e4df-449c-8be8-cb8b30e1569d") },
                    { new Guid("9a1f8c50-b677-423b-aada-c0e7f7b6d2ad"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "These metal spikes are strategically placed on the defensive side of the shield to deal piercing damage with a shield bash.", "1", null, "Shield Spikes", 50, new Guid("3e8a720e-68c7-41f9-9e34-3fae2ca39c3d"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("01553c8f-e4df-449c-8be8-cb8b30e1569d") },
                    { new Guid("285c5d1b-a837-4065-9005-28420b0b8e00"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This halfling weapon looks like a long, two-pronged fork and is used as both a weapon and a cooking implement.", "1", null, "Filcher's Fork", 100, new Guid("cd7c2cd0-bfe4-4175-9926-f65cb443f34e"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("2a230c64-c4ef-4f84-ac75-a285f53bf115") },
                    { new Guid("8f28ae9d-f0a6-4ed9-af09-e44de58acd82"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This spear has a specialized hook just before the tip that can catch on the gills of large fish. Azarketis primarily use this to hunt sharks, but it can also be used to hook flesh or armor. This weapon is common on the Isle of Kortos and within azarketi settlements.", "2", null, "Gill Hook", 200, new Guid("dd53aa21-92e7-4268-ad3a-76d4d3f48290"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("2a230c64-c4ef-4f84-ac75-a285f53bf115") },
                    { new Guid("27dd4f47-af0a-460f-9b4f-6d841b1d702e"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This spear-like weapon is used by a mounted creature to deal a great deal of damage.", "2", null, "Lance", 100, new Guid("ae37faf4-c071-4dd9-bdda-262e1495fc78"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("2a230c64-c4ef-4f84-ac75-a285f53bf115") },
                    { new Guid("f754f448-fa6a-43df-b1df-36b0c9897c27"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This very long spear, sometimes called a pike, is purely for thrusting rather than throwing. Used by many soldiers and city watch for crowd control and defense against charging enemies, it must be wielded with two hands.", "2", null, "Longspear", 50, new Guid("aae59ef0-a70c-4ef2-88db-be982251fe79"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("2a230c64-c4ef-4f84-ac75-a285f53bf115") },
                    { new Guid("af49cf0b-69d2-4fa4-820f-7b6806c213f3"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This polearm consists of a long, single-edged blade on the end of a 7-foot pole. It is extremely effective at delivering lethal cuts at a distance.", "2", null, "Glaive", 100, new Guid("ec2e8eb3-97fc-4c12-a81d-fbfc9ad51ad5"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("edfa81fd-1aca-46de-a75b-deb0465712ad") },
                    { new Guid("0b7a0bce-0829-4304-be0d-8fa7cd8c7232"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d12", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This large battle axe is too heavy to wield with only one hand. Many greataxes incorporate two blades, and they are often 'bearded', having a hook at the bottom to increase the strength of their chopping power.", "2", null, "Greataxe", 200, new Guid("68c1c395-1656-48cd-82f4-7e26a9354b47"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("efc95190-6796-43f8-a457-743c988a0c3b") },
                    { new Guid("43f6b330-380e-4767-be1f-a49120d115c8"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This stout, metal blade of orc design has a horizontal basket hilt with blades jutting from each end, or sometimes one blade like that of a katar.", "1", null, "Orc Knuckl eDagger", 70, new Guid("ae55b9c2-c9ee-4d71-9e74-31e1717845a9"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("a3dfa737-402e-48c5-8010-bf305d77ca60"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "The whip claw is a long tether affixed to clawlike daggers, allowing the wielder to fling and retract them with deadly precision. Catfolk developed this weapon to provide extended reach when hunting dangerous animals and wield them with unmatched expertise.", "2", null, "Whip Claw", 500, new Guid("5fcd29f0-25f5-4dd6-b4a4-f8828a27dfe6"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("af5dff58-65ad-402e-b78c-4cc9eee8e126"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4 B + 1d4 F", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "These special poi are made from a rare, light metal or from fire-retardant fibers and can be ignited before being wielded. Igniting a pair of fire poi is an Interact action and requires 1 pint of oil for every 10 minutes the poi remain ignited. While lit, fire poi cast dim light in a 10-foot radius; in combat, they deal 1d4 bludgeoning plus 1d4 fire damage. On a critical hit with a lit fire poi, the target takes 1 persistent fire damage. The fire can be extinguished using the Interact action. When unlit, the poi deal only the listed bludgeoning damage. Regardless of whether it is lit, the poi’s 1d4 bludgeoning damage is the weapon damage dice, so striking runes and other effects don’t affect the fire damage.", "1", null, "Fire Poi", 500, new Guid("6339002f-07a7-4021-a557-3d7bc6c3a120"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("0887fa4f-7650-443d-af1b-2d8e23fe5a8c"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This weapon consists of a wooden handle attached to a spiked ball or cylinder by a chain, rope, or strap of leather.", "1", null, "Flail", 100, new Guid("139c816a-ef93-4a2d-9867-0fd641a4f3dd"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("a954ad09-22bd-4f8b-945a-05dddea08cdc"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "More a flail than a mace, this weapon has a short handle attached to a length of chain with a ball at the end. The ball is propelled to its reach with the flick of the wrist, the momentum of which brings the ball back to the wielder after the strike.", "1", null, "Gnome Flickmace", 300, new Guid("477ef8a4-079c-4527-bbea-ab4a0cb22e7d"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("1c9e4d66-6360-4215-8686-1ab9d30655e3"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This weapon consists of a long chain connected to a heavy weight at one end. When a wielder swings the weight by the chain, it builds momentum and can serve as a deadly bludgeon with incredible reach.", "2", null, "Meteor Hammer", 300, new Guid("01c2bf73-7183-4dce-a282-edc644ada0ce"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("14f657da-fab9-4369-9fac-ded23f1d2b6f"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "Also called a 'slungshot', the monkey's fist is a short length of rope ending in a thick knot wrapped around a metal weight. You can tie the loose end of a monkey's fist to your wrist; if you are Disarmed, the weapon remains secured to your wrist rather than falling to the ground, though you must use an Interact action to grip it before using it again. A monkey's fist is a martial melee weapon.", "1", null, "Monkey's Fist", 10, new Guid("341b16f6-b1ad-4bd7-b3a0-5b9cccff4e1e"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("c4fd14aa-156a-4efe-9807-90cf492ed32e"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "Poi are light weights tethered to ropes or chains. Performers swing the weights, usually one in each hand, in rhythmic patterns.", "1", null, "Poi", 20, new Guid("e034be48-76a2-4af9-ba68-e06d3520a264"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("27e7a989-bd1f-4ed5-8cbe-4c1f5becda8d"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "A scorpion whip has a series of razor-sharp blades set along its tip. Unlike ordinary whips, a scorpion whip doesn’t have the nonlethal trait, making it deadlier in combat but less effective when the wielder seeks to bring in foes alive.", "1", null, "Scorpion Whip", 50, new Guid("c4d83249-2b91-4078-93b5-5e3a3acfec2e"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("299de1cf-c922-4a22-b924-38a9f345f8e7"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "A scourge (also known as a cat-o'-nine-tails) is a set of several knotted cords made from cotton or leather and attached to a handle. While most scourges are more suitable for torture than combat, the weapons used by the Order of the Scourge have metal barbs woven in to pierce clothing and armor. The scourge is a martial melee weapon.", "1", null, "Scourge", 10, new Guid("9525a2a2-bf28-40fe-a616-7d75151e2540"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("fdd7f7db-241e-4d1c-bc53-7b280dc679f1"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This metal chain bears hook-like barbs made of alchemically strengthened urdefhan teeth. Magical shauth lashes have the same ability to channel an urdefhan wielder's Wicked Bite as magical shauth blades, and urdefhans hold these weapons with the same reverence as they do shauth blades.", "2", null, "Shauth Lash", 800, new Guid("a764b309-d1f9-4236-9c0f-cc9d74c262d9"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("8ada012d-7bc9-4091-8cf7-889d0bbffe7e"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This 4‑foot‑long length of chain is covered with barbs and has spikes on one or both ends. Some feature metal hoops used as handgrips.", "2", null, "Spiked Chain", 300, new Guid("a815cf76-79c0-4130-936c-6468b6cda683"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("c6ef5724-8aff-41b3-b15d-dc83efc1299f"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "A bouquet of whiplike blades extends from the hilt of this sword.", "1", null, "Urumi", 200, new Guid("cc09c8b5-2efa-486a-b01b-9319085183f9"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("551297c6-7253-4b20-aa41-d290ed14cb26"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This large flail has a long shaft connected to a shorter piece of stout wood or metal that’s sometimes inlaid with spikes.", "2", null, "War Flail", 200, new Guid("9bb4957d-2781-4ee2-9b04-2b0f1a0123e4"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("35cd5f74-df96-445c-ac79-76372f2bb36e"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This long strand of thick leather, often braided, delivers a painful but nonlethal slash at a distance, usually accompanied by a distinctive cracking sound.", "1", null, "Whip", 10, new Guid("e5233e7f-ca17-4835-9efc-2544bef86514"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("708c03ec-921c-4296-8a96-4b48e8c48245") },
                    { new Guid("353d5fd0-a2b2-4676-a661-7238de6fe7c4"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This parrying dagger features a robust guard to protect the wielder’s hand.", "1", null, "Main-Gauche", 50, new Guid("c43594c0-daf3-44c1-a8b7-3753a0f6a089"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("14ab5e55-3b4a-445c-b2e0-9f938b9a4895"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This fan-shaped sword, designed by members of the tengu ancestry, has five broad blades that join at its hilt. Tengu sailors also use gale blades as makeshift weather vanes, as the sword spins to show the wind's direction when loosely held aloft.", "1", null, "Tengu Gale Blade", 400, new Guid("b47a76b0-18f2-42da-af53-9200251c89b1"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("d0b1390b-25b4-4302-91e0-4c80963125ce"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This favored weapon of the dwarves has a large, ornate head mounted on a thick handle. This powerful axe can be wielded with one hand or two.", "1", null, "Dwarven War Axe", 300, new Guid("23fd9739-93e5-4241-aaaa-4160682f213a"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("efc95190-6796-43f8-a457-743c988a0c3b") },
                    { new Guid("de40fe78-1d20-47a1-8024-b08ab26bcc02"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This smaller version of the warhammer has a wooden or metal shaft ending in a metal head. Unlike its heavier cousin, it is light enough to throw.", "1", null, "Light Hammer", 30, new Guid("d53dac66-26be-4dad-9ba5-c19d5857c578"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("3abdc611-2ead-4444-bc8f-68058807c060") },
                    { new Guid("3a7317bb-6d6a-47b0-8c99-6ac442e23675"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "The blade of this foot-long knife curves inward and lacks a cross guard at the hilt.", "1", null, "Kukri", 60, new Guid("6c659544-3faf-45d2-be68-df7b72a97005"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("6c3223d1-35e9-4273-a384-ffe2ea1b3da3"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "Also known as punching daggers, katars are characterized by their H-shaped hand grip that allows the blade to jut out from the knuckles.", "1", null, "Katar", 30, new Guid("350e2d8b-27a4-4168-88f9-e7cce0ada9d6"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("bc96e942-df78-4627-8876-f52c0bdb0d17"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "Similar to a sickle and used in some regions to reap grain, a kama has a short, slightly curved blade and a wooden handle.", "1", null, "Kama", 100, new Guid("eb2de2e5-441c-4e42-9cd2-0719cba66e57"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("3b7c5c1b-8be2-4152-bae1-475f9853919c"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This fan is useful for elegant dances as well as for slicing unsuspecting foes with the blades along its outer edge. If used in performances, it might be disguised as a frilly accessory, or it might be an obvious, though elegant, weapon.", "1", null, "Fighting Fan", 100, new Guid("e8013ef6-44c3-4d26-9818-3723d71e995d"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("d9ea2c6f-772e-455e-8cf3-dd6c5961ed06"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "Specialized grooves lined with unique, alchemically treated metals capable of retaining energy score the length of this sword. The first wish blades originated from genie smiths, and the knowledge of these weapons has been passed on to generations of geniekin, earning them the name wish blades.", "1", null, "Wish Blade", 500, new Guid("64f89b92-6a27-440a-9715-521682b5b35e"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("f828cf37-ae7a-4534-a5f3-d12558d731eb"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This gnome tool and weapon features a hammer at one end and a curved pick on the other. It’s such a strange and awkward weapon that others think the gnomes are slightly erratic for using it.", "1", null, "Gnome Hooked Hammer", 200, new Guid("cbbc98d4-cb52-4c9a-8d48-973996f7585b"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("3abdc611-2ead-4444-bc8f-68058807c060") },
                    { new Guid("d3109927-04c6-4ae8-9af1-e661cc2a5440"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This short-bladed, single-edged sword is typically carried as part of a pair alongside a katana.", "1", null, "Wakizashi", 100, new Guid("4ecf6cc9-2fbc-4bfd-adec-6a60538ffe3e"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("d8d3f1e4-f414-4b0b-889e-e7cf91cd1370") },
                    { new Guid("f5a772c0-8d78-4073-9b73-4b4c9fc8fbe3"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "The three parallel blades of this handheld weapon extend between the fingers to resemble the natural claws of the amurruns who created them, providing a way for those catfolk without suitable natural claws to share the fighting customs of their kin.", "1", null, "Claw Blade", 200, new Guid("0e11bd8a-0f5e-4de1-82b3-896568dbc2d1"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("2ef4b9ed-c528-44ec-9123-6b92234662c1"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This broad dagger is carried by dwarves as a weapon, tool, and designation of clan. Losing or having to surrender a clan dagger is considered a mark of embarrassment to most dwarves.", "1", null, "Clan Dagger", 200, new Guid("4a12349b-087d-4400-b37f-65d5297d16a2"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("c7facb69-2744-4cec-b9b6-28fab446d5e8"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("d047f71a-eead-4685-b09c-03e11ad29d8b"), "This circular hoop has blades along its outer edge. You can wield it in two hands (using the two-hand damage) or by spinning it around an arm. While you spin the hoop, it gains the free-hand trait. Setting the hoop spinning takes 1 Interact action. In addition to the normal restrictions of the free-hand trait, extended use of the arm for locomotion (such as to Climb) interferes with the hoop’s spinning and forces you to Release the hoop. You can’t spin a hoop underwater. Keeping the hoop spinning requires a free action each round, which has the concentrate and manipulate traits. You can keep a hoop spinning as an exploration activity, but doing so for more than 10 minutes makes you fatigued, similarly to Hustling.", "0+", null, "Bladed Hoop", 250, new Guid("9cc2bac0-af81-4e13-8b7a-98d1cc5d7f48"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") },
                    { new Guid("f6497e4f-3dc4-481b-81f6-ffc53c257503"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This weapon has a wooden shaft ending in a large, heavy metal head. The head of the hammer might be single-sided or double-sided, but it’s always capable of delivering powerful bludgeoning blows.", "1", null, "Warhammer", 100, new Guid("0ca55ad9-67ed-4071-92a1-93b1483ba4fc"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("3abdc611-2ead-4444-bc8f-68058807c060") },
                    { new Guid("29839132-c0a9-4422-b490-aa3c0ad8ad8e"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d12", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "Mauls are massive warhammers that must be swung with two hands.", "2", null, "Maul", 300, new Guid("f4676440-8f1c-4cfa-9078-ccc025699c50"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("3abdc611-2ead-4444-bc8f-68058807c060") },
                    { new Guid("d6be6a4e-d82a-4c7f-adc2-2742b985760d"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d4", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This small, bladed weapon is held in one hand and used to stab a creature in close combat. It can also be thrown.", "1", null, "Dagger", 20, new Guid("3bc128c1-e633-49fe-959d-23728af2894c"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("b50c2993-dcd3-4379-9b32-8bd6b9dff973") }
