            migrationBuilder.InsertData(
                table: "PreciousMaterials_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("f4e2ec82-b861-440f-a478-7cd743c3d640"), 0, new Guid("46176cae-7909-40a1-964a-2a4959dbc099"), "Darkwood is a very lightweight wood found primarily in old-growth forests in south-central Avistan; it is dark as ebony but has a slight purple tint. A darkwood item’s Bulk is reduced by 1 (or to light Bulk if its normal Bulk is 1, with no effect on an item that normally has light Bulk). The Price of an item made of darkwood is based on the item’s normal Bulk, not its reduced Bulk for being made of darkwood, but reduce the Bulk before making any further Bulk adjustments for the size of the item.", 0 },
                    { new Guid("dd297220-6c3a-4f32-808f-1db97da763fb"), 1, new Guid("3d6d6740-5c9f-480d-8752-0f5a2a5d432a"), "Raw warpglass is an opalescent glassy material with surprising strength. When worked, it changes its appearance—though not its properties—to appear as random striations of other metals and types of stone.", 0 },
                    { new Guid("2fa636c4-57a8-450e-9a25-3cce978f3c61"), 0, new Guid("ac517d80-af61-4e0a-a5b0-af7a9fc85789"), "Weapons made from cold iron are deadly to demons and fey alike. Cold iron looks like normal iron but is mined from particularly pure sources and shaped with little or no heat. This process is extremely difficult, especially for high-grade cold iron items.", 0 },
                    { new Guid("335d178d-d113-456c-a618-f8dd8c50fe7f"), 0, new Guid("949a7996-a817-48bf-b947-3646e248a25a"), "The most rare and valuable skymetal, orichalcum is coveted for its incredible time-related magical properties. This dull, coppery metal isn’t as physically sturdy as adamantine, but orichalcum’s time-bending properties protect it, granting it greater Hardness and Hit Points. If an orichalcum item takes damage but isn’t destroyed, it repairs itself completely 24 hours later.", 0 },
                    { new Guid("1abd5780-c3f7-4feb-b8c1-968033cf66d3"), 0, new Guid("3d6d6740-5c9f-480d-8752-0f5a2a5d432a"), "This bizarre substance is fashioned from the raw, chaotic quintessence of the Maelstrom. It can be fashioned into weapons and items, but is too unstable to make into useful armor or shields.", 0 },
                    { new Guid("b43177bf-d305-434a-bbcb-0ef6fc2e5bf8"), 0, new Guid("026b29b3-636f-4d3c-b8fb-7168090f3155"), "Created by Black Sovereign Kevoth-Kul, this unique alloy of cold iron and the skymetal noqual can provide protection from magical assault. The process of cold-forging the two materials together is quite complicated and precise. Characters in search of sovereign steel weapons and armor will almost assuredly have to travel to Starfall to procure gear made from this rare alloy. While some believe it possible to craft shields of sovereign steel as well, in one of his fits, Kevoth-Kul yelled that he had no use for them and banned anyone from making such a thing. So far, his smiths have been too afraid to confirm whether or not it was a joke. All sovereign steel items (including weapon and armor below) have a +4 circumstance bonus on saves against magic that the item makes, and grant their bonus to saves the owner makes specifically to protect the item from magic (such as against the rusting grasp spell).", 0 },
                    { new Guid("f2112b91-2fe0-4160-80af-bd9cfa4f77a5"), 0, new Guid("ec5767b8-cf91-447c-be08-9edc359c310a"), "Mithral is renowned for its lightness, durability, and effectiveness against a range of creatures including devils and lycanthropes. It has the same sheen as silver but a slightly lighter hue. Mithral weapons and armor are treated as if they were silver for the purpose of damaging creatures with weakness to silver. A metal item made of mithral is lighter than one made of iron or steel: the item’s Bulk is reduced by 1 (reduced to light Bulk if its normal Bulk is 1, with no effect on an item that normally has light Bulk). The Price of an item made of this material is based on the item’s normal Bulk, not its reduced Bulk for being made of mithral, but reduce the Bulk before making any further Bulk adjustments for the size of the item.", 0 },
                    { new Guid("5829ae74-0fca-4b15-937c-a6ef2dc17a5c"), 0, new Guid("2696e0dc-47a6-487c-9433-7d5dff4b4c0d"), "Mined from rocks that fell from the heavens, adamantine is one of the hardest metals known. It has a shiny, black appearance, and it is prized for its amazing resiliency and ability to hold an incredibly sharp edge.", 0 },
                    { new Guid("736cd527-7274-4ed9-8c7e-767fe2c1a4e7"), 0, new Guid("e0b4477f-abea-49ac-9bf0-2da2291a7215"), "Silver weapons are a bane to creatures ranging from devils to werewolves. Silver items are less durable than steel items, and low-grade silver items are usually merely silver-plated.", 0 }
                });

