                    { new Guid("10273eee-70b6-4b64-9119-e1ca2dc37a7f"), 0, new Guid("480f3fc8-55c9-4961-8572-5cc86cc4ca85"), "The item is metal and can include common minerals, like feldspar or quartz.", 0 },
                    { new Guid("b0047551-8881-4a42-a565-7579beab9b8c"), 0, new Guid("fa60eb32-a8f7-4129-ac79-86db2b0c6e85"), "The spell is more difficult to counteract and resist, but the cost is increased to 3350gp.", 0 },
                    { new Guid("8dffaa04-8c24-4fa4-b478-2efcc90c1a5b"), 0, new Guid("923762df-f025-49e3-9f23-b82e97f15e5a"), "You can feed 12 Medium creatures.", 0 },
                    { new Guid("e6c9e4fd-5660-4705-b1cb-6e1e7ed93d9b"), 0, new Guid("c15bae80-bafd-4214-a887-e8dc349d2a51"), "The spell is more difficult to counteract and resist, but the cost is increased to 30gp.", 0 },
                    { new Guid("6af0fd96-e785-48b6-928d-9836e6e0025c"), 0, new Guid("283ef60d-8ca4-463d-80cc-12bafa287dfc"), "You can target up to 10 creatures.", 0 },
                    { new Guid("8bb751c4-64ba-4146-97fd-b2cac56abf29"), 0, new Guid("25598434-fc72-4c97-b895-060cada42dda"), "The damage increases to 2d4 damage.", 0 },
                    { new Guid("fc636ff5-c742-41f6-8ba2-853c7c044221"), 0, new Guid("34a0a521-0496-4876-8e2e-1b7195af1f4b"), "You can target up to 10 creatures, and targets can also speak the language.", 0 },
