                    { new Guid("3bf1bb14-bdfd-440d-9066-045783f6932c"), 0, new Guid("0b4eadbc-0ed2-444c-997f-0e248309b869"), "Your battle form is Huge, your fly Speed gains a +15-foot status bonus, and your attacks have 10-foot reach. You must have enough space to expand into or the spell is lost. You instead gain AC = 21 + your level, 15 temporary HP, attack modifier +21, damage bonus +4 and double damage dice (including persistent damage), and Acrobatics +23.", 0 },
                    { new Guid("18b5fdc3-37cc-47e3-ae30-9e510ba66979"), 0, new Guid("461c1a6c-d9e9-4c24-82df-9799e0001811"), "Your battle form is Large and your fly Speed gains a +10-foot status bonus. You must have enough space to expand into or the spell is lost. You instead gain 10 temporary HP, attack modifier +18, damage bonus +8, and Acrobatics +20.", 0 },
                    { new Guid("aab0c30f-4a1b-499f-bd9c-8a26f616fb98"), 0, new Guid("ce2df890-5896-491e-a1f2-18a9808e1682"), "The initial damage increases by 2d8, and the persistent acid damage increases by 1d6.", 0 },
                    { new Guid("44d1af8e-b3a2-4726-863e-8669acd62fe3"), 0, new Guid("94452491-58bd-487f-b187-8525fe6a0160"), "The damage increased by 1d4.", 0 },
                    { new Guid("b80d3ed5-a258-46bf-aba7-9f4623cac77a"), 0, new Guid("637c1c9a-e2f9-497d-85fc-9ca72fbba552"), "The damage increases by 1d6.", 0 },
                    { new Guid("a1ef296a-a8d5-40bd-94cf-6d2ed7f47ebe"), 0, new Guid("0e4f844c-c605-4423-9321-ca5241df1950"), "As 3rd level, but you also pinpoint the source of the highest-level magic. Like for an imprecise sense, you don’t learn the exact location, but can narrow down the source to within a 5-foot cube (or the nearest if larger than that).", 0 },
                    { new Guid("86320f63-c48b-4b85-86fc-1fe0acef448e"), 0, new Guid("c9d1c03b-32b0-4182-ad71-89f87576f5a7"), "You learn the school of magic for the highestlevel effect within range that the spell detects. If multiple effects are equally strong, the GM determines which you learn.", 0 },
                    { new Guid("ef8617df-09c3-4aca-b07d-4e61bd26ed06"), 0, new Guid("aa381ca0-7a43-4e1b-9d5d-2ad73be5255d"), "The damage increases by 1d6.", 0 },
                    { new Guid("e508583c-8cdb-4634-91ff-dd70e33fd411"), 0, new Guid("4c4341f2-16d9-4a55-b504-418231e4b9fe"), "The negative damage to living creatures increases by 1d4.", 0 },
                    { new Guid("24b63a1a-f410-4c85-b5c4-a11feab9fde1"), 0, new Guid("a7a384da-ca83-4941-969f-668d59f18cb5"), "The initial damage increases to 4d6 + your spellcasting ability modifier, the persistent damage increases to 5, and the splash damage increases to 4.", 0 },
                    { new Guid("cc25bc79-a18b-4e1e-81bc-e63aa1a91cfa"), 0, new Guid("107e9a96-572d-40b9-87d9-bf36b2302260"), "The initial damage increases to 3d6 + your spellcasting ability modifier, the persistent damage increases to 4, and the splash damage increases to 3.", 0 },
                    { new Guid("9a0f3e61-e70a-43d8-b9b8-83be2811e5a3"), 0, new Guid("07445e05-eccc-4463-b72a-ab813e961d2e"), "The initial damage increases to 2d6 + your spellcasting ability modifier, the persistent damage increases to 3, and the splash damage increases to 2.", 0 },
                    { new Guid("672a2316-1939-4b9f-9cfb-624830f43fce"), 0, new Guid("9da22e21-d1e7-43d1-88e8-e95065c242db"), "The initial damage increases to 1d6 + your spellcasting ability modifier, and the persistent damage increases to 2.", 0 },
                    { new Guid("0a64260a-8855-434a-a9b7-1d3ea34ead92"), 0, new Guid("63371eec-c1ea-4dcb-8c53-e72fe03224a8"), "You instead gain 10 temporary HP, AC = 17 + your level, attack modifier +14, damage bonus +5, and Athletics +14.", 0 },
                    { new Guid("c3270595-28ea-4452-a365-8a9d0785edca"), 0, new Guid("e6a136cc-0056-439b-b6a2-dd406c4b5752"), "The damage increases by 2d6.", 0 },
                    { new Guid("81f48c2e-9615-4236-980b-f982843d0ae7"), 0, new Guid("62d0851a-cc5e-462c-aee1-1b5e812ac054"), "Your battle form is Large and your attacks have 10-foot reach. You must have enough space to expand into or the spell is lost. You instead gain 15 temporary HP, AC = 18 + your level, attack modifier +16, damage bonus +9, and Athletics +16.", 0 },
                    { new Guid("50f4a710-bd37-412d-bd42-75ccf627066e"), 0, new Guid("7bd4ff03-9047-4baa-939e-312c7924b42d"), "Your battle form is Huge and your attacks have 15-foot reach. You must have enough space to expand into or the spell is lost. You instead gain 20 temporary HP, AC = 18 + your level, attack modifier +18, damage bonus +7 and double the number of damage dice, and Athletics +20.", 0 },
                    { new Guid("7ebed77a-cd19-4c03-ac0d-4cf9eaa438a3"), 0, new Guid("d523848c-c447-477b-b8f3-48dc196055ef"), "The target can also speak the language.", 0 },
                    { new Guid("baf914d7-0d96-40cb-aac0-fe72bbb3fb37"), 0, new Guid("dae11cb9-b62c-4073-827c-635821ed5e74"), "You can target up to 10 creatures.", 0 },
                    { new Guid("7d8155fe-ac83-40db-89b1-c8cce3e762f5"), 0, new Guid("548e581b-6bf6-4a27-9622-996ca1e4e8ff"), "The number of targets increases by 1.", 0 },
                    { new Guid("b76a367e-5acb-4939-af0e-e955b770a0d0"), 0, new Guid("8e38a5fc-f74d-4c0a-b653-4bc2c4610d9e"), "The number of targets increases by 1.", 0 },
                    { new Guid("b1598565-4cb0-4656-bfcb-16b7b5d336fa"), 0, new Guid("5da315c4-0930-4154-803d-1d618e8073a4"), "The duration increases to 1 hour.", 0 },
                    { new Guid("10b435c4-4477-4d2c-87fd-cbaf49922875"), 0, new Guid("070c4a22-2028-4361-89b5-ef690dd3fa6b"), "The spell’s duration increases to 1 hour. Roll 1d8 to determine the wall’s color; the results for 5–8 are below.A red, orange, yellow, or green wall deals an extra 10 damage.", 0 },
                    { new Guid("85866a6b-4934-4b35-b98e-0f99876fe455"), 0, new Guid("4e928728-b53f-43e2-acbe-7b93732500e9"), "The cold damage increases by 2d6, and the evil damage against celestials increases by 2d6.", 0 },
                    { new Guid("470cd40d-caa3-4188-8862-a59f41eff543"), 0, new Guid("99a5bbf6-51c5-4e42-ba6b-e1155c40d500"), "The duration lasts until the next time you make your daily preparations, and you can target up to 10 creatures.", 0 },
                    { new Guid("02e87545-e884-4321-8b76-fc41fbb44bd2"), 0, new Guid("8fad2d3e-740c-4f51-bb8d-8abe84a24783"), "The duration lasts until the next time you make your daily preparations.", 0 },
                    { new Guid("87d75997-6b09-4e5d-9adc-df001c60a730"), 0, new Guid("e7d4ce94-e923-43fb-bcc9-e34987534372"), "The damage increases by 1d12.", 0 },
                    { new Guid("e40d5cb9-53ed-44ed-a996-e81ba3b76103"), 0, new Guid("0433232e-b381-4a6d-bd3c-404bfdedb535"), "The damage increases by 2d6.", 0 },
                    { new Guid("74827007-1d12-462a-a927-1324a4bf22ae"), 0, new Guid("84e120a3-6dd6-4348-9a07-934858f71840"), "The resistance increases by 3.", 0 },
                    { new Guid("9f8a17ee-eb90-4fca-b9a5-345a645fde4f"), 0, new Guid("3a1aa8fe-d985-4af4-a664-e7ceed761d9d"), "The damage increases by 1d8.", 0 },
                    { new Guid("03056dae-e94d-4ffd-8cf1-f06172f6380c"), 0, new Guid("4a665729-f77d-4c8c-8f00-dd3fe078e3d8"), "The resistances increase by 2, and the weakness increases by 3.", 0 },
                    { new Guid("d8510f7f-7901-415d-970e-68f0949a82b7"), 0, new Guid("62d6f3f0-5ae7-4ceb-b943-d716a9d05586"), "You can target up to 10 creatures. The extra material component affects targets to which it is anathema.", 0 },
                    { new Guid("239f5167-8c42-4002-99cd-8447f93db2dd"), 0, new Guid("766b8628-93b0-4a8f-baf9-d7be6eb4e957"), "Target up to three weapons, and the damage increases to 3d4 damage.", 0 },
                    { new Guid("86437516-b358-41b6-81ff-63f6d142fae3"), 0, new Guid("3ce62722-4290-4b4b-949f-d0698ff70202"), "The damage increases by 2d10.", 0 },
                    { new Guid("8683a40b-d930-463a-8063-c4e07c76b89e"), 0, new Guid("842ac0e3-6867-4a83-b8fa-8e60db388251"), "The temporary Hit Points increase to 60, the weakness increases to 15, and the duration increases to 10 minutes.", 0 },
                    { new Guid("4cd9a795-3ecc-42e2-81e7-157af0a80bd6"), 0, new Guid("18cca2c1-2c7b-4486-b085-734cebf5f52d"), "The damage increases by 1d10, and the level of creatures that must attempt a second save on a critical failure increases by 2.", 0 }
                });

