            migrationBuilder.InsertData(
                table: "Traits_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("189c2680-9a03-4a89-9225-525e96e40ff5"), 0, new Guid("9e216e7c-93cf-4daa-b628-f97109c3564a"), "Once you’ve played through the listed Adventure Path, these rare backgrounds can become available in your future campaigns after the events of this Adventure Path.", 0 },
                    { new Guid("74a80564-5070-4df8-9915-aeaf98b6a443"), 0, new Guid("87603781-d242-4b02-ad1c-53d2748f8878"), "Gripplis craft and use these weapons.", 0 },
                    { new Guid("e79963c4-3003-4350-821c-924049b65954"), 0, new Guid("ef0bc534-d48e-4fad-9348-95c5dc5ca90f"), "Anadis are peaceful, reclusive humanoids who live deep within woodlands, jungles, and other untamed areas of wilderness. Their natural forms resemble humanoid spiders covered in beautiful and distinctive markings of varying colors.", 0 },
                    { new Guid("bd7b5cc7-a5b6-436b-a8e9-d6b4ee6fc14f"), 0, new Guid("b2c4b14f-bb2f-42a4-a4bc-6e0ef6df2ebe"), "A contract is a type of item that magically establishes an agreement between multiple parties and typically grants magical benefits.", 0 },
                    { new Guid("f5cb6d8b-029b-4344-b202-edd18ec95596"), 0, new Guid("9b0d55c4-92f6-45da-beaf-bd3dce46f96d"), "A family of fiends from the Shadow Plane that are associated with pain and agony. All velstracs possess some form of disturbing gaze.", 0 },
                    { new Guid("00e18b57-6195-4c8d-bf01-375261f4665a"), 0, new Guid("ce610077-804d-463e-abc8-9e6c07c05029"), "The divination school of magic typically involves obtaining or transferring information, or predicting events.", 0 },
                    { new Guid("31a55c3e-46ca-4765-9388-6b6f5383c154"), 0, new Guid("5d679bee-63d6-4377-ae25-7ba3f82cb3b5"), "This magic comes from the divine tradition, drawing power from deities or similar sources. Anything with this trait is magical.", 0 },
                    { new Guid("642773a7-1794-4e74-81ad-38f05d3b50a1"), 1, new Guid("2ada1501-9857-49e8-ac4f-d97750797df4"), "Because of their considerable power, all Saggorak runes take up two property rune slots, and consequently they can be applied only to armor and weapons with at least a +2 potency rune.", 0 },
                    { new Guid("12e18d98-6a3f-40fd-95eb-843fec7cd654"), 0, new Guid("2ada1501-9857-49e8-ac4f-d97750797df4"), "Ancient dwarven blacksmiths in Saggorak designed a series of spectacularly powerful runes. Only someone with legendary proficiency in Crafting, or a well-versed dwarven crafter from the city of Kovlar, can apply, transfer, or remove a rune with the Saggorak trait.", 0 },
                    { new Guid("178916c0-b3f4-4fe2-b84e-9889d4cd114d"), 0, new Guid("8b1df142-8e1c-4c4e-8ca0-f07ba4fd634c"), "Light effects overcome non-magical darkness in the area, and can counteract magical darkness. You must usually target darkness magic with your light magic directly to counteract the darkness, but some light spells automatically attempt to counteract darkness.", 0 },
                    { new Guid("f1abc3ca-eefb-45bd-bce0-f270803a1738"), 0, new Guid("50665b47-21f0-4bc7-93c6-df8227a5dcff"), "There was not explicit description for this trait.", 0 },
                    { new Guid("382722a4-3802-4ede-a149-7312c9ddbf1e"), 0, new Guid("381a10e1-fed0-4758-ab43-cd74b3bf3362"), "A hazard with this trait is a spiritual echo, often of someone with a tragic death. Putting a haunt to rest often involves resolving the haunt’s unfinished business. A haunt that hasn’t been properly put to rest always returns after a time.", 0 },
                    { new Guid("010bf1d9-99c0-4223-a0e6-d0e05a2eba5d"), 0, new Guid("bd45aa85-b7e8-4425-ad9b-546b1f073e65"), "The fatal trait includes a die size. On a critical hit, the weapon’s damage die increases to that die size instead of the normal die size, and the weapon adds one additional damage die of the listed size.", 0 },
                    { new Guid("fa2bd0ca-608a-4236-a141-a3f8afd1acc5"), 0, new Guid("6361484d-f41f-425d-9222-e82596f421be"), "This effect or item creates an extradimensional space. An extradimensional effect placed inside another extradimensional space ceases to function until it is removed.", 0 },
                    { new Guid("be9409c2-a5b4-456c-8d32-f2d5628c61bc"), 0, new Guid("6adbe888-3fd9-4137-afc8-af4bd6f674a9"), "A healing effect restores a creature's body, typically by restoring Hit Points, but sometimes by removing diseases or other debilitating effects.", 0 },
                    { new Guid("3e3ae488-8404-48eb-83d2-a7f823f555ef"), 0, new Guid("8d112e3c-c8da-4a95-aee2-38e209e3f32d"), "A creature with this trait is a member of the human ancestry. Humans are a diverse array of people known for their adaptability. An ability with this trait can be used or selected only by humans.", 0 },
                    { new Guid("03275420-8229-4ffb-add5-90cccef19b5b"), 0, new Guid("1085d8c5-4223-408b-8016-681c28237248"), "Humanoid creatures reason and act much like humans. They typically stand upright and have two arms and two legs.", 0 },
                    { new Guid("69ead9e1-720b-4c26-9e4d-624a6f868be6"), 0, new Guid("51d79f88-951a-49bc-b45d-ddf2a8a1c793"), "An activity with this trait takes more than a turn to use, and can usually be used only during exploration mode.", 0 },
                    { new Guid("1f28b7db-8b35-49bc-a5e6-3fb78bd3a9e7"), 0, new Guid("16d2758a-935b-4552-b8ae-7eb36d6bf3d1"), "Effects and magic items with this trait are associated with the evocation school of magic, typically involving energy and elemental forces.", 0 },
                    { new Guid("5a2ba241-31d3-4743-819e-055b39f8a15b"), 0, new Guid("4ec8b734-6099-4b0e-97cc-2bf987a8bcbe"), "Effects and magic items with this trait are associated with the illusion school of magic, typically involving false sensory stimuli.", 0 },
                    { new Guid("4c7c1d4b-a569-4739-b631-884d86d0ef1f"), 0, new Guid("e3085a07-4bd0-42c7-80c3-75a714c596e8"), "An ability with this trait can take a character completely out of the fight or even kill them, and it’s harder to use on a more powerful character. If a spell has the incapacitation trait, any creature of more than twice the spell’s level treats the result of their check to prevent being incapacitated by the spell as one degree of success better, or the result of any check the spellcaster made to incapacitate them as one degree of success worse. If any other effect has the incapacitation trait, a creature of higher level than the item, creature, or hazard generating the effect gains the same benefits.", 0 },
                    { new Guid("a7fdf825-5831-4064-9e56-f60021840ad0"), 0, new Guid("fe38dce6-c98c-4641-8092-2b3bedf58746"), "You created an alchemical item with the infused trait using your infused reagents, and it has a limited time before it becomes inert. Any nonpermanent effects from your infused alchemical items, with the exception of afflictions such as slow-acting poisons, end when you make your daily preparations again.", 0 },
                    { new Guid("d0132589-2177-40c9-b603-bb1fca12400f"), 0, new Guid("1fe62d2e-464f-4972-95a2-d82d4b0dc4b3"), "This poison is delivered when drunk or eaten.", 0 },
                    { new Guid("a8b0a1ef-c1c5-45d8-89d2-f127454592c9"), 0, new Guid("ff6709fa-7a60-44c2-8aaf-83d8726fa77c"), "A tattoo is a type of item that is drawn or cut into a creature’s skin and usually takes the form of images or symbols.", 0 },
                    { new Guid("57a8813f-f2ae-4b7d-896a-1f1f0e24c9fa"), 0, new Guid("3df38b30-053a-4db0-9651-7bae935f2e38"), "This poison is delivered when breathed in.", 0 },
                    { new Guid("4495eba2-3cbc-472f-aaef-81050932b900"), 0, new Guid("cee766b5-0cb1-4320-ad4e-3e625bd6e7ef"), "Evil effects often manipulate energy from evil-aligned Outer Planes and are antithetical to good divine servants or divine servants of good deities. A creature with this trait is evil in alignment.", 0 },
                    { new Guid("8cf5e32f-e6eb-429d-b4bf-db9abf49028b"), 0, new Guid("c5df9651-d3e6-443f-8811-dbdc43ccb52c"), "Ethereal creatures are natives of the Ethereal Plane. They can survive the basic environmental effects of the Ethereal Plane.", 0 },
                    { new Guid("436b528e-849e-4d26-b39e-684ec6fe5eeb"), 0, new Guid("2f66206a-becd-4280-9a14-df7feebd834d"), "A hazard with this trait is something dangerous that’s part of the natural world, such as quicksand or harmful mold.", 0 },
                    { new Guid("926be628-eabd-4990-aa1e-af178a6fb795"), 0, new Guid("88966eec-598e-44d1-b1e4-4272e4b79423"), "This poison is delivered by damaging the recipient.", 0 },
                    { new Guid("3a002415-2454-4a48-9c48-d486776f289a"), 0, new Guid("583136ca-8e2e-47bc-b9c4-d6f6286b5aea"), "Instinct abilities require a specific instinct; you lose access if you perform acts anathema to your instinct.", 0 },
                    { new Guid("14b3b19f-8863-4bc6-9da8-15cd92097781"), 0, new Guid("acf154b6-1967-4305-a859-4bcd362a2cd4"), "A character can wear only 10 magical items that have the invested trait. None of the magical effects of the item apply if the character hasn’t invested it, nor can it be activated, though the character still gains any normal benefits from wearing the physical item (like a hat keeping rain off their head).", 0 },
                    { new Guid("3c8f7994-b9d8-4a94-a83c-6b18f78c9d1f"), 0, new Guid("632903e9-caec-4f21-ae87-cc0138297453"), "The weapon is suited for mounted combat with a harness or similar means. When mounted, if you moved at least 10 feet on the action before your attack, add a circumstance bonus to damage for that attack equal to the number of damage dice for the weapon. In addition, while mounted, you can wield the weapon in one hand, changing the damage die to the listed value.", 0 },
                    { new Guid("8caec97b-bcb4-42a5-9d2c-e42db6d4e74a"), 0, new Guid("6b08aa5d-7dc6-4dec-bb51-0a0aa0ab925d"), "A creature with this trait is a member of the halfling ancestry. These small people are friendly wanderers considered to be lucky. An ability with this trait can be used or selected only by halflings. A weapon with this trait is created and used by halflings.", 0 },
                    { new Guid("ab9a1e3f-f1d5-4652-8cf3-7b748516bb38"), 0, new Guid("4f09be8d-d633-483d-b450-8c10d3cdb126"), "Shapeshifting humanoids whose true forms resemble foxes.", 0 },
                    { new Guid("9e0643e4-c36b-47ab-afeb-dc8de5df6058"), 0, new Guid("de6ac5ab-22d1-4f10-b94d-07ea9ce22778"), "A creature with this trait is part human and part orc. An ability with this trait can be used or selected only by half-orcs.", 0 },
                    { new Guid("d97e3df5-91b7-4e41-a0d1-3432fd4829f5"), 0, new Guid("380d5cc3-0d40-4636-b23e-dc090a807cfb"), "A creature with this trait is part human and part elf. An ability with this trait can be used or selected only by half-elves.", 0 },
                    { new Guid("a88a8a71-8b22-47ff-a96f-e7ced5b79453"), 0, new Guid("0c938c14-65bc-4847-9da2-e88318f39994"), "Fungal creatures have the fungus trait. They are distinct from normal fungi.", 0 },
                    { new Guid("e9ef051b-8dac-4026-a3d2-224b42f30e14"), 0, new Guid("c12bd84b-b3f2-4cc8-b579-eee078031c4d"), "This weapon doesn’t take up your hand, usually because it is built into your armor. A free-hand weapon can’t be Disarmed. You can use the hand covered by your free-hand weapon to wield other items, perform manipulate actions, and so on. You can’t attack with a free-hand weapon if you’re wielding anything in that hand or otherwise using that hand. When you’re not wielding anything and not otherwise using the hand, you can use abilities that require you to have a hand free as well as those that require you to be wielding a weapon in that hand. Each of your hands can have only one free-hand weapon on it.", 0 },
                    { new Guid("8b837808-9adb-44be-8371-e6a9e5f0bbfd"), 0, new Guid("242c1cf5-3168-473e-ae16-c375594352e0"), "A fortune effect beneficially alters how you roll your dice. You can never have more than one fortune effect alter a single roll. If multiple fortune effects would apply, you have to pick which to use. If a fortune effect and a misfortune effect would apply to the same roll, the two cancel each other out, and you roll normally.", 0 },
                    { new Guid("710b1f87-71a2-46dd-bc67-de76fa3f7c29"), 0, new Guid("220dd07b-029e-42f9-b541-03c1cac8c816"), "This weapon becomes more dangerous as you build momentum. When you attack with it more than once on your turn, the second attack gains a circumstance bonus to damage equal to the number of weapon damage dice, and each subsequent attack gains a circumstance bonus to damage equal to double the number of weapon damage dice.", 0 },
                    { new Guid("2b63edc6-9758-4e43-83cd-37d407688bb0"), 0, new Guid("d7be685f-711c-4cf3-8414-670d8dd64144"), "Effects with this trait deal force damage or create objects made of pure magical force.", 0 },
                    { new Guid("2d7a0720-08dc-4d10-864a-fe54927c2494"), 0, new Guid("66183f60-3966-425e-a2a1-e825c64c190a"), "An item with this trait can give you an additional Focus Point. This focus point is separate from your focus pool and doesn’t count toward the cap on your focus pool. You can gain this benefit only if you have a focus pool, and there might be restrictions on how the point can be used. You can’t gain more than 1 Focus Point per day from focused items.", 0 },
                    { new Guid("43f8e776-2286-4ece-b430-0242db6820af"), 0, new Guid("b7aca55c-9472-406d-b89a-ceeb5298e2db"), "Flourish actions are actions that require too much exertion to perform a large number in a row. You can use only 1 action with the flourish trait per turn.", 0 },
                    { new Guid("acb79433-e007-475c-87f4-616d32f8024b"), 0, new Guid("42f5364e-7923-4d7e-affc-d71e511e2369"), "The armor is flexible enough that it doesn’t hinder most actions. You don’t apply its check penalty to Acrobatics or Athletics checks.", 0 },
                    { new Guid("39d7cbb5-262f-4487-a521-40c964c44cc0"), 0, new Guid("ad8d0e67-98c5-418e-82e5-03791fdee791"), "Effects with the fire trait deal fire damage or either conjure or manipulate fire. Those that manipulate fire have no effect in an area without fire. Creatures with this trait consist primarily of fire or have a magical connection to that element. Planes with this trait are composed of flames that continually burn with no fuel source. Fire planes are extremely hostile to non-fire creatures.", 0 },
                    { new Guid("5ae8ebba-6d0b-4237-a643-b756067019d6"), 0, new Guid("438eae4a-2899-4298-b51d-f8aff9c504dd"), "You can use your Dexterity modifier instead of your Strength modifier on attack rolls using this melee weapon. You still use your Strength modifier when calculating damage.", 0 },
                    { new Guid("62d0e693-87ca-4274-81c4-3143448c1f36"), 0, new Guid("b78639ca-0745-40de-8940-6eadefd13753"), "This indicates abilities from the fighter class.", 0 },
                    { new Guid("a1d8efc1-0d73-4f00-9c77-b16c8c20ab2f"), 0, new Guid("166f8aea-94f8-42a9-b506-215ffb4a72a1"), "Creatures that hail from or have a strong connection to the evil-aligned planes are called fiends. Fiends can survive the basic environmental effects of planes in the Outer Sphere.", 0 },
                    { new Guid("c4bd73d8-7828-4a6b-8a6c-de62d217fa2f"), 0, new Guid("f1ca6a72-114b-42cd-9b25-10710347eaed"), "Creatures of the First World are called the fey.", 0 },
                    { new Guid("9e31265b-65dc-4139-abaa-ab1c718c7c41"), 0, new Guid("74e59198-7926-491e-a7f6-62e21d4b8e69"), "Fear effects evoke the emotion of fear. Effects with this trait always have the mental and emotion traits as well.", 0 },
                    { new Guid("b624faca-546b-4a05-a053-6cf20e591a4a"), 0, new Guid("a5bb022d-6274-4469-bae7-cb2ebc126b90"), "A type of feat that any character can select, regardless of ancestry and class, as long as they meet the prerequisites. You can select a feat with this trait when your class grants a general feat.", 0 },
                    { new Guid("f54796e3-027d-41b4-b224-bf229e12af1f"), 0, new Guid("07978a9c-d0d4-46ab-b003-f8bc019f3dae"), "Giants are massive humanoid creatures.", 0 },
                    { new Guid("61d64090-54d0-4076-9739-d36f25a9e92c"), 0, new Guid("e108b7ec-3756-4e04-a806-62f55611379c"), "A creature with this trait is a member of the gnome ancestry. Gnomes are small people skilled at magic who seek out new experiences and usually have low-light vision. An ability with this trait can be used or selected only by gnomes. A weapon with this trait is created and used by gnomes.", 0 },
                    { new Guid("1e3bdc89-a872-4bce-b93f-64c866217f02"), 0, new Guid("70348794-b594-4be3-967c-f6ccd30738a8"), "A creature with this trait can be one of several kinds of creature, including goblins, hobgoblins, and bugbears. Goblins tend to have darkvision. An ability with this trait can be used or chosen only by goblins. A weapon with this trait is created and used by goblins.", 0 },
                    { new Guid("70dca6af-f677-47cd-b3a3-5d81369edc61"), 0, new Guid("b3fff128-4e31-483e-be2a-6b9d769ced22"), "Good effects often manipulate energy from good-aligned Outer Planes and are antithetical to evil divine servants or divine servants of evil deities. A creature with this trait is good in alignment.", 0 },
                    { new Guid("d1cecdcc-86cd-4688-8627-f22cc612252f"), 0, new Guid("052112be-3cbc-4ca8-bf6f-32587afd62d2"), "You can use this weapon to Grapple with the Athletics skill even if you don’t have a free hand. This uses the weapon’s reach (if different from your own) and adds the weapon’s item bonus to attack rolls as an item bonus to the Athletics check. If you critically fail a check to Grapple using the weapon, you can drop the weapon to take the effects of a failure instead of a critical failure.", 0 },
                    { new Guid("de242a81-cb39-41a2-8066-6c91daef62ee"), 0, new Guid("d891aba2-87c0-41a5-823a-6f853f85a2d5"), "These creatures are malevolent spellcasters who form covens.", 0 },
                    { new Guid("3e83a78a-1a44-41b7-b52e-f82c96f992d5"), 0, new Guid("1927b1c3-5e97-426b-91e3-9618c916dfdf"), "A creature with this trait is a member of the halfling ancestry. These small people are friendly wanderers considered to be lucky. An ability with this trait can be used or selected only by halflings. A weapon with this trait is created and used by halflings.", 0 },
                    { new Guid("3748d4f7-2335-449d-9eb3-a4aceb07d8bf"), 0, new Guid("7e07fa4f-30da-4b49-977a-6ca15743ccba"), "There was not explicit description for this trait.", 0 },
                    { new Guid("04577f6a-5d15-459e-83ed-90f24c445107"), 0, new Guid("7402a95c-09ac-4438-b51e-5277225ae185"), "Lawful effects often manipulate energy from law-aligned Outer Planes and are antithetical to chaotic divine servants or divine servants of chaotic deities. A creature with this trait is lawful in alignment.", 0 },
                    { new Guid("0ba59c3b-efa2-4089-8125-2d6dccf96f2a"), 0, new Guid("e6f83e03-dfaa-46dc-ae44-dc013bf6649d"), "An effect with this trait depends on language comprehension. A linguistic effect that targets a creature works only if the target understands the language you are using.", 0 },
                    { new Guid("d79321ae-a3a2-41f4-a36b-61298b27d83e"), 0, new Guid("464d7ccc-ef65-4eac-967c-6066156f88fb"), "Archetypes with the multiclass trait represent diversifying your training into another class’s specialties. You can’t select a multiclass archetype’s dedication feat if you are a member of the class of the same name.", 0 },
                    { new Guid("7fbc45b3-a680-4728-a991-660a31ea46b1"), 0, new Guid("842c7c08-d536-476a-a8e5-b2093a5e79b7"), "Subterranean kin of the dwarves, duergar typically have darkvision and immunity to poison. They are not easily fooled by illusions.", 0 },
                    { new Guid("8d81f589-7840-49a0-97d3-7e209b1cd785"), 0, new Guid("8edb189f-b26e-47d2-92df-08dbec04781a"), "This indicates abilities from the druid class.", 0 },
                    { new Guid("1dba8f35-94cc-4f11-a703-3c8527975131"), 0, new Guid("3de012b2-0e72-481c-a006-205fec4644d6"), "Subterranean kin of the elves, drow typically have darkvision and inborn magical abilities.", 0 },
                    { new Guid("ed7923b7-0ffa-4f31-a609-d24c1c869024"), 0, new Guid("2f4c65c4-1d67-490c-a2e1-32eb9489d9f0"), "Dragons are reptilian creatures, often winged or with the power of flight. Most are able to use a breath weapon and are immune to sleep and paralysis.", 0 },
                    { new Guid("a01f65af-1378-4ba0-bd4b-dbe77c561e5f"), 0, new Guid("410c89bb-2b0f-4295-a63e-f7864e75581f"), "An activity with this trait takes a day or more, and can be used only during downtime.", 0 },
                    { new Guid("335c6212-9e00-4692-a589-210c5440a4a1"), 0, new Guid("bd80ab5f-b899-485d-b279-83805a2e9b35"), "An elixir with the mutagen trait temporarily transmogrifies the subject’s body and alters its mind. A mutagen always conveys one or more beneficial effects paired with one or more detrimental effects. Mutagens are polymorph effects, meaning you can benefit from only one at a time.", 0 },
                    { new Guid("470ca809-e56b-4aa1-a690-61cf04ab424a"), 0, new Guid("48631050-4839-4898-8a0f-2a053135abf0"), "Nearly all deities have a specific representative known as a herald; heralds are as diverse in their appearances and abilities as the gods themselves. A creature with the herald type is always unique.", 0 },
                    { new Guid("d2ddd9bf-d0f1-49fd-bc09-aacdf2652d74"), 0, new Guid("d47884e5-93b9-4fe7-8647-7a07ef5d6a18"), "Effects and magic items with this trait are associated with the necromancy school of magic, typically involving forces of life and death.", 0 },
                    { new Guid("9cde9411-ddf6-4b63-ae95-a4cfaca79b6e"), 0, new Guid("449f835b-f5db-48d4-854a-cab7368cb20a"), "Titans are enormous, primordial creatures of neargodlike power who predate the mortal races.", 0 },
                    { new Guid("6b7e8e1f-44c8-409f-8e71-23258c4d5dea"), 0, new Guid("6e756612-0271-492f-9be0-0d9c58827821"), "Effects with this trait heal undead creatures with negative energy, deal negative damage to living creatures, or manipulate negative energy. Planes with this trait are vast, empty reaches that suck the life from the living. Creatures with this trait are natives of the Negative Energy Plane. They can survive the basic environmental effects of the Negative Energy Plane.", 0 },
                    { new Guid("4c020c2c-6e31-4f56-8527-e9a681c8ac49"), 0, new Guid("dea9ff31-9ed5-44e2-917d-f4b269e6a974"), "This armor is loud and likely to alert others to your presence. The armor’s check penalty applies to Stealth checks even if you meet the required Strength score.", 0 },
                    { new Guid("d0b4308d-961a-4921-9bf5-813f75553bde"), 0, new Guid("5ff19688-da1d-413b-8766-a37df3e95ca1"), "An effect with this trait is not inherently deadly. Damage from a nonlethal effect knocks a creature out rather than killing it. You can use a nonlethal weapon to make a lethal attack with a –2 circumstance penalty.", 0 },
                    { new Guid("9ac87a1c-c0ef-4014-9aaa-a423ee3da851"), 0, new Guid("b75b919c-afca-4f94-ad98-f20c43c182f9"), "Oaths add an additional tenet to your code. You can usually have only one feat with this trait.", 0 },
                    { new Guid("2993bb5e-03c3-4e63-90e6-7047a456e95c"), 0, new Guid("2e90b31a-847d-47e6-8701-bde22743f425"), "This magic comes from the occult tradition, calling upon bizarre and ephemeral mysteries. Anything with this trait is magical.", 0 },
                    { new Guid("52e4b93a-b726-44a8-aec3-e762131e9dcb"), 0, new Guid("449de570-dc89-488e-9b56-415dcb96ed40"), "Oils are magical gels, ointments, pastes, or salves that are typically applied to an object and are used up in the process.", 0 },
                    { new Guid("4b1ff51d-f758-4a92-8d08-0067795d59b6"), 0, new Guid("507589cf-c145-4184-91fc-20e5638dfaf7"), "Oozes are creatures with simple anatomies. They tend to have low mental ability scores and immunity to mental effects and precision damage.", 0 },
                    { new Guid("ce9b2967-7fb4-4e1c-a84e-dc894f250a84"), 0, new Guid("faca39bc-dc55-4454-9730-00c3bcde55e1"), "These maneuvers work only as the first salvo on your turn. You can use an open only if you haven’t used an action with the attack or open trait yet this turn.", 0 },
                    { new Guid("c2535727-868d-4f22-a05f-3fbe750dffe2"), 0, new Guid("9e1a7583-3f46-410f-9c29-1de74ad87f1c"), "A creature with this trait is a member of the orc ancestry. These green-skinned people tend to have darkvision. An ability with this trait can be used or selected only by orcs. An item with this trait is created and used by orcs.", 0 },
                    { new Guid("a253edf2-2a70-4ae7-9afa-fef547918d2b"), 0, new Guid("bb4ffbbe-5eb1-485a-85c0-60189414e3d4"), "This weapon can be used defensively to block attacks. While wielding this weapon, if your proficiency with it is trained or better, you can spend a single action to position your weapon defensively, gaining a +1 circumstance bonus to AC until the start of your next turn.", 0 },
                    { new Guid("ee13449c-bb3a-4ee7-8c2a-1b213b6cd30c"), 0, new Guid("4446ca5a-97e7-408d-aac9-4f19571e5cbc"), "Vegetable creatures have the plant trait. They are distinct from normal plants. Magical effects with this trait manipulate or conjure plants or plant matter in some way. Those that manipulate plants have no effect in an area with no plants.", 0 },
                    { new Guid("7295d981-91ea-401d-913b-1783b31235b7"), 0, new Guid("d43b72ae-0105-4686-a0f9-be6e03291af2"), "An action with this trait involves moving from one space to another.", 0 },
                    { new Guid("5c7e8690-62bd-4282-86ed-190431b70d77"), 0, new Guid("e96a77cb-4271-4f08-bf95-de459742767a"), "Effects and magic items with this trait are associated with the enchantment school of magic, typically involving mind control, emotion alteration, and other mental effects.", 0 },
                    { new Guid("3c157271-ce4d-42d3-8426-5dce0cae1f36"), 0, new Guid("3ecd4d1e-ccc1-4620-b223-63aa9031fe5a"), "Dwarf", 0 },
                    { new Guid("e3f352f1-ed3e-4a9b-a71d-6bcf58f53568"), 0, new Guid("d7e3c058-c73c-4608-a370-6835483931f8"), "Effects with this trait deal electricity damage. A creature with this trait has a magical connection to electricity.", 0 },
                    { new Guid("7424e2f0-8f5a-4122-9aa9-fb90343d57a7"), 0, new Guid("c6a2e39a-db66-42d3-8973-21a214fdca57"), "Litanies are special devotion spells, typically used by champions and requiring a single action, that usually give temporary immunity to further litanies.", 0 },
                    { new Guid("8a0ef240-af91-4da8-9ac2-5bfdc6f549b5"), 0, new Guid("4ab621bd-943d-46f8-bc1b-b087444eec87"), "Something with the magical trait is imbued with magical energies not tied to a specific tradition of magic. A magical item radiates a magic aura infused with its dominant school of magic.", 0 },
                    { new Guid("ec01b62e-8a08-4f2a-b2d9-9cd8dcc5133f"), 1, new Guid("4ab621bd-943d-46f8-bc1b-b087444eec87"), "Some items or effects are closely tied to a particular tradition of magic. In these cases, the item has the arcane, divine, occult, or primal trait instead of the magical trait. Any of these traits indicate that the item is magical.", 0 },
                    { new Guid("9b3da9b6-f2b5-4388-ab10-2efed1663eba"), 0, new Guid("df5af144-0177-4922-a7e8-37c9e0c99708"), "This effect alters a creature's emotions. Effects with this trait always have the mental trait as well. Creatures with special training or that have mechanical or artificial intelligence are immune to emotion effects.", 0 },
                    { new Guid("636855f5-5e2c-484a-be48-35c372e55ef1"), 0, new Guid("a07f371f-a95b-4cbb-85d3-094c8fe58fba"), "A repeating weapon is typically a type of crossbow that has a shorter reload time. These weapons can't be loaded with individual bolts like other crossbows; instead, they require a magazine of specialized ammunition to be loaded into a special slot. Once that magazine is in place, the ammunition is automatically loaded each time the weapon is cocked to fire, reducing its reload to the value in its reload entry (typically 0). When the ammunition runs out, a new magazine must be loaded, which requires a free hand and 3 Interact actions (to remove the old magazine, retrieve the new magazine, and slot the new magazine in place). These actions don't need to be consecutive.", 0 },
                    { new Guid("6835532a-9460-436b-9b22-e92a43a0ef6a"), 0, new Guid("28df6172-2367-4910-950e-d88f0c9d0864"), "There was not explicit description for this trait.", 0 },
                    { new Guid("bbbb1c76-557a-40bf-b5b3-64d57a35c90d"), 0, new Guid("d97a6bbe-6431-4306-bc54-dfcee431fc70"), "You must physically manipulate an item or make gestures to use an action with this trait. Creatures without a suitable appendage can’t perform actions with this trait. Manipulate actions often trigger reactions.", 0 },
                    { new Guid("d03c0e1b-1c97-415d-9ee4-907b81f10199"), 0, new Guid("560c2c5c-245a-4d72-aad3-964dfc2e70e9"), "A hazard with this trait is a constructed physical object.", 0 },
                    { new Guid("22d38176-5c10-4c80-b4aa-f31825d543b9"), 0, new Guid("53ba888b-4e97-4478-8617-7ed9c6654994"), "Elixirs are alchemical liquids that are used by drinking them.", 0 },
                    { new Guid("75bf6da2-1f43-4aa6-bb7a-2cedf3975b80"), 0, new Guid("d80c4c8b-646b-420c-a00d-cb15996520e2"), "A mental effect can alter the target’s mind. It has no effect on an object or a mindless creature.", 0 },
                    { new Guid("823c9e9a-6144-49d0-b214-174265dcb756"), 0, new Guid("0b39858c-3039-4774-86f4-0c3fa9c4fabd"), "Actions with the metamagic trait, usually from metamagic feats, tweak the properties of your spells. You must use a metamagic action directly before Casting the Spell you want to alter. If you use any action (including free actions and reactions) other than Cast a Spell directly after, you waste the benefits of the metamagic action. Any additional effects added by a metamagic action are part of the spell’s effect, not of the metamagic action itself.", 0 },
                    { new Guid("0604ab80-183c-40a9-9142-7b63b6789318"), 0, new Guid("f28721b4-6e1a-4277-a7a5-8b9e0b086974"), "A mindless creature has either programmed or rudimentary mental attributes. Most, if not all, of their mental ability modifiers are –5. They are immune to all mental effects.", 0 },
                    { new Guid("130de427-1dc9-4b8b-aaca-c428cb551309"), 0, new Guid("27f056b5-b6f7-41fb-92b3-fa235dd593ca"), "Sahkils are fiends that delight in spreading fear and unease among mortal creatures. They typically have darkvision, immunity to fear, and weakness to good.", 0 },
                    { new Guid("e4cecccf-e509-49f9-8793-9447d6b9a97d"), 0, new Guid("75132a55-72ac-415c-b405-37c2530bce76"), "Minions are creatures that directly serve another creature. A creature with this trait can use only 2 actions per turn and can’t use reactions. Your minion acts on your turn in combat, once per turn, when you spend an action to issue it commands. For an animal companion, you Command an Animal; for a minion that’s a spell or magic item effect, like a summoned minion, you Sustain a Spell or Sustain an Activation; if not otherwise specified, you issue a verbal command, a single action with the auditory and concentrate traits. If given no commands, minions use no actions except to defend themselves or to escape obvious harm. If left unattended for long enough, typically 1 minute, mindless minions usually don’t act, animals follow their instincts, and sapient minions act how they please.", 0 },
                    { new Guid("63c5cf53-4aa1-4ed8-a892-f282a36b3065"), 0, new Guid("f44a731d-d834-4b67-875a-96d6d7daf6ee"), "A misfortune effect detrimentally alters how you roll your dice. You can never have more than one misfortune effect alter a single roll. If multiple misfortune effects would apply, the GM decides which is worse and applies it. If a fortune effect and a misfortune effect would apply to the same roll, the two cancel each other out, and you roll normally.", 0 },
                    { new Guid("b54be341-9b36-4753-ba65-109d0a8fbdd6"), 0, new Guid("fbb4ba35-fe8a-4f6b-9e11-cdadb4c6b3c1"), "Creatures that hail from or have a strong connection to the neutrally aligned planes are called monitors. Monitors can survive the basic environmental effects of planes in the Outer Sphere.", 0 },
                    { new Guid("25b8fb83-a52a-4b03-a134-b4526aac3c18"), 0, new Guid("20c99d83-4475-456a-aa3d-18df18dd7991"), "Abilities with this trait are from the monk class. A weapon with this trait is primarily used by monks.", 0 },
                    { new Guid("d75acf18-0f8b-49bc-a9ce-7b03c1621095"), 0, new Guid("1efe88ff-776a-4fef-bcda-1ba9b63154e1"), "A creature with this trait is a member of the elf ancestry. Elves are mysterious people with rich traditions of magic and scholarship who typically have low-light vision. An ability with this trait can be used or selected only by elves. A weapon with this trait is created and used by elves.", 0 },
                    { new Guid("820fde1a-0326-4641-ba15-c9cd38685443"), 0, new Guid("89277379-cc7a-47de-8dc2-60eea16e9757"), "Effects that slightly alter a creature’s form have the morph trait. Any Strikes specifically granted by a morph effect are magical. You can be affected by multiple morph spells at once, but if you morph the same body part more than once, the second morph effect attempts to counteract the first (in the same manner as two polymorph effects, described in that trait).", 0 },
                    { new Guid("ac8eed70-000e-4eae-a2c9-b3f546246661"), 1, new Guid("89277379-cc7a-47de-8dc2-60eea16e9757"), "Your morph effects might also end if you are polymorphed and the polymorph effect invalidates or overrides your morph effect. The GM determines which morph effects can be used together and which can’t.", 0 },
                    { new Guid("fa67a9a9-cad1-403a-9ed6-94e3e6eadd95"), 0, new Guid("2be55e11-ce05-4acf-bc5b-f6d7b4c8b980"), "Elementals are creatures directly tied to an element and native to the Elemental Planes. Elementals don’t need to breathe.", 0 },
                    { new Guid("47e26382-0112-483a-9c29-3dd391139dc2"), 0, new Guid("813305c3-52b4-4bd1-b3ad-6b932e7af8d0"), "Effects with the earth trait either manipulate or conjure earth. Those that manipulate earth have no effect in an area without earth. Creatures with this trait consist primarily of earth or have a magical connection to that element. Planes with this trait are mostly solid, with caverns and other hollow pockets.", 0 },
                    { new Guid("c2c7bcb3-6464-4203-9aeb-0c491459cb65"), 0, new Guid("f459a7a6-5121-48ce-a7f6-640809b795f5"), "Effects with the water trait either manipulate or conjure water. Those that manipulate water have no effect in an area without water. Creatures with this trait consist primarily of water or have a magical connection to the element. Planes with this trait are mostly liquid, perhaps with pockets of breathable air.", 0 },
                    { new Guid("4911acd5-87b3-460f-8ce1-dd2ca1be39d4"), 0, new Guid("16172afd-7325-48e0-a180-93bbba16d5ca"), "A hazard with this trait takes turns in an encounter.", 0 },
                    { new Guid("3f5183a4-09af-4ba4-b082-23c387f8f649"), 0, new Guid("39661ea5-6bba-4ea0-976b-7726da696038"), "Settlements with this trait tend to be small and usually have a level no higher than 1.", 0 },
                    { new Guid("4ca11ced-ae56-40b1-a742-9698ef6a0400"), 0, new Guid("a5bc07e1-023c-41a6-b6e6-9c37f5484ee3"), "These shapechanging creatures either are naturally able to shift between animal, humanoid, and hybrid forms or are afflicted with a curse that forces them to shift involuntarily.", 0 },
                    { new Guid("3fdb0192-9dbd-4bfe-b59c-b34567d358c4"), 0, new Guid("af96ac0d-bc3f-431f-80da-73fc5c10f7b6"), "A wraith is an incorporeal undead creature infused with negative energy and driven by a hatred of all life", 0 },
                    { new Guid("27baf7c6-2f7a-4e77-a4e0-be06b4686423"), 0, new Guid("e48d94cb-4027-4dd7-9770-b2e02716eeef"), "A wight is an undead creature that drains life and stands vigil over its burial site.", 0 },
                    { new Guid("14d3aca8-5717-4cf5-b9c0-7c249aef86ea"), 0, new Guid("de02f7f2-5ae0-4011-a6de-b53cd13fa972"), "These subterranean reptilian creatures tend to have darkvision and smell awful.", 0 },
                    { new Guid("2191f5ae-706e-4079-9660-6d66e29dabe3"), 0, new Guid("605865dd-e4f9-487c-828d-47ee526c8605"), "These undead are mindless rotting corpses that hunger for living flesh.", 0 },
                    { new Guid("c1b6b421-acaf-4ae3-a5cd-f5863183ac05"), 0, new Guid("261df933-0961-4973-a77a-09d708186f88"), "A construct is an artificial creature empowered by a force other than necromancy. Constructs are often mindless; they are immune to bleed damage, death effects, disease, healing, necromancy, nonlethal attacks, poison, and the doomed, drained, fatigued, paralyzed, sickened, and unconscious conditions; and they may have Hardness based on the materials used to construct their bodies. Constructs are not living creatures, nor are they undead. When reduced to 0 Hit Points, a construct creature is destroyed.", 0 },
                    { new Guid("0c0575ba-ad2f-447a-9b07-3a7efe1f41e0"), 0, new Guid("53781661-e0ae-4d23-816a-41839c2f566c"), "A family of supernatural feathered serpents who serve as guardians and messengers on the Material Plane for various good-aligned divinities.", 0 },
                    { new Guid("c577192e-6ed8-4a0d-8c8f-d46459d18fee"), 0, new Guid("d8988a11-861b-4372-966e-7b8dd2fbe487"), "Creatures native to the Dimension of Dreams can be any alignment and possess a diverse array of abilities, although those associated with the nightmare realm of Leng are almost always evil and immune to that realm’s freezing temperatures.", 0 },
                    { new Guid("66bf89bb-9425-49a1-a0bb-904fffb62473"), 0, new Guid("4ace0949-9874-4a57-afca-539a202106e2"), "A creature with this trait is a member of the fetchling ancestry. Fetchlings were once human, but generations of life on the Shadow Plane have transformed them.", 0 },
                    { new Guid("79e7f806-f7e8-493b-b10c-97556c4412d3"), 0, new Guid("c3429aa8-1f8a-4b23-bf13-9f66691a651d"), "Ifrits are planar scions descended from efreet.", 0 },
                    { new Guid("b22076b7-b6a5-4513-b96c-5ffa84269fa8"), 0, new Guid("d88c3ae6-6902-41f4-a7ce-27ffbabd4f87"), "Morlocks are a family of pale, underground-dwelling humanoids who, generations ago, were regular humans.", 0 },
                    { new Guid("523b074e-c81b-46dc-af85-979b3ae1c968"), 0, new Guid("76792b26-bda8-46cc-ba9f-8e8cdbf4871f"), "Oni are a family of fiends who dwell on the Material Plane and take monstrous forms based on humanoid shapes.", 0 },
                    { new Guid("d0e25df3-323c-4f1d-adcd-3fda410f765a"), 0, new Guid("03b5099e-4b12-408d-a2d7-c8b3ca692291"), "Oreads are planar scions descended from shaitans.", 0 },
                    { new Guid("696e4e89-6190-4d11-93d4-f2d7c97bb5b7"), 0, new Guid("788f42f9-1e86-4f08-9e12-3e3eec9ca3b5"), "Petitioners are mortal souls who have been judged and then transformed into creatures native to other planes. Petitioners can survive the basic environmental effects of their home plane.", 0 },
                    { new Guid("7ac5518e-664b-4c98-95a3-2625d3ca4dc9"), 0, new Guid("eb5f3f8a-00c4-4836-9345-cac3a59f5980"), "A family of fiends hailing from the Abyss, most qlippoth are chaotic evil. Their appearance affects the minds of non-qlippoth that view them.", 0 },
                    { new Guid("25ca15e7-3ce8-4f3b-ae52-e1e9038b1c76"), 0, new Guid("369aafeb-f943-4522-8c5a-56b4a515be33"), "Serpentfolk are a family of serpentine humanoids.", 0 },
                    { new Guid("00d4f6bb-e689-4e8d-91e7-80e36c5b2b75"), 0, new Guid("5c5d9ed1-dbcf-48e5-a8f5-0a7c5dd8d838"), "Skulks are a family of humanoids whose skin can shift coloration to aid in stealth.", 0 },
                    { new Guid("5648b3a5-cb3b-4af1-bcdb-3337cd34043d"), 0, new Guid("d7edc41c-35e9-4a1d-9a5e-1021c1565704"), "Kin to gnomes, spriggans tend to be evil and can grow in size to resemble giants.", 0 },
                    { new Guid("4e375f84-2d3c-4411-8a89-283193f2e96c"), 0, new Guid("3a2a06a6-88ec-4cdc-8577-9beaaa4c5407"), "Sulis are planar scions descended from jann.", 0 },
                    { new Guid("fc4b1c8f-9163-4bb3-a631-cc1c96f3978e"), 0, new Guid("1be9b1ec-9a82-42aa-8e8e-3b7f80c886fa"), "Sylphs are planar scions descended from djinn.", 0 },
                    { new Guid("2e8589f9-693e-4b0e-a8bb-7889dc9f748b"), 0, new Guid("aa8893c0-9319-40f1-afdc-205258e811e3"), "The Tane are powerful creatures created eons ago by the Eldest of the First World. All of the Tane treat whatever plane they happen to be on as their home plane.", 0 },
                    { new Guid("40fecba2-63ce-49df-b25d-d6028805fa9b"), 0, new Guid("b90498d1-69ae-4c10-8e98-94857099bbda"), "Time creatures are natives of the Dimension of Time. They do not age, and while some may be driven by supernatural hungers, they do not need to eat or drink to survive. They can survive the basic environmental effects of the Dimension of Time.", 0 },
                    { new Guid("d622c655-5186-43a9-a4e3-16c6837793f3"), 0, new Guid("22583447-bd14-445d-8e71-fbfae42f8bc0"), "Undines are planar scions descended from marids.", 0 },
                    { new Guid("3a4acb31-ae17-4069-962b-b93d091715ce"), 0, new Guid("9f9a9f98-1eac-44be-a524-a826155e78c0"), "Urdefhans are humanoids who have pacts with daemons, have transparent skin, and drink blood.", 0 },
                    { new Guid("5f66780f-626a-4b4d-ba1d-3e56949bb2fa"), 0, new Guid("d065e3df-631a-409a-b693-e23722ae0111"), "Aesir are often-bellicose monitors of the chaotic planes, honing their skill in battle and preparing for a final confrontation at the end of the multiverse.", 0 },
                    { new Guid("0e29f2e5-3513-423d-835b-065c6ce7b08f"), 0, new Guid("7c5ad646-6245-446e-83ff-cde9a47c7254"), "This family of animal-featured celestials is native to the plane of Nirvana. Most agathions are neutral good, have darkvision, and have a weakness to evil damage.", 0 },
                    { new Guid("b5040952-c062-48a0-b397-f0400f0526e6"), 0, new Guid("7c85d47b-d7c9-4026-bfbc-a78ea28b2a3e"), "These lawful fiends are physical manifestations of divine accidents. Asuras typically have darkvision, immunity to curses, and a weakness to good.", 0 },
                    { new Guid("4a4061bc-9430-43e3-87c9-eb59cd336167"), 0, new Guid("2d5e025a-19de-4f4d-bd58-9bcb29049c93"), "Clockworks are intricate, complex constructs that can be programmed to perform specific functions. A clockwork creature must be wound regularly to function.", 0 },
                    { new Guid("aec18129-85d1-487e-bb3b-dcb36ae1876c"), 0, new Guid("3ce200fc-375b-419d-a783-c3b8f6cc2034"), "Divs are a family of fiends spawned from the spirits of evil genies within the desolation of Abaddon. Most divs are neutral evil. They typically have greater darkvision and weakness to cold iron and good damage.", 0 },
                    { new Guid("4d033f68-28ff-453a-a268-417c949ad133"), 0, new Guid("43d91dda-c051-4a9d-abc0-ad4fd42667b2"), "Undead creatures who thirst for blood, vampires are notoriously versatile and hard to destroy.", 0 },
                    { new Guid("b0f97ca8-fab0-44c2-abc7-f456e1047be2"), 0, new Guid("748e8459-f39f-40c6-afc3-dfb1a1ac4043"), "This weapon is attached to a length of rope or chain that allows you to retrieve it after it has left your hand. If you have a free hand while wielding this weapon, you can use an Interact action to pull the weapon back into your grasp after you have thrown it as a ranged attack or after it has been disarmed (unless it is being held by another creature).", 0 },
                    { new Guid("74aaccc8-d0dd-4c85-ae5d-c370d9b9ce54"), 0, new Guid("e29b02f2-8555-474a-a501-ecbfa4a3dbdc"), "There was not explicit description for this trait.", 0 },
                    { new Guid("7e504a84-c4af-4fd3-aacb-2d29b8b3085d"), 0, new Guid("b605c666-d324-449b-8574-709d3c066dd2"), "A swarm is a mass or cloud of creatures that functions as one monster. Its size entry gives the size of the entire mass, though for most swarms the individual creatures that make up that mass are Tiny. A swarm can occupy the same space as other creatures, and must do so in order to use its damaging action. A swarm typically has weakness to effects that deal damage over an area (like area spells and splash weapons). Swarms are immune to the grappled, prone, and restrained conditions.", 0 },
                    { new Guid("e5252ffd-8b73-4372-b634-c1a611e11ec9"), 0, new Guid("ce6136ac-735f-4c8f-84be-5093f57b2ff0"), "These monitors are the self-styled defenders of reality. Traditional aeons have dualistic natures and forms, and they hold a dichotomy of interests, though axiomites and inevitables do not. Aeons other than axiomites and inevitables communicate via a strange telepathic hodgepodge of sensory sending called envisioning.", 0 },
                    { new Guid("4318941d-c9ed-4e02-be9b-f24bbe94e091"), 0, new Guid("5da3fe9a-3652-44f9-9e57-64534fb1ac2d"), "An amphibious creature can breathe in water and in air, even outside of its preferred environment, usually indefinitely but at least for hours. These creatures often have a swim Speed. Their bludgeoning and slashing unarmed Strikes don't take the usual –2 penalty for being underwater.", 0 },
                    { new Guid("14cf7c7a-9547-46b5-9f3f-fe788f3fa2f0"), 0, new Guid("184dfff4-7374-4a6e-9518-548102eac1e4"), "Aquatic creatures are at home underwater. Their bludgeoning and slashing unarmed Strikes don’t take the usual –2 penalty for being underwater. Aquatic creatures can breathe water but not air.", 0 },
                    { new Guid("0f262099-497f-4214-a163-8c863d9171f9"), 0, new Guid("c397e8a4-ed21-4ece-be24-ed76c3aad67e"), "Boggards are frog-like humanoids. They typically have darkvision.", 0 },
                    { new Guid("944852cc-7080-4f50-a416-d5211e2eb26f"), 0, new Guid("d7ffb83a-2507-4d2c-ba39-9faa6c59565e"), "These subterranean people have darkvision, and some have powers to create darkness.", 0 },
                    { new Guid("56191621-ceaf-4518-95e9-d828d60fb3c4"), 0, new Guid("b4b7b5e5-f4c0-40d3-89b2-500840877953"), "There was not explicit description for this trait.", 0 },
                    { new Guid("b6d1d35c-ce26-4c4a-9fa6-38c766f05a5b"), 0, new Guid("bbb6d3c8-d6c1-44bc-8c00-5fa83c063dcf"), "A family of fiends spawned on the desolate plane of Abaddon, most daemons are neutral evil. They typically have darkvision and weakness to good damage.", 0 },
                    { new Guid("e8534e72-6e39-4a75-ba8b-0b76a3f826e8"), 0, new Guid("e3601c4d-4e36-483e-9c7c-6be44fd9beaa"), "This family of humanoids are the descendants of fey creatures that fell into darkness and confusion after being abandoned in the Darklands. They are immune to confusion and vulnerable to sunlight.", 0 },
                    { new Guid("52f4a7c2-a491-4a71-9470-585b0a049f5c"), 0, new Guid("eac6a94d-c0df-40e5-b493-68b3cff59c04"), "The diverse families of genies hold positions of prominence on the Elemental Planes. They have powerful magical abilities.", 0 },
                    { new Guid("713f0a5d-8455-4ee0-b0e3-b9edc9b8d0a3"), 0, new Guid("a8d6ec41-7cb7-4738-af55-09955cb7ad30"), "Lost souls that haunt the world as incorporeal undead are called ghosts.", 0 },
                    { new Guid("0cfd5008-348a-4706-9412-8aa3efc01db7"), 0, new Guid("0404e102-a30d-45b7-a539-7f54185c88ec"), "Ghouls are vile undead creatures that feast on flesh.", 0 },
                    { new Guid("0d187e51-d275-4cdd-9848-af8411bfa9e2"), 0, new Guid("e3224ed6-b3f5-43e1-ac7d-36828dad030b"), "Gnolls are humanoids that resemble hyenas.", 0 },
                    { new Guid("592c961a-709a-4b77-aa29-04bd45111948"), 0, new Guid("d44ea313-6b89-4f9e-99ae-0d7d09c84245"), "Golems are a special type of construct. Golems are immune to almost all magic, but most have a weakness to certain spells.", 0 },
                    { new Guid("0e537b31-fa92-4e1e-b7ee-df94a0fa87ef"), 0, new Guid("f0c41bba-1bf6-498a-8aab-549f3555b6d5"), "Cruel and mischievous fey, gremlins have acclimated to life on the Material Plane.", 0 },
                    { new Guid("07405900-7dd8-4fa4-94c2-cc6a9e018a77"), 0, new Guid("1788ef80-8a1f-4bbb-98a8-b6a67d3e9f23"), "Ghorans are sapient plants grown in the shape of humanoids with floral faces.", 0 },
                    { new Guid("92c68a7f-893e-4c01-9e84-a19ccc031520"), 0, new Guid("31b0e628-2fb5-4d73-b2bf-7e4e8359a248"), "An incorporeal creature or object has no physical form. It can pass through solid objects, including walls. When inside an object, an incorporeal creature can’t perceive, attack, or interact with anything outside the object, and if it starts its turn in an object, it is slowed 1. Corporeal creatures can pass through an incorporeal creature, but they can’t end their movement in its space.", 0 },
                    { new Guid("f19900b5-e127-4214-9bc1-e09c79185b9c"), 2, new Guid("31b0e628-2fb5-4d73-b2bf-7e4e8359a248"), "Incorporeal creatures usually have immunity to effects or conditions that require a physical body, like disease, poison, and precision damage. They usually have resistance against all damage (except force damage and damage from Strikes with the ghost touch property rune), with double the resistance against non-magical damage.", 0 },
                    { new Guid("8eb70672-1557-43fe-8f5f-dfe9e8af03b9"), 0, new Guid("08f9e964-7481-4c26-85bf-424b823bbb58"), "These constructed aeons were created by the axiomites. Each type of inevitable is dedicated to a specific task. Most inevitables have weakness to chaotic damage.", 0 },
                    { new Guid("5a02f889-e842-4fee-aaab-405a45006761"), 0, new Guid("ffd4a22a-42a6-40e5-92ad-f5f9f1fdbfdb"), "These aquatic humanoids have an upper body similar to a human and a lower body similar to a fish.", 0 },
                    { new Guid("4dc31b28-1a82-4e91-a4c4-a305ece08d97"), 0, new Guid("d021fa33-e35d-48f8-bd7b-08a93d446359"), "A mummy is an undead creature created from a preserved corpse.", 0 },
                    { new Guid("b16ac749-b118-4dcf-83b3-109805add08b"), 0, new Guid("31e81c2e-9c8f-4384-91de-c440782ba224"), "The monster has mutated or evolved, granting it unusual benefits, drawbacks, or both.", 0 },
                    { new Guid("5f80b441-bd72-4246-9d12-3a1e2f7d9c83"), 0, new Guid("35a2d85c-e513-4016-83fd-4dee6d3756de"), "This family of beautiful fey creatures has strong ties to natural locations.", 0 },
                    { new Guid("2799f06d-d7e6-4461-a614-5b30c0ff1d48"), 0, new Guid("39bf6574-c7a0-4edb-b668-df36969d6b8c"), "An olfactory effect can affect only creatures that can smell it. This applies only to olfactory parts of the effect, as determined by the GM.", 0 },
                    { new Guid("008410f2-b8e6-4825-96b6-84fd1115e74d"), 0, new Guid("fe370771-cafe-4521-ae95-6545a0d9b2b5"), "A family of monitors spawned within the Maelstrom, these creatures are guardians of disorder and are chaotic neutral. They typically have darkvision, an amorphous anatomy, and a weakness to lawful damage.", 0 },
                    { new Guid("12597cc7-67aa-46e8-8dfa-c490ede0b459"), 0, new Guid("9a113e60-55b3-47ae-af56-39d8acb42e34"), "A family of monitors spawned within the Boneyard to convey souls to the Outer Planes, most psychopomps are true neutral. They typically have darkvision, lifesense, and spirit touch, and they are immune to death effects.", 0 },
                    { new Guid("f3ac0658-44fe-4b90-bda8-16db8faa9104"), 0, new Guid("5933ad4b-93c3-4422-b954-2ec796dda2b0"), "These attacks will either list a finite range or a range increment, which follows the normal rules for range increments.", 0 },
                    { new Guid("34c84246-8f5f-4086-bd3f-aa849911ae2f"), 0, new Guid("ddaf1aee-4cf4-41e5-895b-c04e8225f0b3"), "This undead is made by animating a dead creature’s skeleton with negative energy.", 0 },
                    { new Guid("dc4af3d6-9cda-4969-b373-eecce379ef0c"), 0, new Guid("341d2366-5440-4f9a-b265-23f035af27a5"), "These constructs are mentally augmented by a fragment of a once-living creature’s soul.", 0 },
                    { new Guid("747aabb1-4867-4399-9b01-dd5dea2c382a"), 0, new Guid("9763c00f-109f-4065-ab42-ecb5857d0ccd"), "A family of diminutive winged fey with a strong connection to primal magic.", 0 },
                    { new Guid("5c76ce98-e1fd-433e-b340-16ff3b247ac5"), 0, new Guid("7afcb828-a625-4492-9249-614e272e840e"), "A family of diminutive winged fey with a strong connection to primal magic.", 0 },
                    { new Guid("ca2fab94-ec42-48e8-bcd8-bf84398667aa"), 0, new Guid("e5abbf0f-16df-4710-a810-406156167ef5"), "The weapon has multiple configurations that you can switch between using an Interact action. Typically, switching between configurations of a modular weapon allows it to deal different types of damage (listed in the trait, such as “modular B, P, or S”), though it’s possible for a modular weapon’s description to list more complicated configurations.", 0 },
                    { new Guid("7d8277a6-a3bd-4c1c-a52f-e245a491f6d5"), 0, new Guid("f8ca8efb-6017-43d2-9d04-6d70d1c3018f"), "A grioth is a batlike alien that wields occult powers and can exist in the dark vacuum of space. They have darkvision and echolocation.", 0 },
                    { new Guid("4b1de9f5-3c29-4842-a79b-37568f5ff76c"), 0, new Guid("3cdaa83c-681d-47d1-9a98-d0f15b6b0d61"), "Kami are spirits of the Material Plane that bond with a specific object or place.", 0 },
                    { new Guid("19c364b1-3bec-40f8-8090-e25cbc2d0bfc"), 0, new Guid("9a6ca06d-a1b7-40d5-a9aa-2e9f41aea663"), "Reclusive humanoids with an inborn talent for geomancy, kovintus have an intrinsic tie to nature and magic alike.", 0 },
                    { new Guid("0695ce17-f5b7-4ace-bd3b-6edb7fcc3267"), 0, new Guid("142255e5-e9c7-4acc-af3e-3e5adce348ed"), "This effect can cause a creature to fall asleep or get drowsy.", 0 },
                    { new Guid("20f149c6-fbeb-4f39-ad47-8f6e9cf854bf"), 0, new Guid("ece698cc-1249-402d-84c0-9b65c5f6bd5a"), "Traps typically made by rangers, snares follow special rules that allow them to be constructed quickly and used on the battlefield.", 0 },
                    { new Guid("f381f51e-3b04-466b-a5dd-9c917575bec9"), 0, new Guid("0dddb0a4-0037-47c7-b2bc-6479caa43694"), "An effect with the sonic trait functions only if it makes sound, meaning it has no effect in an area of silence or in a vacuum. This is different from an auditory spell, which is effective only if the target can hear it. A sonic effect might deal sonic damage. A creature with this trait has a magical connection to powerful sound.", 0 },
                    { new Guid("2da7fab1-ff20-4b4e-ac3d-f0fec2858898"), 0, new Guid("043d0de7-1dde-4623-94eb-fb6d4f9d064d"), "This indicates abilities from the sorcerer class.", 0 },
                    { new Guid("c51d9ced-d892-4218-b477-726b8ceb67fe"), 0, new Guid("a7bb677c-3efa-4e27-9c61-01e34e08cab8"), "Spirits are ephemeral creatures defined by their spiritual self and often lacking a physical form.", 0 },
                    { new Guid("e445ad52-5176-4763-af40-10893fbe92b3"), 0, new Guid("50ff3481-2aea-45a6-a9f5-66e7d33439d3"), "When you use a thrown weapon with the splash trait, you don’t add your Strength modifier to the damage roll. If an attack with a splash weapon fails, succeeds, or critically succeeds, all creatures within 5 feet of the target (including the target) take the listed splash damage. On a failure (but not a critical failure), the target of the attack still takes the splash damage. Add splash damage together with the initial damage against the target before applying the target’s weaknesses or resistances. You don’t multiply splash damage on a critical hit.", 0 },
                    { new Guid("6062dd69-7309-4945-b43d-7212dceb871b"), 0, new Guid("64e04097-2c65-495f-8f2c-8fbff3b8123a"), "This magic item holds spells of a particular theme and allows a spellcaster to cast additional spells by preparing the staff.", 0 },
                    { new Guid("e5c2f398-1ee5-4ab7-86a4-1859abf9642f"), 0, new Guid("628039bf-14cd-419d-95a2-1f8d6309cca5"), "A stance is a general combat strategy that you enter by using an action with the stance trait, and that you remain in for some time. A stance lasts until you get knocked out, until its requirements (if any) are violated, until the encounter ends, or until you enter a new stance, whichever comes first. After you use an action with the stance trait, you can’t use another one for 1 round. You can enter or be in a stance only in encounter mode.", 0 },
                    { new Guid("572d5892-ec13-4d46-b767-1ecacdc3cc42"), 0, new Guid("e486b7fc-a21d-4f12-a691-e5e3e712c095"), "An item with the structure trait creates a magical building or other structure when activated. The item must be activated on a plot of land free of other structures. The structure adapts to the natural terrain, adopting the structural requirements for being built there. The structure adjusts around small features such as ponds or spires of rock, but it can’t be created on water or other nonsolid surfaces. If activated on snow, sand dunes, or other soft surfaces with a solid surface underneath, the structure’s foundation (if any) reaches the solid ground. If an item with this trait is activated on a solid but unstable surface, such as a swamp or an area plagued by tremors, roll a DC 3 flat check each day; on a failure, the structure begins to sink or collapse.", 0 },
                    { new Guid("84215598-6cf7-4f12-b308-ab87014fbec5"), 1, new Guid("e486b7fc-a21d-4f12-a691-e5e3e712c095"), "The structure doesn’t harm creatures within the area when it appears, and it can’t be created within a crowd or in a densely populated area. Any creature inadvertently caught inside the structure when the item is activated ends up unharmed inside the complete structure and always has a clear path of escape. A creature inside the structure when the activation ends isn’t harmed, and it lands harmlessly on the ground if it was on an upper level of the structure.", 0 },
                    { new Guid("08158f2c-8878-4645-addb-a87955e50cc0"), 0, new Guid("7fe537ca-5287-4bc8-8cca-5273dd45504b"), "A creature called by a conjuration spell or effect gains the summoned trait. A summoned creature can't summon other creatures, create things of value, or cast spells that require a cost. It has the minion trait. If it tries to cast a spell of equal or higher level than the spell that summoned it, it overpowers the summoning magic, causing the summoned creature's spell to fail and the summon spell to end. Otherwise, the summoned creature uses the standard abilities for a creature of its kind. It generally attacks your enemies to the best of its abilities. If you can communicate with it, you can attempt to command it, but the GM determines the degree to which it follows your commands.", 0 },
                    { new Guid("0b6210b6-3424-4e02-9c32-f6d9f9d2f5ab"), 1, new Guid("7fe537ca-5287-4bc8-8cca-5273dd45504b"), "Immediately when you finish Casting the Spell, the summoned creature uses its 2 actions for that turn. A summoned creature can't control any spawn or other creatures generated from it, and such creatures return to their unaltered state (usually a corpse in the case of spawn) once the summoned creature is gone. If it's unclear what this state would be, the GM decides. Summoned creatures can be banished by various spells and effects. They are automatically banished if reduced to 0 Hit Points or if the spell that called them ends.", 0 },
                    { new Guid("e72bc2c7-30f7-452e-ab94-d6fe3fea6da6"), 0, new Guid("2189fed6-32bf-436d-9265-05a5a24eb668"), "This weapon makes wide sweeping or spinning attacks, making it easier to attack multiple enemies. When you attack with this weapon, you gain a +1 circumstance bonus to your attack roll if you already attempted to attack a different target this turn using this weapon.", 0 },
                    { new Guid("423a3690-e244-4d7b-9097-cc850f973820"), 0, new Guid("05b76c29-f5d4-4152-ae80-a94301f70c6a"), "A talisman is a small object affixed to armor, a shield, or a weapon (called the affixed item). You must be wielding or wearing an item to activate a talisman attached to it. Once activated, a talisman burns out permanently.", 0 },
                    { new Guid("fabc30cb-cf5b-467d-8fa4-3242646a35da"), 0, new Guid("6640d452-69f2-433d-b721-393a0bde16f5"), "A general feat with the skill trait improves your skills and their actions or gives you new actions for a skill. A feat with this trait can be selected when a class grants a skill feat or general feat. Archetype feats with the skill trait can be selected in place of a skill feat if you have that archetype’s dedication feat.", 0 },
                    { new Guid("ab6cff92-5bd6-49d5-a890-5c9dcb1efabc"), 0, new Guid("693f3b70-37e7-4da0-8da7-4d865c82add2"), "Teleportation effects allow you to instantaneously move from one point in space to another. Teleportation does not usually trigger reactions based on movement.", 0 },
                    { new Guid("608a4c37-012b-49bd-8dcc-450c7225a60a"), 0, new Guid("ae31ec44-8633-4a5c-94f3-1f5d2ed553dd"), "Effects and magic items with this trait are associated with the transmutation school of magic, typically changing something’s form.", 0 },
                    { new Guid("6a8c61c8-d554-4923-9acc-b5c870176a4b"), 0, new Guid("0b3c23de-79d0-490d-8dbb-f4840f4b5704"), "A hazard or item with this trait is constructed to hinder interlopers.", 0 },
                    { new Guid("8fc2bf54-c07d-4f6e-926d-c2f2c463b3ad"), 0, new Guid("01eb7172-c3df-4c6e-a13f-43522445f2b3"), "You can use this weapon to Trip with the Athletics skill even if you don’t have a free hand. This uses the weapon’s reach (if different from your own) and adds the weapon’s item bonus to attack rolls as an item bonus to the Athletics check. If you critically fail a check to Trip using the weapon, you can drop the weapon to take the effects of a failure instead of a critical failure.", 0 },
                    { new Guid("2f308cf1-74dc-42cf-a82a-6c0ee2a959d4"), 0, new Guid("f6da7ca3-bdb3-4c89-9cd8-4161fcc564c5"), "These weapons are used as a pair, complementing each other. When you attack with a twin weapon, you add a circumstance bonus to the damage roll equal to the weapon’s number of damage dice if you have previously attacked with a different weapon of the same type this turn. The weapons must be of the same type to benefit from this trait, but they don’t need to have the same runes.", 0 },
                    { new Guid("088a7fc0-3d68-46c3-bf35-ebed5deceb3d"), 0, new Guid("fd2bc373-0742-4272-9d1f-6740d7c5f149"), "This weapon can be wielded with two hands. Doing so changes its weapon damage die to the indicated value. This change applies to all the weapon’s damage dice, such as those from striking runes.", 0 },
                    { new Guid("0cd71c1f-bada-4a90-9583-65e0343be8b8"), 0, new Guid("7f4d2c14-f2ae-4499-abb3-5a618a14b66d"), "An unarmed attack uses your body rather than a manufactured weapon. An unarmed attack isn't a weapon, though it's categorized with weapons for weapon groups, and it might have weapon traits. Since it's part of your body, an unarmed attack can't be Disarmed. It also doesn't take up a hand, though a fist or other grasping appendage generally works like a free-hand weapon.", 0 },
                    { new Guid("8712b4ec-4465-4980-af64-8520d757922e"), 0, new Guid("77669ac3-df67-42f2-ad32-984b9dfa66d0"), "Something of uncommon rarity requires special training or comes from a particular culture or part of the world. Some character choices give access to uncommon options, and the GM can choose to allow access for anyone. Less is known about uncommon creatures than common creatures. They typically can’t be summoned. The DC of Recall Knowledge checks related to these creature is increased by 2.", 0 },
                    { new Guid("efafcb77-2553-4069-9c23-e91835f1aca7"), 0, new Guid("ede91540-2a4d-4e56-acec-da634658309a"), "Once living, these creatures were infused after death with negative energy and soul-corrupting evil magic. When reduced to 0 Hit Points, an undead creature is destroyed. Undead creatures are damaged by positive energy, are healed by negative energy, and don’t benefit from healing effects.", 0 },
                    { new Guid("966bc322-dbcf-48a4-b5da-f04f540caf3d"), 0, new Guid("995cdfe7-0a0b-4633-88d7-f88d499daeb3"), "A rules element with this trait is one-of-a-kind. The DC of Recall Knowledge checks related to creatures with this trait is increased by 10.", 0 },
                    { new Guid("065f3c01-c497-462b-b9f5-9d4cb82faf01"), 0, new Guid("9ec7b435-5128-4245-87ef-958971ac3113"), "A versatile weapon can be used to deal a different type of damage than that listed in the Damage entry. This trait indicates the alternate damage type. For instance, a piercing weapon that is versatile S can be used to deal piercing or slashing damage. You choose the damage type each time you make an attack.", 0 },
                    { new Guid("358d4b3a-92c1-4c8c-9930-5bb3d09d2b72"), 0, new Guid("24dc1d6b-75c3-4255-8847-f6dc04a7ce96"), "Afflictions with the virulent trait are harder to remove. You must succeed at two consecutive saves to reduce a virulent affliction’s stage by 1. A critical success reduces a virulent affliction’s stage by only 1 instead of by 2.", 0 },
                    { new Guid("975cd0ac-a42c-4f55-a905-aeae8ebcaa15"), 0, new Guid("dbebd472-2b53-4d66-a43d-f4f884137fea"), "A visual effect can affect only creatures that can see it. This applies only to visible parts of the effect, as determined by the GM.", 0 },
                    { new Guid("aa95f947-dc06-490a-a9f4-e08723546274"), 0, new Guid("89c21324-64de-4cd1-9b31-c8e3382b9c91"), "This ranged weapon is less effective at close distances. Your attacks against targets that are at a distance within the range listed take a –2 penalty.", 0 },
                    { new Guid("cc19b2da-8180-4e91-bf31-cc7fd8f07c31"), 0, new Guid("cb819435-64ff-4726-b2b3-c28669314cec"), "A wand contains a single spell which you can cast once per day.", 0 },
                    { new Guid("ff057606-9360-47b9-8a18-1df0b565f440"), 0, new Guid("c70e1bc4-ca02-4d77-b117-415baa4058eb"), "You can throw this weapon as a ranged attack, and it is a ranged weapon when thrown. A thrown weapon adds your Strength modifier to damage just like a melee weapon does. When this trait appears on a melee weapon, it also includes the range increment. Ranged weapons with this trait use the range increment specified in the weapon’s Range entry.", 0 },
                    { new Guid("e3da4a63-d85b-47ed-a777-6b483a2545c4"), 0, new Guid("d052186d-62ce-46db-9ca9-b4e32aed43f4"), "The hand holding this weapon is freely available to Climb.", 0 },
                    { new Guid("a5af7043-9daf-4782-b413-e2f3ffd79b41"), 0, new Guid("ee334634-256b-4334-b2c9-b0024939c185"), "Aberrations are creatures from beyond the planes or corruptions of the natural order.", 0 },
                    { new Guid("c2e3125f-23f6-45a7-ab20-62334e8a549c"), 0, new Guid("ef7d80ee-a7a0-417f-ba66-748ba26ec489"), "Effects with this trait deal acid damage. Creatures with this trait have a magical connection to acid.", 0 },
                    { new Guid("70055b4d-ac7a-4982-ae5c-cdd1ee024165"), 0, new Guid("e3fa3f52-ba3d-419c-905b-f8f7e7945017"), "Locathahs are fishlike aquatic humanoids.", 0 },
                    { new Guid("8281ca2d-4f65-4414-af5d-b976e9123e46"), 0, new Guid("e394e9a5-5bab-4615-96a9-a461c712e4af"), "Mortics are living humanoids with close ties to undeath. They have darkvision, negative healing, and vulnerabilities to sacred ground, and they can become undead by holding their breath.", 0 },
                    { new Guid("80832cd0-0ab9-43c2-88ef-988436465881"), 0, new Guid("820cc332-9efd-4ea9-9590-0644bd1f8e8a"), "Amicable humanoids living in the Darklands, munavris have powerful telekinetic and psychic abilities.", 0 },
                    { new Guid("a9df4036-4b7f-4174-8a99-f0e52c318d80"), 0, new Guid("b8e76a80-57b7-4d40-8642-e3d0dab04347"), "Nagaji are brawny humanoids with scaled skin and serpentine heads, many of whom serve or respect nagas.", 0 },
                    { new Guid("ff3e56dc-b849-4043-ad71-8569db7cf219"), 0, new Guid("2ec9f6dc-0fb0-4092-a0ac-345a05c5080f"), "A paaridar is a humanoid who has gained physical aspects and abilities of a powerful beast through corrupted magical rituals.", 0 },
                    { new Guid("53cc0b77-216b-4df0-8794-f1360e6dce7b"), 0, new Guid("982545c1-5019-4d56-91ff-c7c202de8961"), "A phantom is soul that has diverged from the River of Souls on the Ethereal Plane before being judged. They typically retain memories of their life before death, but are not undead.", 0 },
                    { new Guid("fa3682ac-7e59-4027-ac5e-dcd7921c5b5c"), 0, new Guid("febbc308-3220-4d97-9baa-160dfe75acfc"), "Samsarans are humanoids whose souls reincarnate into new bodies upon their death.", 0 },
                    { new Guid("6b691a27-453d-411c-aa15-62ae6136221b"), 0, new Guid("38f3b8d6-0bf4-462e-863f-698b9e114832"), "Evil ocean-dwelling humanoids, sea devils usually have darkvision and wavesense.", 0 },
                    { new Guid("1ff78756-9c89-4211-a9ca-2b08fb0f5536"), 0, new Guid("ab27faa6-b69a-4949-a9dc-34cf97f68459"), "A shabti is a constructed humanoid originally meant to face judgment for a living creature's sins after death.", 0 },
                    { new Guid("8b91994a-aab6-447c-ad71-f374df29cc03"), 0, new Guid("d57e72db-d8b9-4e8a-b8b0-3c8909ea3888"), "There was not explicit description for this trait.", 0 },
                    { new Guid("5bce8349-71fd-4481-a364-0515782a8993"), 0, new Guid("912562bb-0c9e-400c-b254-0754b107ec8a"), "These creatures are monstrous, wrathful misanthropes who seek to control others through anger and spite.", 0 },
                    { new Guid("713c81d2-b104-4dff-89f8-1883cd923a87"), 0, new Guid("a215a25c-f5d0-4f8a-881b-512d07a76ff6"), "This family of cannibalistic aberrations consists of various humanoid-shaped creatures that can separate their body into two pieces while hunting.", 0 },
                    { new Guid("83789e69-acd9-4d8a-bfbf-ed14fc95897a"), 0, new Guid("30cbee08-6c59-4b86-9160-21c97e38148d"), "Trolls are giant, brutish creatures and are well known for their ability to regenerate.", 0 },
                    { new Guid("fa113a36-5531-44db-9ade-fdbb28ddaaa4"), 0, new Guid("b18a1fb5-b904-4372-9fb4-dab6d6cf7b2c"), "A troop is an organized collection of component creatures, typically Small or Medium in size, working as a cohesive whole. A troop is 16 squares in size and has two Hit Point thresholds in their HP entry, under which it reduces in size to 12 squares and then 8 squares. A troop has the Troop Defenses, Form Up, and Troop Movement abilities. Most troops have a weakness to area damage. Because they consist of multiple discrete creatures, they can't be summoned.", 0 },
                    { new Guid("f77f6e3f-1cc9-4255-8ea8-e1a199c557bc"), 0, new Guid("029497fa-5a49-4a89-bfc3-68a2e57f765a"), "Effects and magic items with this trait are associated with the abjuration school of magic, typically involving protection or wards.", 0 },
                    { new Guid("8e90af5f-c83c-441a-8976-7cbb8d99f364"), 0, new Guid("9ddf2c48-1a7f-4877-8957-deaaec7d485b"), "Vanaras are monkeylike humanoids who share a devotion to monastic training.", 0 },
                    { new Guid("b508508e-6ef7-4658-b661-e397d7ee1c01"), 0, new Guid("b9e4c779-e070-49d0-abba-5268ca479d11"), "Small humanoids who emigrated from the Shadow Plane long ago, wayangs still wield shadow magic.", 0 },
                    { new Guid("c480c459-8d98-4978-92d8-882990b0c7cb"), 0, new Guid("92febdb0-6336-44be-8517-98608257eed6"), "A wyrwood is a small, sapient living construct crafted of wood and powered with an aeon stone or a similar magical stone.", 0 },
                    { new Guid("5dee63c7-66bf-4dd1-a07a-d50044eeb8c0"), 0, new Guid("4d39fd41-7d6f-4032-95e6-13c346e3b55a"), "Hobgoblins are a sturdy, clever people with a propensity for militaristic order", 0 },
                    { new Guid("a65e3f07-c42f-4fdd-9fb0-5b2ff3295ca2"), 0, new Guid("aa8a4365-a565-4dbf-8b0d-c3bd8cd7d719"), "Leshies are living plants animated by primal magic.", 0 },
                    { new Guid("e00fc8d8-fb3b-4a69-9510-dcdecf902d10"), 0, new Guid("84523211-cdc1-4622-bef5-fe6e0036e76b"), "These reptilian humanoids, also known as iruxi, are extremely adaptable and patient.", 0 },
                    { new Guid("e1a68b1b-3382-4f19-b87b-16cda6c95c9d"), 0, new Guid("fbe4f84d-576e-4d90-87a7-c6f96c213367"), "This magic comes from the arcane tradition, which is built on logic and rationality. Anything with this trait is magical.", 0 },
                    { new Guid("f8bf1432-6448-4dbd-8175-ca6a78687ea5"), 0, new Guid("9c9a620a-de8d-47c2-8a65-9aab7283d09a"), "When you Invest an Item that has the apex trait, it improves one of your ability scores, either increasing it by 2 or to a total of 18, whichever grants the higher score. This gives you all the benefits of the new ability score until the investiture ends. An apex item grants this benefit only the first time it’s invested within a 24-hour period, and you can benefit from only one apex item at a time. If you attempt to invest an apex item when you already have one invested, you don’t gain the ability score increase, though you do gain any other effects of Investing the Item.", 0 },
                    { new Guid("fe0b7000-8586-4a07-883d-e48ccda3ee4a"), 0, new Guid("9977a055-9dd0-496d-bffa-2ac631d6e465"), "An animal is a creature with a relatively low intelligence. It typically doesn’t have an Intelligence ability modifier over –4, can’t speak languages, and can’t be trained in Intelligence-based skills.", 0 },
                    { new Guid("82e376ca-6418-4504-a4d9-6d73420a8c68"), 0, new Guid("51947c16-9b13-49ae-9cf9-e181635b0560"), "This family of celestials is native to the plane of Nirvana. Most angels are neutral good, have darkvision, and have a weakness to evil damage.", 0 },
                    { new Guid("928c72d4-3925-4069-a7d1-fde5351f83d9"), 0, new Guid("99d33efc-c766-4d9f-a22a-9863ff5a7ed6"), "This indicates abilities from the alchemist class.", 0 },
                    { new Guid("7c56f73e-8fec-4975-8bb6-7430e8b702cc"), 0, new Guid("d1cba1ea-926f-4724-98ec-5d46b7b1fe9d"), "Alchemical items are powered by reactions of alchemical reagents. Alchemical items aren’t magical and don’t radiate a magical aura.", 0 },
                    { new Guid("644036f9-1f76-4fea-a66f-b5ee19001d5b"), 0, new Guid("1bd3d5af-0df2-4033-95fd-88c312902069"), "Effects with the air trait either manipulate or conjure air. Those that manipulate air have no effect in a vacuum or an area without air. Creatures with this trait consist primarily of air or have a magical connection to that element. Planes with this trait consist mostly of open spaces and air with various degrees of turbulence, though they also contain rare islands of floating stone and other elements and energies.", 0 },
                    { new Guid("ddd69f04-a78a-4f36-85af-2af36cda7862"), 0, new Guid("34f43b53-1639-4e15-ae03-9cec0ff0fa30"), "The multiple attack penalty you take with this weapon on the second attack on your turn is –4 instead of –5, and –8 instead of –10 on the third and subsequent attacks in the turn.", 0 },
                    { new Guid("2a6ec329-ea6c-496d-91d2-836b90286a2b"), 0, new Guid("9b4058c8-5257-4a20-bb5b-b7e9c521ce19"), "Feats with the additive trait allow you to spend actions to add special substances to bombs or elixirs. You can add only one additive to a single alchemical item, and attempting to add another spoils the item. You can typically use actions with the additive trait only when you're creating an infused alchemical item, and some can be used only with the Quick Alchemy action. The additive trait is always followed by a level, such as additive 2. An additive adds its level to the level of the alchemical item you're modifying; the result is the new level of the mixture. The mixture's item level must be no higher than your advanced alchemy level.", 0 },
                    { new Guid("d5fb9867-40c1-412a-ae45-afa939756d5f"), 0, new Guid("42f3721a-f751-417f-a0f8-c563f7d74f08"), "These faintly ophidian humanoids have venomous blood and saliva.", 0 },
                    { new Guid("5d05fd0a-3a7b-4f51-bce1-4eab5420ca68"), 0, new Guid("eb20e60f-fe7e-4c0e-a356-5d1f485dfdca"), "Winged humanoids, most of whom live in and around Cheliax.", 0 },
                    { new Guid("1d0fec83-fae4-4a34-a385-05b2b89ba3cb"), 1, new Guid("31b0e628-2fb5-4d73-b2bf-7e4e8359a248"), "An incorporeal creature can’t attempt Strength-based checks against physical creatures or objects—only against incorporeal ones—unless those objects have the ghost touch property rune. Likewise, a corporeal creature can’t attempt Strength-based checks against incorporeal creatures or objects.", 0 },
                    { new Guid("47fbc6ea-4925-490d-b681-f255d26f79fa"), 0, new Guid("22d4f125-e741-46bb-bb36-fe1f4c8fa635"), "Darkness effects extinguish non-magical light in the area, and can counteract less powerful magical light. You must usually target light magic with your darkness magic directly to counteract the light, but some darkness spells automatically attempt to counteract light.", 0 },
                    { new Guid("3132aa09-8544-4448-861d-8001b118bf44"), 2, new Guid("0a35bb1b-49fa-4b19-b034-80a998f4b607"), "The possessor must use its own actions to make the possessed creature act.", 0 },
                    { new Guid("702d0d7f-800d-401d-894a-3f6a58838d3f"), 3, new Guid("0a35bb1b-49fa-4b19-b034-80a998f4b607"), "If a possessor reaches 0 Hit Points through any combination of damage to its true body and mental damage from the possession, it is knocked out as normal and the possession immediately ends. If the target reaches 0 Hit Points first, the possessor can either fall unconscious with the body and continue the possession or end the effect as a free action and return to its body. If the target dies, the possession ends immediately and the possessor is stunned for 1 minute.", 0 },
                    { new Guid("0e7ee76f-6bdf-474e-bba3-37549c8b72ab"), 0, new Guid("f20a1378-da0f-4259-9631-a31ff5ca19e7"), "You can use this weapon to Disarm with the Athletics skill even if you don’t have a free hand. This uses the weapon’s reach (if different from your own) and adds the weapon’s item bonus to attack rolls (if any) as an item bonus to the Athletics check. If you critically fail a check to Disarm using the weapon, you can drop the weapon to take the effects of a failure instead of a critical failure. On a critical success, you still need a free hand if you want to take the item.", 0 },
                    { new Guid("2fb08814-3a1c-48cd-8564-1d2f8b3eef4e"), 0, new Guid("88776d22-b742-42ed-80a2-80dcb0379070"), "A potion is a magical liquid activated when you drink it.", 0 },
                    { new Guid("f0ccfe81-4b98-45dc-acdd-117be526a946"), 0, new Guid("241dfc1f-e304-4fa0-a086-e87f5b621bdb"), "Valuable materials with special properties have the precious trait. They can be substituted for base materials when you Craft items.", 0 },
                    { new Guid("38ede88d-cf05-46ca-8dbf-23e2c6960204"), 0, new Guid("cd9897ab-afd4-4905-b9d5-da1d7606242a"), "Effects with this trait determine what is likely to happen in the near future. Most predictions are divinations.", 0 },
                    { new Guid("d41d0e65-6091-440a-a624-6a8f81ac1533"), 0, new Guid("0a3a3730-eb95-4601-ac6e-c76caca8909d"), "On planes with this trait, time still passes but its effects are diminished.", 0 },
                    { new Guid("62e05849-bdfe-4ecf-8000-fed229fa0592"), 0, new Guid("5abc1ed0-f627-42e9-bf3e-6174d39b4bdc"), "Actions with this trait allow you to follow up earlier attacks. An action with the press trait can be used only if you are currently affected by a multiple attack penalty. Some actions with the press trait also grant an effect on a failure. The effects that are added on a failure don’t apply on a critical failure. If your press action succeeds, you can choose to apply the failure effect instead. (For example, you may wish to do this when an attack deals no damage due to resistance.) Because a press action requires a multiple attack penalty, you can’t use one when it’s not your turn, even if you use the Ready activity.", 0 },
                    { new Guid("c2d8fdc2-7550-483a-8d79-dc5a07666d34"), 0, new Guid("f6438a46-50a0-41ce-b415-0efd40fe05a7"), "This weapon can channel energy damage. You gain the Conduct Energy free action while wielding a resonant weapon.", 0 },
                    { new Guid("9b00cac3-75dd-4c96-af88-d1be82f1aa8f"), 0, new Guid("72009be6-d14a-4a2f-8ba4-15e7fa2b8dbe"), "This magic comes from the primal tradition, connecting to the natural world and instinct. Anything with this trait is magical.", 0 },
                    { new Guid("171c0549-30b0-480a-8e03-4b43539a01f5"), 0, new Guid("9861aaf3-7681-4ed7-9fca-733c0a8b9ad1"), "You add half your Strength modifier (if positive) to damage rolls with a propulsive ranged weapon. If you have a negative Strength modifier, you add your full Strength modifier instead.", 0 },
                    { new Guid("41b86350-334e-4b23-ae9d-cb0aba14e054"), 0, new Guid("9a9de55e-6e46-431f-9768-b03cd01320b1"), "You must be raging to use abilities with the rage trait, and they end automatically when you stop raging.", 0 },
                    { new Guid("6694f8e7-7c60-4a58-a22f-2789a65c0464"), 0, new Guid("a5fa9ba3-ef36-4180-a603-4bb410aaa56c"), "Reincarnations of evil souls, rakshasas are fiends that live on the Material Plane.", 0 },
                    { new Guid("9d4b09e3-fec1-4f59-8075-09bc854f5b67"), 1, new Guid("0a35bb1b-49fa-4b19-b034-80a998f4b607"), "A possessor loses the benefits of any of its active spells or abilities that affect its physical body, though it gains the benefits of the target’s active spells and abilities that affect their body. A possessor can use any of the target’s abilities that are purely physical, and it can’t use any of its own abilities except spells and purely mental abilities. The GM decides whether an ability is purely physical or purely mental. A possessor uses the target’s attack modifier, AC, Fortitude save, Reflex save, Perception, and physical skills, and its own Will save, mental skills, spell attack roll, and spell DC; benefits of invested items apply where relevant (the possessor’s invested items apply when using its own values, and the target’s invested items apply when using the target’s values). A possessor gains no benefit from casting spells that normally affect only the caster, since it isn’t in its own body.", 0 },
                    { new Guid("a9c272fd-c5dc-4a36-ac4e-e38a5eaab21d"), 0, new Guid("21adfb24-112a-4799-88c3-25490f102792"), "This indicates abilities from the ranger class.", 0 },
                    { new Guid("a602db3d-2e37-454d-9bd3-4ff88ef20a0e"), 0, new Guid("e864e521-13c1-4192-a530-9c461132766f"), "Natural attacks with this trait can be used to attack creatures up to the listed distance away instead of only adjacent creatures. Weapons with this trait are long and can be used to attack creatures up to 10 feet away instead of only adjacent creatures. For creatures that already have reach with the limb or limbs that wield the weapon, the weapon increases their reach by 5 feet.", 0 },
                    { new Guid("c61771e0-154e-4b20-926e-dd943f1bbb3e"), 0, new Guid("a6fb51b7-6e8c-406a-b9d3-66049faef2da"), "While all weapons need some amount of time to get into position, many ranged weapons also need to be loaded and reloaded. This entry indicates how many Interact actions it takes to reload such weapons. This can be 0 if drawing ammunition and firing the weapon are part of the same action. If an item takes 2 or more actions to reload, the GM determines whether they must be performed together as an activity, or you can spend some of those actions during one turn and the rest during your next turn.", 0 },
                    { new Guid("f8f2c3bc-1d75-4e2f-a5df-78d6d73f5085"), 0, new Guid("162b1085-1426-4953-8f5a-b11ff6432163"), "Effects with this trait see things as they truly are.", 0 },
                    { new Guid("a286907c-e251-4895-b7d6-c747dba39cd9"), 0, new Guid("008386f8-545f-4ced-a04e-b819a45c3cbb"), "This indicates abilities from the rogue class.", 0 },
                    { new Guid("a9058ce1-2ecd-4d1c-a9a9-b0aadbfe7545"), 0, new Guid("ab024244-3eea-4f3a-b38a-848fd67e130a"), "A scroll contains a single spell you can cast without a spell slot.", 0 },
                    { new Guid("0033865a-cec6-4770-a63d-96d92fdb6163"), 0, new Guid("a0a87999-5769-4838-ae13-d9e0c8afbed4"), "The GM rolls the check for this ability in secret.", 0 },
                    { new Guid("e9c02a2f-85a8-451e-ad36-5a43d634b568"), 0, new Guid("3debe28a-bc99-48a5-b3e0-63305662c938"), "This magic involves shadows or the energy of the Shadow Plane.", 0 },
                    { new Guid("dce77167-3331-4d4e-9390-78486cad2c35"), 0, new Guid("5f6680fc-208d-44db-a85f-92d572120738"), "You can use this weapon to Shove with the Athletics skill even if you don’t have a free hand. This uses the weapon’s reach (if different from your own) and adds the weapon’s item bonus to attack rolls as an item bonus to the Athletics check. If you critically fail a check to Shove using the weapon, you can drop the weapon to take the effects of a failure instead of a critical failure.", 0 },
                    { new Guid("49e325f6-058f-4df2-85b1-ccdc0a7f80e8"), 1, new Guid("b52f7376-e628-4d1b-8b54-a2e0d0e69c47"), "Afflictions with this trait are manifestations of potent ill will. A curse either lasts a specified amount of time or can be removed only by certain actions a character must perform or conditions they must meet. A curse with stages follows the rules for afflictions. (Gamemastery Guide pg. 251)", 0 },
                    { new Guid("7040488b-b67b-41c2-92a1-adf2f9241882"), 0, new Guid("b52f7376-e628-4d1b-8b54-a2e0d0e69c47"), "A curse is an effect that places some long-term affliction on a creature. Curses are always magical and are typically the result of a spell or trap. Effects with this trait can be removed only by effects that specifically target curses.", 0 },
                    { new Guid("1d3462c9-ee8a-4e48-935d-db489e23ed93"), 0, new Guid("a035e945-b6b9-4247-b640-6bd58b25f74a"), "This poison is delivered by contact with the skin.", 0 },
                    { new Guid("1416dbd5-d311-45a9-8ad2-6ce3eec76e21"), 0, new Guid("a5a1682b-6393-40a8-b426-51167dc74233"), "An item with this trait can be used only once. Unless stated otherwise, it's destroyed after activation. Consumable items include alchemical items and magical consumables such as scrolls and talismans. When a character creates consumable items, they can make them in batches of four.", 0 },
                    { new Guid("ad06ff83-d7a8-4e8a-98c2-da3f5b225141"), 0, new Guid("965d15d5-bc6d-4d12-99ec-baf53a276546"), "A consecration spell enhances an area for an extended period of time. A given area can have only a single consecration effect at a time. The new effect attempts to counteract any existing one in areas of overlap.", 0 },
                    { new Guid("d33c4be2-dbf2-4d34-a967-74d5f60a3b1b"), 0, new Guid("80770c53-f4d9-4895-a150-a57010382d13"), "This rarity indicates that a rules element is very difficult to find in the game world. A rare feat, spell, item or the like is available to players only if the GM decides to include it in the game, typically through discovery during play. Creatures with this trait are rare. They typically can’t be summoned. The DC of Recall Knowledge checks related to these creatures is increased by 5.", 0 },
                    { new Guid("2893131c-1352-4078-a76f-aa2cb29c7dcd"), 0, new Guid("556b46f3-1953-4bd8-9ae2-ad4718ff829e"), "Effects and magic items with this trait are associated with the conjuration school of magic, typically involving summoning, creation, teleportation, or moving things from place to place.", 0 },
                    { new Guid("47b2776c-fad6-4670-bd39-f14cc6fa5e53"), 0, new Guid("0a35bb1b-49fa-4b19-b034-80a998f4b607"), "Effects with this trait allow a creature to project its mind and spirit into a target. A creature immune to mental effects can’t use a possession effect. While possessing a target, a possessor’s true body is unconscious (and can’t wake up normally), unless the possession effect allows the creature to physically enter the target. Whenever the target takes damage, the possessor takes half that amount of damage as mental damage.", 0 },
                    { new Guid("ea2e4706-ed40-4e73-9c3e-bc882366872e"), 0, new Guid("d122ce52-0c97-4942-b4a0-a8d455c01883"), "These reptiles have survived from prehistoric times.", 0 },
                    { new Guid("f2f24426-f567-4557-8339-8f7aecbaf16a"), 0, new Guid("842d41fd-ad2d-4bc0-a7bf-1a58c079c298"), "You must select a feat with this trait to apply an archetype to your character.", 0 },
                    { new Guid("a7d07492-6d7c-41cd-a12f-0acb8c8922fd"), 0, new Guid("16f0ab88-bf51-4946-9af6-13f14ba313dd"), "On planes with this trait, all bodies of mass, regardless of size, are centers of gravity with roughly the same amount of force.", 0 },
                    { new Guid("58e9cf9f-b2cb-404c-ab34-43fade68bb0e"), 0, new Guid("59e38173-01b2-4336-aa17-5d0f4a28d1cd"), "The physical nature of a plane with this trait can’t be changed in any way.", 0 },
                    { new Guid("24f75ee1-c9e7-4608-820c-13b67cf427df"), 0, new Guid("858113c8-4744-4180-9315-8d5c4b47d929"), "Planes with this trait can change their physical nature according to the plane’s own whim.", 0 },
                    { new Guid("4e7fdcd7-36ec-4583-a716-379057a2139b"), 0, new Guid("4f39e05a-0fb0-4399-9987-c6b1cd4ade55"), "Actions with the reckless trait run the risk of the pilot losing control of a vehicle. When performing a reckless action, the pilot must first attempt an appropriate piloting check to keep control of the vehicle.", 0 },
                    { new Guid("2847b7b4-22cd-4e82-b635-53e28a966d76"), 0, new Guid("c4f96a94-62fd-4069-9598-58ecda44ca3d"), "Planes with this trait have little to no gravity.", 0 },
                    { new Guid("79d3e0dd-182e-4975-ab4a-326fe0446461"), 0, new Guid("07506b85-4174-42cb-a3e9-769651bb7876"), "Settlements with this trait are the largest of cities, often with a level of 8 or higher.", 0 },
                    { new Guid("61c48895-2365-459d-8a51-ca3e5c31bc91"), 0, new Guid("12fce780-8709-4837-ba3c-7be2bce3e9ee"), "On planes with this trait, the plane’s physical nature can be changed by things other than physical force or magic.", 0 },
                    { new Guid("61e028bb-2688-42c4-b53e-dcad9c0d7630"), 0, new Guid("c3b0ee13-49dd-4188-be4f-063d800c22a9"), "An effect with this trait delivers a poison or deals poison damage. An item with this trait is poisonous and might cause an affliction.", 0 },
                    { new Guid("9aaff29d-db03-4b51-820d-64f8451897ec"), 0, new Guid("165881b6-7de2-453c-884e-4c992db9e496"), "Planes with this trait have gravitational forces much weaker than those on the Material Plane.", 0 },
                    { new Guid("75a47869-9041-4ff5-9b6e-d1d3ac7b63e5"), 0, new Guid("59135a4e-ff22-4cdd-9df3-5b52a6bc6e04"), "An item with this trait is intelligent and has its own will and personality, as well as several statistics that most items don’t have. Intelligent items can’t be crafted by normal means, and they are always rare or unique.", 0 },
                    { new Guid("fc4cf05b-cc78-44df-a851-276dcf04aa6a"), 0, new Guid("0eb633c2-3994-4583-9731-40f8914dc40e"), "Planes with this trait are immeasurably large, perhaps infinite.", 0 },
                    { new Guid("a1514f9b-e252-4a70-b48a-5f744029d78a"), 0, new Guid("0694d5dd-47d5-469b-a1b8-a4215ca5e7a4"), "Planes with this trait have gravitational forces much stronger than those on the Material Plane.", 0 },
                    { new Guid("d050f16d-16d9-47d0-b2e1-60b71b75b33f"), 0, new Guid("8b3e67ad-f782-49ec-941f-ba99e83811fd"), "Items with this trait are artifacts. These magic items can’t be crafted by normal means, and they can’t be damaged by normal means. Artifacts are always rare or unique.", 0 },
                    { new Guid("4a989cdc-0c77-47eb-9bf2-2e8985155dc4"), 0, new Guid("dcdd20ec-597b-44f1-a3b3-a302edbf54a6"), "Planes with this trait have a flow of time that is consistently faster or slower than that of other planes.", 0 },
                    { new Guid("896cfd3f-16bd-4a90-89bf-e4198cd88f2f"), 0, new Guid("ae3ffdd3-8624-43b8-aaa2-d1237b0ee59c"), "Planes with this trait consist of a limited amount of space.", 0 },
                    { new Guid("e15ee200-d33a-4157-b8f8-d9412df63f2b"), 0, new Guid("7df265ef-e15c-4e11-80bd-e87208758c2e"), "Planes with this trait have a flow of time that slows down or speeds up relative to other planes.", 0 },
                    { new Guid("edde93d8-4fda-4de0-a7db-63363cc73a69"), 0, new Guid("6a759553-36b4-4d02-86ff-3348970fc639"), "You must select a feat with this trait to apply an archetype to your character.", 0 },
                    { new Guid("4899ceae-ca0f-440c-b224-b3b39c7a9f54"), 0, new Guid("2d273e11-bba7-4024-8d54-5449e202428b"), "An effect with the death trait kills you immediately if it reduces you to 0 HP. Some death effects can bring you closer to death or slay you outright without reducing you to 0 HP.", 0 },
                    { new Guid("4bb7fadc-67e6-4f00-b6de-4e297c7e08a1"), 0, new Guid("a47987be-2821-409e-a9f9-cf1a231772f6"), "An item with this trait is a drug, a poison that conveys short-term benefits in addition to harmful side effects and long-term consequences. Each time a creature uses a given drug it must also attempt a saving throw against addiction to that drug.", 0 },
                    { new Guid("38d54f45-56c0-4a77-901a-e6e3457cf761"), 0, new Guid("838fb10d-67df-4271-a6d5-054c1eb54f63"), "An item with this trait is cursed to cause trouble for its owner. A curse isn’t detected when the item is identified, though a critical success reveals both the presence and exact nature of the curse. Cursed items can’t be discarded once they’ve been triggered or invested the first time. The item can be removed only if the curse is removed.", 0 },
                    { new Guid("8100f911-7232-40ca-9e07-c2c8d0a373d0"), 0, new Guid("933245cf-38d3-44cf-994c-d353e042afbc"), "On a critical hit, the weapon adds a weapon damage die of the listed size. Roll this after doubling the weapon’s damage. This increases to two dice if the weapon has a greater striking rune and three dice if the weapon has a major striking rune. For instance, a rapier with a greater striking rune deals 2d8 extra piercing damage on a critical hit. An ability that changes the size of the weapon’s normal damage dice doesn’t change the size of its deadly die.", 0 },
                    { new Guid("654c8135-1ff7-4f7c-95b5-f06f93fd4cf1"), 0, new Guid("5eb9c441-afc9-477d-b2de-523714bff970"), "A family of fiends from Hell, most devils are irredeemably lawful evil. They typically have greater darkvision, immunity to fire, and telepathy.", 0 },
                    { new Guid("d76245ee-841c-4c93-8246-1a3cbe4e157b"), 0, new Guid("133638b4-16e8-466a-9ba6-cf6bd339f763"), "On planes with this trait, all bodies of mass can be centers of gravity with the same amount of force, but only if a non-mindless creature wills it.", 0 },
                    { new Guid("15b80e80-7363-4415-bce9-9ad29b00dcd6"), 0, new Guid("0d5ac0f8-6c22-45b2-81e6-5eb6bfcbb9e2"), "These effects transform the target into a new form. A target can’t be under the effect of more than one polymorph effect at a time. If it comes under the effect of a second polymorph effect, the second polymorph effect attempts to counteract the first. If it succeeds, it takes effect, and if it fails, the spell has no effect on that target. Any Strikes specifically granted by a polymorph effect are magical. Unless otherwise stated, polymorph spells don’t allow the target to take on the appearance of a specific individual creature, but rather just a generic creature of a general type or ancestry.", 0 },
                    { new Guid("0ac72a91-2825-44e6-a3ca-670c0f6c5fb7"), 1, new Guid("0d5ac0f8-6c22-45b2-81e6-5eb6bfcbb9e2"), "If you take on a battle form with a polymorph spell, the special statistics can be adjusted only by circumstance bonuses, status bonuses, and penalties. Unless otherwise noted, the battle form prevents you from casting spells, speaking, and using most manipulate actions that require hands. (If there’s doubt about whether you can use an action, the GM decides.) Your gear is absorbed into you; the constant abilities of your gear still function, but you can’t activate any items.", 0 },
                    { new Guid("cb99bcae-abe3-40a4-9471-c7d716a99d87"), 0, new Guid("705cbba0-bc4d-4b0f-9f76-9364bde0c6cf"), "Effects with this trait heal living creatures with positive energy, deal positive energy damage to undead, or manipulate positive energy. Planes with this trait are awash with life energy of such intensity that it can harm living creatures. Creatures with this trait are natives of the Positive Energy Plane. They can survive the basic environmental effects of the Positive Energy Plane.", 0 },
                    { new Guid("38f44cf7-5a68-43a7-955e-7773b32a099a"), 0, new Guid("4f98f4a5-3bc6-44b2-8e81-c5c6939d9253"), "Settlements with this trait tend to be relatively large, with levels typically ranging from 5 to 7.", 0 },
                    { new Guid("4cb57519-a9bf-4d34-bdd6-69300689486a"), 0, new Guid("b13e7ac3-cd40-4688-858d-f0fa3b00bf2e"), "A family of fiends, demons hail from or trace their origins to the Abyss. Most are irredeemably chaotic evil and have darkvision.", 0 },
                    { new Guid("1fcf61fc-f517-4688-b632-da31a81af60b"), 0, new Guid("108f08d2-0bd2-48af-94f5-a39b439814d1"), "An action with this trait requires a degree of mental concentration and discipline.", 0 },
                    { new Guid("cf4db94b-2c57-45f1-b132-933d8e3a2825"), 0, new Guid("a8667405-868d-4adb-a5b4-8542cda35792"), "A scrying effect lets you see, hear, or otherwise get sensory information from a distance using a sensor or apparatus, rather than your own eyes and ears.", 0 },
                    { new Guid("b6b0ed87-86ef-48ae-9596-4db024536bbc"), 0, new Guid("b02b7942-423b-4b11-83b1-15a30643e7dc"), "This indicates abilities from the wizard class.", 0 },
                    { new Guid("fe74443c-2c63-420e-b0e8-892869153e0a"), 0, new Guid("a9f1bc55-f399-40a1-a918-035cd939ec8e"), "Finishers are spectacular finishing moves that use your panache. You can use a finisher only if you have panache, and you lose your panache immediately after performing a finisher. Once you use a finisher, you can't use any actions that have the attack trait for the rest of your turn.", 0 },
                    { new Guid("502a7072-806e-4dae-8aea-bc6675a9edcd"), 1, new Guid("a9f1bc55-f399-40a1-a918-035cd939ec8e"), "Some actions that have the finisher trait also grant an effect on a failure. Effects added on a failure don't apply on a critical failure. If your finisher action succeeds, you can still choose to apply the failure effect instead. For example, you might do this when an attack deals no damage due to resistance.", 0 },
                    { new Guid("31d53d0c-d1ff-4915-8197-120bcd222009"), 0, new Guid("312359d8-0b0b-4692-a504-df210dd80f43"), "A hex is a short-term effect generated on the fly from your patron's magic, requiring your familiar to draw from your patron. As such, you can cast only one spell with the hex trait each turn; attempts to cast a second hex spell on the same turn fail, and the spellcasting actions are lost.", 0 },
                    { new Guid("ccdb5499-971a-4833-accb-d7ca9cb7d09d"), 0, new Guid("48ba8c69-63f3-4d36-8d61-781b4cbd8dba"), "This trait indicates abilities from the investigator class.", 0 },
                    { new Guid("b7877500-5942-428f-b6c5-668f28e1091d"), 0, new Guid("9f37fa8f-67c7-4b18-8410-c3c1fec6f873"), "Astral creatures are native of the Astral Plane. They can survive the basic environmental effects of the Astral Plane.", 0 },
                    { new Guid("a7a4006a-fca0-4c1d-b09c-13c2b54d1bed"), 0, new Guid("e1b10ce6-01fa-4acd-bd2d-108944d770e1"), "A creature with this trait is a member of the kobold ancestry. Kobolds are reptilian humanoids who are usually Small and typically have darkvision. An ability with this trait can be used or selected only by kobolds.", 0 },
                    { new Guid("1f8a3157-e5fd-4b43-9b24-55a1729ee95a"), 0, new Guid("0592d521-3b13-4f7a-9c05-a24dffeb34d3"), "A feat with this trait indicates a character's descendance from a particular type of creature. You can have only one lineage feat. You can select a lineage feat only at 1st level, and you can't retrain into or out of these feats.", 0 },
                    { new Guid("f13852bc-73a7-421a-8337-2bc140eebc49"), 0, new Guid("c8af0a33-b654-4e7a-bc58-88152f9dd4d0"), "To cast a composition cantrip or focus spell, you usually use a type of Performance. If the spell includes a verbal component, you must use an auditory performance, and if it includes a somatic component, you must use a visual one. The spell gains all the traits of the performance you used. You can cast only one composition spell each turn, and you can have only one active at a time. If you cast a new composition spell, any ongoing effects from your previous composition spell end immediately.", 0 },
                    { new Guid("185949b5-134d-43dd-9ee3-0887273b571f"), 0, new Guid("dcd0b784-a7c5-43dd-ae92-a5c4b94041d5"), "This weapon can be used to Trip with the Athletics skill at a distance up to the weapon's first range increment. The skill check takes a –2 circumstance penalty. You can add the weapon's item bonus to attack rolls as a bonus to the check. As with using a melee weapon to trip, a ranged trip doesn't deal any damage when used to Trip. This trait usually appears only on a thrown weapon.", 0 },
                    { new Guid("c49deecc-3ad0-47fb-8dfd-3a155a57c50a"), 0, new Guid("8bbb6788-c4d1-4749-ad5a-054245744acc"), "Members of this family of celestials are the protectors of Heaven and are lawful good. They have darkvision and a weakness to evil damage.", 0 },
                    { new Guid("602e4bcb-2185-43fe-b90b-82a321691c57"), 0, new Guid("b0d84536-c184-47d5-b28a-5c71d5daa2e5"), "A creature with this trait is a member of the ratfolk ancestry. Ratfolk are humanoids who resemble rats. An ability with this trait can be used or selected only by ratfolk.", 0 },
                    { new Guid("c0b9166f-9aae-4f3d-b521-2bf2e52b01a7"), 0, new Guid("1bfb1a5e-82ff-4b76-a224-eb257ff32753"), "Actions and abilities with the social trait can be used only while a vigilante is in their social identity.", 0 },
                    { new Guid("08658627-1b01-436d-8436-9cd782f05c54"), 0, new Guid("6f2863ac-71a4-480a-92b5-b7dbfa82218f"), "This trait indicates abilities from the swashbuckler class.", 0 },
                    { new Guid("2f960d6c-5cf6-4aa7-90ba-8bcdcb6f8efc"), 0, new Guid("0c6451bc-cf70-47ba-9f51-845ac61a6dbe"), "This feat belongs to an archetype.", 0 },
                    { new Guid("371481c2-afb7-40f2-8e9e-a83ffa574466"), 0, new Guid("9c1ee79b-60f9-453a-9a8a-bfa60ee51196"), "A creature with this trait is a member of the tengu ancestry. Tengus are humanoids who resemble birds. An ability with this trait can be used or selected only by tengus. An item with this trait is created and used by tengus.", 0 },
                    { new Guid("d13c4280-4caa-449b-a880-1fcd9a4ca9ed"), 0, new Guid("0d84cd27-92f4-4b56-90d6-b83aadb1b688"), "A creature with this trait has the tiefling versatile heritage. Tieflings are planar scions descended from fiends. An ability with this trait can be used or selected only by tieflings.", 0 },
                    { new Guid("eb7bab2d-58f7-4bb1-9209-6e3ad3d5cb85"), 0, new Guid("115a8b87-c636-4528-91a0-d9d5ddfeebb4"), "Using actions and abilities with the vigilante trait while in your social identity risks exposing you as a vigilante.", 0 },
                    { new Guid("7d014cf6-48b8-4827-b54b-d62616701aee"), 0, new Guid("c3f17377-4717-4be2-85cd-e6a82b391d64"), "This trait indicates abilities from the witch class.", 0 },
                    { new Guid("6aae9e73-0267-4911-9c11-eba84d036de5"), 0, new Guid("81a8c31f-4d7a-4395-b9d0-c398a060c913"), "Settlements with this trait are modest in size, with a level usually ranging from 2–4.", 0 },
                    { new Guid("389b2836-82f5-4611-bf73-5a4e212b445c"), 0, new Guid("413975b5-0faa-4762-a8fb-935b28b79301"), "An effect with this trait applies one or more diseases. A disease is typically an affliction.", 0 },
                    { new Guid("b6b4140d-73ea-4c5d-b73b-2f0350b89e47"), 0, new Guid("419ec619-744f-4a0b-b6b8-440fbeb0433a"), "Planes with this trait loop back on themselves when a creature reaches the plane’s edge.", 0 }
                });

            migrationBuilder.InsertData(
                table: "Traits_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("f2839aa1-b6b7-4534-8450-259258aa4372"), 0, new Guid("276de126-8331-48aa-9318-d40d10977a95"), "A synthetic humanoid ancestry created by artificial means. Most common in Numeria.", 0 },
                    { new Guid("492d9b1b-6a3d-496f-88ca-225e3050897f"), 0, new Guid("2903ddd8-22a3-4dc0-842e-e484d94ee53a"), "A type of planar scion descended from a being from Axis, the Plane of Law.", 0 },
                    { new Guid("6af38d25-4fdb-4c6a-bde3-106fb3c7ae52"), 0, new Guid("3e6590db-5cd3-4707-8ca7-3959859f81d4"), "Amphibious humanoids who live among the seas of the Inner Sea region, said to have descended from the people of Azlant. Sometimes known as gillmen or Low Azlanti.", 0 },
                    { new Guid("4baab5e2-7ac1-4bc5-84e3-7989aa98571d"), 0, new Guid("6b2aa915-1a46-4102-acde-584ff5da33b3"), "Humanoids that can partially or fully transform into animal forms.", 0 },
                    { new Guid("4adde5bd-4cf4-42ee-88d9-9777e24ccc1e"), 0, new Guid("63fa3f81-de0b-4c73-9d92-906df1990dfd"), "There was not explicit description for this trait.", 0 },
                    { new Guid("879a2203-f3b1-414f-9371-3c1c566a6d67"), 0, new Guid("25b12587-6109-4b67-85bc-aa12e0a0f86b"), "A humanoid transformed so completely by outside forces that they are now a unique ancestry", 0 },
                    { new Guid("6ed4f00c-ac70-4614-a825-5b0fc486ec42"), 0, new Guid("22cba2be-7f41-44bc-8727-0d5fe65df3d3"), "A planar scion descended from a chaotic being of the Maelstrom, such as a protean", 0 },
                    { new Guid("e2ad6657-2a93-4a23-8972-2fb35fcb2b0a"), 0, new Guid("49269c75-562f-4281-9302-f786e612c9df"), "An umbrella term for planar scions descended from beings from the Elemental Planes. Geniekin craft and use these weapons.", 0 },
                    { new Guid("8d3a5431-0b84-4ce4-ad97-4ec091f2253f"), 0, new Guid("ce1b5358-fa67-4603-b1ba-4aa7ccd6554e"), "A creature with this trait has the duskwalker versatile heritage. Duskwalkers are planar scions infused with the supernatural energy of psychopomps. An ability with this trait can be used or selected only by duskwalkers.", 0 },
                    { new Guid("57b55778-167e-45ac-8549-75862352898f"), 0, new Guid("071b12f3-135e-4d4f-a80e-705d41f4f051"), "A creature with this trait has the dhampir versatile heritage. These humanoids are the immortal offspring of vampires and members of other ancestries.", 0 },
                    { new Guid("8800b2d6-9b87-405b-8ca4-fa9f1a0885a6"), 0, new Guid("67c1da65-5ed2-4d0b-87e7-dbebb50bc31a"), "This trait indicates abilities from the oracle class.", 0 },
                    { new Guid("28b2b904-a864-4ea4-ab2e-ba40d9255ee3"), 0, new Guid("5cec7ab0-da0f-42d0-89d8-c3d3109e70eb"), "This weapon is designed to be inconspicuous or easily concealed. You gain a +2 circumstance bonus to Stealth checks and DCs to hide or conceal a weapon with this trait.", 0 },
                    { new Guid("26a5ff62-c5d5-4a7a-8743-ecb37cd6bdda"), 0, new Guid("e05ae250-111f-4e90-9332-3528b2f17d3a"), "An item with this trait can be worn by an animal companion or similar creature. A companion can have up to two items invested.", 0 },
                    { new Guid("79a0fbf2-e358-4816-aa35-019510ccb150"), 0, new Guid("6ab071b5-1126-460e-ac21-4eb6fecfad1e"), "Anything that doesn't list another rarity trait (uncommon, rare, or unique) automatically has the common trait. This rarity indicates that an ability, item, or spell is available to all players who meet the prerequisites for it. A creature of this rarity is generally known and can be summoned with the appropriate summon spell.", 0 },
                    { new Guid("39a56dd6-0d2c-4e75-a5c0-1cc69805a338"), 0, new Guid("42f8d547-7951-47ed-ad66-7ba48e750e78"), "The armor is so comfortable that you can rest normally while wearing it.", 0 },
                    { new Guid("8ed32315-b62e-4817-a0cc-e6356e1ddbcd"), 0, new Guid("6cceaf73-43d9-4249-824c-c9a03c8854bd"), "Effects with this trait deal cold damage. Creatures with this trait have a connection to magical cold.", 0 },
                    { new Guid("cacc98f1-7f03-4698-bd43-54a37a3eee7a"), 0, new Guid("6e219362-f25e-4f21-b9b1-494f24e689c1"), "This indicates abilities from the cleric class.", 0 },
                    { new Guid("03a7fb4f-b42d-4b62-b49d-eea4430128d2"), 0, new Guid("e77d5514-3bd5-40a9-ad28-d7ee55136071"), "There was not explicit description for this trait.", 0 },
                    { new Guid("76652546-26ed-43b8-a366-08feb1dbf332"), 0, new Guid("cef41071-5af2-47d7-8e60-b191bfc11d11"), "Chaotic effects often manipulate energy from chaos-aligned Outer Planes and are anathema to lawful divine servants or divine servants of lawful deities. A creature with this trait is chaotic in alignment.", 0 },
                    { new Guid("0c9bbffe-650f-4351-bd8b-6ada698cd7a8"), 0, new Guid("1df52bcb-47c3-4b08-86c4-0f6b811ec0a1"), "Spells with this trait increase the severity of your oracular curse when cast. Usually only revelation spells have this trait. You can't cast a cursebound spell if you don't have an oracular curse.", 0 },
                    { new Guid("c165d675-9c1c-44d5-a3f2-c3a8c9eb2ff6"), 0, new Guid("bbbb6740-63e4-427c-b352-d17bf0354b61"), "Creatures that hail from or have a strong connection to the good-aligned planes are called celestials. Celestials can survive the basic environmental effects of planes in the Outer Sphere.", 0 },
                    { new Guid("ddb09201-e88f-4416-88d9-b6c385ed08c5"), 0, new Guid("175c1a43-4b2b-4eb5-b767-fae273fbe109"), "A spell you can cast at will that is automatically heightened to half your level rounded up.", 0 },
                    { new Guid("be5a0147-c65d-4b4b-a89e-0ed0ba4d03a0"), 0, new Guid("78a8fe42-f559-4386-af44-cc49e8525378"), "The armor covers you so completely that it provides benefits against some damaging effects. On Reflex saves to avoid a damaging effect, such as a fireball, you add a +3 modifier instead of your Dexterity modifier.", 0 },
                    { new Guid("acc2ee12-144b-4b37-bd39-76fbb9cbd876"), 0, new Guid("14a69046-3a30-4a80-a708-23f3f121b28a"), "A ranged attack with this trait uses its Strength modifier instead of Dexterity on the attack roll.", 0 },
                    { new Guid("0d11b7ce-4489-464b-b6c5-012e531c30bb"), 0, new Guid("60266219-f1de-48d6-851d-4dec1cbcb18f"), "An alchemical bomb combines volatile alchemical components that explode when the bomb hits a creature or object. Most alchemical bombs deal damage, though some produce other effects.", 0 },
                    { new Guid("b7840c74-14a4-49be-89a2-2ebfe9cc898f"), 0, new Guid("24b77a08-9548-4a40-b4e3-186e21b6a55b"), "A creature similar to an animal but with an Intelligence modifier of –3 or higher is usually a beast. Unlike an animal, a beast might be able to speak and reason.", 0 },
                    { new Guid("890491b2-93ad-4c88-a088-8f4fab3a79ad"), 0, new Guid("98a520d1-cebe-4f03-9c60-f244748b9dc7"), "This indicates abilities from the champion class.", 0 },
                    { new Guid("928e9ca0-6b10-4f28-8cdf-8cbd06dd8e97"), 0, new Guid("bca7730f-377b-429b-ba4b-86ffeacc3f84"), "An attached weapon must be combined with another piece of gear to be used. The trait lists what type of item the weapon must be attached to. You must be wielding or wearing the item the weapon is attached to in order to attack with it. For example, shield spikes are attached to a shield, allowing you to attack with the spikes instead of a shield bash, but only if you’re wielding the shield. An attached weapon is usually bolted onto or built into the item it’s attached to, and typically an item can have only one weapon attached to it. An attached weapon can be affixed to an item with 10 minutes of work and a successful DC 10 Crafting check; this includes the time needed to remove the weapon from a previous item, if necessary. If an item is destroyed, its attached weapon can usually be salvaged.", 0 },
                    { new Guid("3807b06e-8abb-4943-8c88-3cef0e68b114"), 0, new Guid("b2cdd51d-5562-4ec2-ba05-b039090c6d2c"), "A creature with this trait is a member of the catfolk ancestry. Catfolk are humanoids with feline features. An ability with this trait can be used or selected only by catfolk. An item with this trait is created and used by catfolk.", 0 },
                    { new Guid("e6dddf71-83f5-489b-80ff-f85a8caa5463"), 0, new Guid("3e9bd9b1-aa6f-4319-92c4-0b4c4ad6dea6"), "A creature with this trait has the aasimar versatile heritage. Aasimars are planar scions descended from celestial beings. An ability with this trait can be used or selected only by aasimars.", 0 },
                    { new Guid("2d59cb58-7d34-40b4-9d2e-9088c5bbf3cd"), 0, new Guid("00aef935-be7a-4bfe-8aea-6c281f9dc756"), "An ability with this trait involves an attack. For each attack you make beyond the first on your turn, you take a multiple attack penalty. Actions", 0 },
                    { new Guid("913f7c38-290b-47c4-8821-cc0cd04fec5c"), 0, new Guid("ea2796f7-7b9f-4bb4-b756-e35d25ef18ec"), "A creature with this trait has the changeling versatile heritage. Changelings are the children of hags and members of other humanoid ancestries. An ability with this trait can be used or selected only by changelings.", 0 },
                    { new Guid("010c1c91-a2e8-4bec-afa0-dc15e2e222b2"), 0, new Guid("fb4c9d91-e6e8-424f-b4c4-29d8b3b77464"), "An aura is an emanation that continually ebbs out from you, affecting creatures within a certain radius. Aura can also refer to the magical signature of an item or a creature with a strong alignment.", 0 },
                    { new Guid("ea6c5042-e28f-4e60-9055-c55dd26bf47f"), 0, new Guid("01b25e97-5ae2-41e9-9165-338ef32f4df1"), "Auditory actions and effects rely on sound. An action with the auditory trait can be successfully performed only if the creature using the action can speak or otherwise produce the required sounds. A spell or effect with the auditory trait has its effect only if the target can hear it. This applies only to sound-based parts of the effect, as determined by the GM. This is different from a sonic effect, which still affects targets who can't hear it (such as deaf targets) as long as the effect itself makes sound.", 0 },
                    { new Guid("501bd431-5666-4ebe-a22b-ad3d4f54f673"), 0, new Guid("58bbbff9-2391-4b10-9dd5-ef55e8dc41ef"), "When you hit a flat-footed creature, this weapon deals 1 precision damage in addition to its normal damage. The precision damage increases to 2 if the weapon is a +3 weapon.", 0 },
                    { new Guid("08057b12-30c0-4d14-b5fc-441fd1671655"), 0, new Guid("2f14e52a-05b8-4abc-a720-d2e9d943538f"), "You can use the momentum from a missed attack with this weapon to lead into your next attack. After missing with this weapon on your turn, you gain a +1 circumstance bonus to your next attack with this weapon before the end of your turn.", 0 },
                    { new Guid("2f59496f-49f3-4452-b4b1-b9e73a02d065"), 0, new Guid("0dcbd033-b10d-44e7-87f0-5a7e5214d041"), "This indicates abilities from the barbarian class.", 0 },
                    { new Guid("e7b69acf-969e-4dbd-a5c3-b405bdb9a2c7"), 0, new Guid("f35d2381-a82a-4ad6-8ac8-19fd84a42dda"), "This family of celestials is native to Elysium. They are typically chaotic good and have darkvision and a weakness to evil and cold iron.", 0 },
                    { new Guid("a2b7d69b-ef65-467e-b6f1-6f33d9cc90f8"), 0, new Guid("5c3dcdf8-1928-4f60-bd75-b7323acc0be1"), "This indicates abilities from the bard class.", 0 }
                });

            migrationBuilder.InsertData(
                table: "WeaponPropertyRuneAction",
                columns: new[] { "Id", "ActionTypeId", "Effect", "Frequency", "Name", "Requirements", "RuneId", "TraitsId", "Trigger" },
                values: new object[,]
                {
                    { new Guid("f0ade3f8-bc90-41eb-aeef-24b11607bcc3"), new Guid("fe122850-b449-482d-8350-ac21e8985594"), "You Release the weapon and it dances through the air, fighting on its own against the last enemy you attacked, or the nearest enemy to it if your target has been defeated. At the end of your turn each round, the weapon can Fly up to its fly Speed of 40 feet, and then can either Fly again or Strike one creature within its reach.", null, "Command, Interact", null, new Guid("db537aa1-ebec-4919-8e71-8a2172b1197a"), null, null },
                    { new Guid("f2c2edc5-c720-4d5c-8376-eccdb3ee6ba0"), new Guid("26ab8b82-ea91-4247-934b-618c724aca8b"), "Harmlessly expend the stored spell. This frees the weapon to have a new spell cast into it.", null, "Command", null, new Guid("294a6238-beb1-4b09-97c6-dc08d2f98185"), null, null },
                    { new Guid("5be2c09b-99e6-4d4a-ab43-90c92dce906b"), new Guid("26ab8b82-ea91-4247-934b-618c724aca8b"), "The weapon takes the shape of another melee weapon that requires the same number of hands to wield. The weapon’s runes and any precious material it’s made of apply to the weapon’s new shape. Any property runes that can’t apply to the new form are suppressed until the item takes a shape to which they can apply.", null, "Interact", null, new Guid("327ed57b-80ae-431c-8611-310c9e4667f1"), null, null },
                    { new Guid("06e47d8f-a1bd-4f8e-997d-08e750dd6d8b"), new Guid("668ed964-cf7f-43df-b4b3-6a89c28551aa"), "The target takes persistent bleed damage equal to 1d8 per weapon damage die of the etched weapon.", "Once per day.", "Command", null, new Guid("97c626c9-64b6-4b0b-ac3b-c362d7d661c3"), null, "You critically succeed at an attack roll against a good creature with the weapon." },
                    { new Guid("60123526-a8c9-4fbb-a825-2f56b712a385"), new Guid("668ed964-cf7f-43df-b4b3-6a89c28551aa"), "The target must succeed at a DC 37 Fortitude save or be decapitated. This kills any creature except ones that don’t require a head to live. For creatures with multiple heads, this usually kills the creature only if you sever its last head.", null, "Envision", null, new Guid("7f7dc195-f152-4e36-a6d3-db63888e3c58"), null, "You roll a natural 20 on a Strike with the weapon, critically succeed, and deal slashing damage. The target must have a head." },
                    { new Guid("d2975b34-2c3a-4eb1-9dbe-8cc0fa325187"), new Guid("668ed964-cf7f-43df-b4b3-6a89c28551aa"), "You regain HP equal to double the evil creature’s level. This is a good, positive, healing effect.", "One per day.", "Command", null, new Guid("0347c95e-2227-4c7c-92f2-d37d77e78e7d"), null, "You critically succeed at an attack roll against an evil creature with the weapon." },
                    { new Guid("2d5e8f15-61cd-49f5-a621-0b6d2b32b5dc"), new Guid("26ab8b82-ea91-4247-934b-618c724aca8b"), "You unleash the stored spell, which uses the target of the triggering attack as the target of the spell. This empties the spell from the weapon and allows a spell to be cast into it again. If the spell requires a spell attack roll, the result of your attack roll with the weapon determines the degree of success of the spell, and if the spell requires a saving throw, the DC is 30.", null, "Command", "On your previous action this turn, you hit and damaged a creature with this weapon.", new Guid("294a6238-beb1-4b09-97c6-dc08d2f98185"), null, null },
                    { new Guid("752ce6e0-d83f-47f5-b05a-29ed9a6bff51"), new Guid("4716abe4-50c3-447d-bb27-2b268667b3c2"), "You learn the secrets the weapon gleaned from the creature's blood. Attempt to Recall Knowledge about the target of the required attack, gaining an item bonus to the Recall Knowledge skill check equal to the weapon's item bonus to attack rolls from its potency rune. If the required attack was a critical hit, you also gain a +2 circumstance bonus to this check.", "Once per minute.", "Envision", "On your previous action this turn, you used this weapon to hit and damage a creature that has blood or other vital fluids.", new Guid("bab86729-ac81-4292-bf39-e86a51c24fcf"), null, null },
                    { new Guid("be587d25-d395-4c0c-9601-6b81507b8bfa"), new Guid("668ed964-cf7f-43df-b4b3-6a89c28551aa"), "The damaged creature must succeed at a DC 20 Will save or be pacified. A pacified creature takes a –2 penalty to attack rolls on any attacks that aren't nonlethal for 1 minute, and the creature also experiences a clear psychic warning that they should stop dealing lethal damage.", null, "Command", null, new Guid("89a71607-0a02-4f55-87d3-48f6bdff84e5"), null, "You damage a creature with a pacifying weapon" },
                    { new Guid("237e2cf1-65b5-4fa2-9e60-175747d76c1f"), new Guid("26ab8b82-ea91-4247-934b-618c724aca8b"), "You brandish the weapon and focus its power, causing the serrated shards to buzz as they spin at a dizzying speed. On your next hit with the weapon this turn that deals slashing damage, the serrating rune adds an additional 1d12 damage instead of the additional 1d4 damage, and then the shards return to their usual speed.", null, "Interact", null, new Guid("9f59dddb-5e3b-4809-b14c-b2d31e002f50"), null, null }
                });

            migrationBuilder.InsertData(
                table: "WeaponPropertyRunePotencyBinding",
                columns: new[] { "Id", "ItemLevel", "PotencyId", "Price", "RollableEffectId", "RuneId", "TraitsId" },
                values: new object[,]
                {
                    { new Guid("1b57fea8-cdc8-4899-8cdb-f84700bfe741"), 8, new Guid("5e2f27d1-6b8b-41a0-8f58-095a4bb926d3"), 50000, null, new Guid("fb4d332f-a643-4f63-8c5f-b99383dbef4a"), null },
