            migrationBuilder.InsertData(
                table: "Conditions_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("6f70d006-bd20-422d-ba07-22db1bf4f59f"), 4, new Guid("10ef1d07-27bd-4073-96f7-2a55a05a9831"), "You take damage, provided the damage doesn't reduce you to 0 Hit Points. If the damage reduces you to 0 Hit Points, you remain unconscious and gain the dying condition as normal.", 2 },
                    { new Guid("02af347c-1d15-459a-88ce-3bd53bfcebdd"), 0, new Guid("43bea701-97ae-4ab1-8e30-e42fcff51f41"), "If you are unnoticed by a creature, that creature has no idea you are present at all. When you’re unnoticed, you’re also undetected by the creature. This condition matters for abilities that can be used only against targets totally unaware of your presence.", 0 },
                    { new Guid("042a7b29-141c-4489-b084-86796a198da4"), 8, new Guid("10ef1d07-27bd-4073-96f7-2a55a05a9831"), "If you are simply asleep, the GM decides you wake up either because you have had a restful night's sleep or something disrupted that rest.", 2 },
                    { new Guid("e60b28de-b1af-43af-ba61-daf960327a05"), 7, new Guid("10ef1d07-27bd-4073-96f7-2a55a05a9831"), "There's loud noise going on around you—though this isn't automatic. At the start of your turn, you automatically attempt a Perception check against the noise's DC (or the lowest DC if there is more than one noise), waking up if you succeed. If creatures are attempting to stay quiet around you, this Perception check uses their Stealth DCs. Some magical effects make you sleep so deeply that they don't allow you to attempt this Perception check.", 2 },
                    { new Guid("1c0ad848-d2ea-45b4-a709-9d84395bb14d"), 6, new Guid("10ef1d07-27bd-4073-96f7-2a55a05a9831"), "Someone shakes you awake with an Interact action.", 2 },
                    { new Guid("a84e3630-44d8-4047-b3d9-d21bd140eadf"), 5, new Guid("10ef1d07-27bd-4073-96f7-2a55a05a9831"), "You receive healing, other than the natural healing you get from resting.", 2 },
                    { new Guid("96b1a609-4873-422b-9fad-494547fe4387"), 3, new Guid("10ef1d07-27bd-4073-96f7-2a55a05a9831"), "If you’re unconscious and have more than 1 Hit Point (typically because you are asleep or unconscious due to an effect), you wake up in one of the following ways. Each causes you to lose the unconscious condition.", 0 },
                    { new Guid("39067593-a781-4b58-a74a-175b8458e81e"), 0, new Guid("ecb312a5-4e27-43b9-89ec-1a615d9f9dc2"), "You’re tied up and can barely move, or a creature has you pinned. You have the flat-footed and immobilized conditions, and you can’t use any actions with the attack or manipulate traits except to attempt to Escape or Force Open your bonds. Restrained overrides grabbed.", 0 },
                    { new Guid("de7bc05a-0a68-407f-9325-18b58b3e4ef1"), 0, new Guid("e9e00854-3d42-48b7-9724-017c8a46e3c0"), "You can’t see. All normal terrain is difficult terrain to you. You can’t detect anything using vision. You automatically critically fail Perception checks that require you to be able to see, and if vision is your only precise sense, you take a –4 status penalty to Perception checks. You are immune to visual effects. Blinded overrides dazzled.", 0 },
                    { new Guid("be5208b3-bbef-49f9-94b4-3da0a9dbb2df"), 2, new Guid("10ef1d07-27bd-4073-96f7-2a55a05a9831"), "If you are unconscious and at 0 Hit Points, but not dying, you naturally return to 1 Hit Point and awaken after sufficient time passes. The GM determines how long you remain unconscious, from a minimum of 10 minutes to several hours. If you receive healing during this time, you lose the unconscious condition and can act normally on your next turn.", 0 },
                    { new Guid("d56e4fd8-c59b-4f88-b3b0-5b3bd29f2f45"), 1, new Guid("10ef1d07-27bd-4073-96f7-2a55a05a9831"), "If you’re unconscious because you’re dying, you can’t wake up while you have 0 Hit Points. If you are restored to 1 Hit Point or more via healing, you lose the dying and unconscious conditions and can act normally on your next turn.", 0 },
                    { new Guid("ccda5475-0435-42f0-aff9-64ed329fc078"), 0, new Guid("10ef1d07-27bd-4073-96f7-2a55a05a9831"), "You’re sleeping, or you’ve been knocked out. You can’t act. You take a –4 status penalty to AC, Perception, and Reflex saves, and you have the blinded and flat-footed conditions. When you gain this condition, you fall prone and drop items you are wielding or holding unless the effect states otherwise or the GM determines you’re in a position in which you wouldn’t.", 0 },
                    { new Guid("ad411fa0-9af4-4d4e-ac38-00993975437a"), 1, new Guid("4d045584-3a7f-433b-ad89-0f658c379923"), "Stunned overrides slowed. If the duration of your stunned condition ends while you are slowed, you count the actions lost to the stunned condition toward those lost to being slowed. So, if you were stunned 1 and slowed 2 at the beginning of your turn, you would lose 1 action from stunned, and then lose only 1 additional action by being slowed, so you would still have 1 action remaining to use that turn.", 0 },
                    { new Guid("48e84c47-e07c-479e-944f-d07f45cc88d4"), 0, new Guid("4d045584-3a7f-433b-ad89-0f658c379923"), "You’ve become senseless. You can’t act while stunned. Stunned usually includes a value, which indicates how many total actions you lose, possibly over multiple turns, from being stunned. Each time you regain actions (such as at the start of your turn), reduce the number you regain by your stunned value, then reduce your stunned value by the number of actions you lost. For example, if you were stunned 4, you would lose all 3 of your actions on your turn, reducing you to stunned 1; on your next turn, you would lose 1 more action, and then be able to use your remaining 2 actions normally. Stunned might also have a duration instead of a value, such as “stunned for 1 minute.” In this case, you lose all your actions for the listed duration.", 0 }
                });

