                    { new Guid("f7462ef0-62d3-48ad-bc24-e80318b98455"), new Guid("9230c1f0-09ea-4dd2-b6d4-bb0cfcbeabdd"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This long, narrow tube is used for shooting blowgun darts, using only the power of a forcefully exhaled breath.", "1", null, "Blowgun", 10, 20, 1, new Guid("00860b13-76fc-42d7-a5d7-00a6591e21dc"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("79516d2f-0c2d-47d3-b411-5b02ae26022f") },
                    { new Guid("957a55d1-dbc4-4060-ac98-aa4523175510"), new Guid("550fe4e4-da65-4660-93bb-03676930ac11"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d10", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This staff ends in a Y-shaped split that cradles a sling. The length of the staff provides excellent leverage when used two‑handed to fling rocks or bullets from the sling.", "2", null, "Halfling Sling Staff", 500, 80, 1, new Guid("cd06d5ba-e50c-461f-ac71-3271d52c9c3f"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("92c0ebe3-618f-45e8-b9e2-cbd47a96ea96") },
                    { new Guid("c532d9bd-cc75-4a16-bb46-b63c06fa9917"), new Guid("e784b731-7bb1-4e51-b438-3e88eb542a41"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This projectile weapon is made from horn, wood, and sinew laminated together to increase the power of its pull and the force of its projectile. Like all longbows, its great size also increases the bow’s range and power. You must use two hands to fire it, and it cannot be used while mounted. Any time an ability is specifically restricted to a longbow, such as Erastil’s favored weapon, it also applies to composite longbows unless otherwise stated.", "1+", null, "Composite Longbow", 2000, 100, 0, new Guid("f98fded2-6dfb-43ef-9ef1-2a0b9a9d6dae"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("26d5e7ba-84a2-46d5-966d-c8eeda6cf9a4"), new Guid("550fe4e4-da65-4660-93bb-03676930ac11"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "Little more than a leather cup attached to a pair of straps, a sling can be used to fling smooth stones or sling bullets at a range.", "1", null, "Sling", 0, 50, 1, new Guid("95ea6700-cabd-4454-8926-4e4a75a55b59"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("92c0ebe3-618f-45e8-b9e2-cbd47a96ea96") },
                    { new Guid("d093010f-0b1b-41d0-b76e-c5532a2d99a5"), new Guid("e784b731-7bb1-4e51-b438-3e88eb542a41"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This shortbow is made from horn, wood, and sinew laminated together to increase the power of its pull and the force of its projectile. Its compact size and power make it a favorite of mounted archers. Any time an ability is specifically restricted to a shortbow, it also applies to composite shortbows unless otherwise stated.", "1+", null, "Composite Shortbow", 1400, 60, 0, new Guid("fb97184c-4af3-4ac7-9bb4-3eb3d5999ab6"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("c5272f9b-93f4-42d6-baa1-7262fb6cd1ec"), new Guid("5ee1520e-e377-4855-8e73-81ebee4c146d"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This weapon features an ingeniously designed catch mechanism at the top of the flight grove, just in front of the latch, which automatically loads a bolt from a magazine and resets the string each time the weapon is fired. A typical repeating hand crossbow magazine holds five bolts.", "1", null, "Repeating Hand Crossbow", 1000, 60, 0, new Guid("f97d2f26-6130-4d23-aac8-015e07958054"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("4db58af2-e60f-44f7-b8b3-88a1a74c3120"), new Guid("c51ef03b-db9b-44ac-92ac-39a0c7834b95"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This large crossbow is harder to load and more substantial than a regular crossbow, but it packs a greater punch.", "2", null, "Heavy Crossbow", 400, 120, 2, new Guid("6cafd971-2575-43f8-861b-9c1024a3ac11"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("7f5df152-e9a8-4918-a561-2aae39f0938b"), new Guid("2981098c-b7f9-40bd-83a4-624eec7ef483"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d10", new Guid("3f2fe0bc-7952-4593-b9a6-d24b8aede62d"), "Designed by conrasu warriors, this complex device resembles a crossbow and fires small wooden bullets known as taws. A system of blades within the launcher can rapidly reshape a taw as it's loaded, allowing the launcher to fire taws of different shapes, such as fléchettes.", "2", null, "Taw Launcher", 1000, 100, 1, new Guid("8c2cadd3-1f2e-442b-a75c-2cdfa563852e"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("2ff08622-f9b8-4a19-8cf0-0f6c957762ee"), new Guid("c51ef03b-db9b-44ac-92ac-39a0c7834b95"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This ranged weapon has a bow-like assembly mounted on a handled frame called a tiller. The tiller has a mechanism to lock the bowstring in place, attached to a trigger mechanism that releases the tension and launches a bolt.", "2", null, "Crossbow", 300, 120, 1, new Guid("e6d8ee85-bb06-4d89-abf3-4a3ba7fae0d6"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("fc7b92de-da67-4924-8ee2-b07bfbec720d"), new Guid("c51ef03b-db9b-44ac-92ac-39a0c7834b95"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This crossbow can deliver alchemically infused bolts. The strange weapon has a metal bracket mounted on the side of the stock near the lath. As an action, you can load a single lesser alchemical bomb into the bracket; this bomb must be one that deals energy damage (such as an acid flask, alchemist’s fire, bottled lightning, frost vial, or thunderstone). The next three attacks made with the crossbow deal 1d6 damage of the bomb’s damage type in addition to the crossbow’s normal damage. If the second and third attacks are not all made within 1 minute of the first attack, the bomb’s energy is wasted. These attacks never deal splash damage or other special effects of the bomb and are not modified by any abilities that add to or modify a bomb’s effect. The addition of the bracket serves to unbalance the weapon, reducing its range to 30 feet. It otherwise functions as a crossbow (when determining damage, reload, and so on). Creatures use their crossbow proficiency when using the alchemical crossbow. The alchemical crossbow costs 25 gp.", "2", null, "Alchemical Crossbow", 2500, 30, 1, new Guid("538738b0-b51d-4e95-9468-2954f72fedba"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("7c36bcfe-e828-43ca-baca-1a49be7ebfba"), new Guid("e784b731-7bb1-4e51-b438-3e88eb542a41"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This smaller bow is made of a single piece of wood and favored by skirmishers and cavalry.", "1+", null, "Shortbow", 300, 60, 0, new Guid("49b660af-5244-401f-8802-973448c4f7bd"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("bc6f549d-1db3-4414-8f4f-899691cff93d"), new Guid("c51ef03b-db9b-44ac-92ac-39a0c7834b95"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "Sometimes referred to as an alley bow by rogues or ruffians, this small crossbow fires small bolts that are sometimes used to deliver poison to the target. It’s small enough to be shot one-handed, but it still requires two hands to load.", "1", null, "Hand Crowssbow", 300, 60, 1, new Guid("037182fa-7919-4787-b078-cc6508c4fd0d"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("59fa141b-7ef8-4ae5-b006-925a1a5e4fc3"), new Guid("e784b731-7bb1-4e51-b438-3e88eb542a41"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This 5-foot-tall bow, usually made of a single piece of elm, hickory, or yew, has a powerful draw and is excellent at propelling arrows with great force and at an extreme distance. You must use two hands to fire a longbow, and it can’t be used while mounted.", "1+", null, "Longbow", 600, 100, 0, new Guid("ef9133cf-1818-4e73-9608-d3ed4c5cc288"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") }
                });

