            migrationBuilder.InsertData(
                table: "WeaponPropertyRunePotencyBinding_Benefits",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("318feeb1-4c1a-4ee7-a9d9-0735d4a43c13"), 0, new Guid("58601e5f-f93a-46fe-9e6e-2f4d63ed7f9f"), "The weapon deals 1d4 bleed damage to creatures designated as the clan’s enemy, and the DC of the Fortitude save to avoid becoming sickened is 30.", 0 },
                    { new Guid("77e3597b-6ea4-4733-8920-04c4cebbd31a"), 1, new Guid("5841519c-7f2e-4954-aa13-47b6fc1e7a62"), "In addition, whenever you inflict persistent bleed damage with a bloodbane weapon (whether from its innate ability or in some other way), the weapon leaves ragged wounds. The bleeding creature must succeed at a DC 25 Fortitude save or become sickened 1. The creature is then temporarily immune for 1 hour.", 0 },
                    { new Guid("0c77fc3d-b181-4975-ba10-cafbbfbadd37"), 0, new Guid("5841519c-7f2e-4954-aa13-47b6fc1e7a62"), "A bloodbane clan dagger is especially vicious against the ancestral enemies of the clan. When you damage an appropriate type of creature with the weapon, that creature takes 1 persistent bleed damage. The type of creature depends on the clan that made the dagger, but is typically drow, duergar, giant, or orc.", 0 },
                    { new Guid("8b173bbe-1116-4a16-a533-5d3a6b6ad049"), 0, new Guid("f4de6228-1e02-4a73-a6ed-a7f328a26eac"), "Weapons with wounding runes are said to thirst for blood. When you hit a creature with a wounding weapon, you deal an extra 1d6 persistent bleed damage. On a critical hit, it instead deals 1d12 persistent bleed damage.", 0 },
                    { new Guid("bc8e78cc-7535-4e8e-9e8a-59da36aa6076"), 1, new Guid("8faff1df-7d66-4cbc-9528-2cf973fedf10"), "In addition, while wielding the ancestral echoing weapon, you have expert proficiency in one Lore skill relevant to one or more of the weapon’s previous owners. This is typically Dwarven Lore but is ultimately determined by the GM depending on the weapon’s history.", 0 },
                    { new Guid("e337a626-4b09-4e8c-9bb1-28cc5f89335b"), 0, new Guid("8faff1df-7d66-4cbc-9528-2cf973fedf10"), "The wisdom of this weapon’s past owners flows into your mind, amplifying your own abilities with the weapon. Your proficiency rank with this weapon is one step higher than normal, to a maximum of the highest proficiency rank you have in any weapon. For instance, if you had master proficieny with martial weapons and expert proficiency with advanced weapons, you would have master proficiency with advanced weapon that had this rune.", 0 },
                    { new Guid("3d0b5a29-2e4e-4e8e-b16a-123d6c947bb9"), 0, new Guid("8b4e3b95-e474-4a3c-bad9-62f53d7371be"), "A serrating weapon’s bladed edge separates into jagged, swirling shards that spin along the blade. When dealing slashing damage, the weapon deals an additional 1d4 damage.", 0 },
                    { new Guid("dbed857f-4af5-4a1c-8a71-d1bde6b1f7d1"), 0, new Guid("ece62494-d652-4ea8-96d9-3a1cb7348265"), "A conducting weapon can channel energy through it. The weapon gains the resonant weapon trait, except that when you Conduct Energy, the weapon deals an additional 1d8 damage of the selected type instead of 1 additional damage per die; if the weapon already had the resonant weapon trait, it deals 1d8 damage plus 1 damage per die instead. On a critical hit, the weapon deals 1d8 persistent damage of the same type.", 0 },
                    { new Guid("ddbe3dfd-fdd0-498c-a580-58bf270bb7fe"), 0, new Guid("e2c40d60-9c36-4dfa-a877-2c240993a9e2"), "When you critically hit with this weapon, the target becomes frightened 2.", 0 },
                    { new Guid("db638e68-2428-4c0c-a41d-1bf5043b1264"), 0, new Guid("f40bf60b-e57d-4021-b7b9-4b98c8eb62c6"), "When you critically hit with this weapon, the target becomes frightened 1.", 0 },
                    { new Guid("f32a3334-8cc1-4dd6-89dd-c89cc34f7d43"), 0, new Guid("da8995d1-7845-4efd-916a-37ac99058ed2"), "This rune turns weapons into instruments of peacemaking.", 0 },
                    { new Guid("7b26edf9-7025-4308-8b24-08abfe562ef7"), 0, new Guid("540c6e2d-b323-4467-978f-6b975fc1bfd6"), "A kin-warding clan dagger can deflect attacks aimed at your allies. When you use the weapon’s parry trait, you can point the clan dagger at an adjacent ally instead of defending yourself, creating a shield of runes around them. The runic barrier grants your ally the weapon’s circumstance bonus to AC, but you do not gain the bonus yourself.", 0 },
                    { new Guid("c68ada15-1087-430e-86e6-3e1f681d5323"), 0, new Guid("581d1b62-a5c2-4063-9780-28b6e357a7d7"), "Electric arcs crisscross this weapon, dealing an extra 1d6 electricity damage on a hit. On a critical hit, electricity arcs out to deal an equal amount of electricity damage to up to two other creatures of your choice within 10 feet of the target.", 0 },
                    { new Guid("957ce6ff-ee9e-43b2-bd73-0d65204bf7d8"), 0, new Guid("d86da8fd-78d2-420d-a04e-304c93154c7b"), "An unholy rune instills fiendish power into the etched weapon. A weapon with this rune deals an additional 1d6 evil damage when it hits a good target. If you are good, you are enfeebled 2 while carrying or wielding this weapon.", 0 },
                    { new Guid("ff45ace5-d7f4-42bd-8dcd-298dd0e81bd0"), 0, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "When your attack roll with this weapon is a critical hit and gains the critical specialization effect, you gain an additional benefit depending on the weapon group.", 0 },
                    { new Guid("d34d732c-49ed-4cbb-be44-d340acfb9302"), 0, new Guid("f7b83dda-01b3-4baf-b4df-ec8e2ea0bdc0"), "The weapon can harm creatures without physical form. A ghost touch weapon is particularly effective against incorporeal creatures, which almost always have a specific vulnerability to ghost touch weapons. Incorporeal creatures can touch, hold, and wield ghost touch weapons (unlike most physical objects).", 0 },
                    { new Guid("741897ff-c80f-4e5d-ac1e-72c809c9fef5"), 0, new Guid("86cccc3e-defb-448b-82a7-48b14c021cb5"), "The save DC is 34. Cold damage dealt by this weapon ignores the target’s cold resistance.", 0 },
                    { new Guid("c027d501-04ab-4699-b417-55d66cbf3da9"), 0, new Guid("1b57fea8-cdc8-4899-8cdb-f84700bfe741"), "This weapon is empowered with freezing ice. It deals an additional 1d6 cold damage on a successful Strike. On a critical hit, the target is also slowed 1 until the end of your next turn unless it succeeds at a DC 24 Fortitude save.", 0 },
                    { new Guid("0f90f3f7-66ed-43ac-bc3d-c28968b5fbec"), 0, new Guid("77655a2a-e1e7-4374-89e2-c54b011d95bd"), "Increase the persistent damage on a critical hit to 2d10. Fire damage dealt by this weapon (including the persistent fire damage) ignores the target’s fire resistance.", 0 },
                    { new Guid("0d37b169-ac4c-45c4-989b-5bfa75d0123d"), 0, new Guid("b58e2a96-37d4-4fba-88d3-6e0b7c5f343f"), "This weapon is empowered by flickering flame. The weapon deals an additional 1d6 fire damage on a successful Strike, plus 1d10 persistent fire damage on a critical hit.", 0 },
                    { new Guid("d153920f-4c9c-4a88-a3a8-6a1a3c54ecf4"), 0, new Guid("76aadc75-c6fe-4a63-9fce-78bc73f54dd2"), "Increase the extra damage to 2d6. On a critical hit, instead of being enfeebled 1, the undead creature must attempt a DC 34 Fortitude save with the following effects. This is an incapacitation effect.", 0 },
                    { new Guid("a85cc247-1c72-4c15-9e45-a5216ca4c938"), 0, new Guid("aec8ff2c-14fc-4cc8-81af-3cd75de33eb4"), "A disrupting weapon pulses with positive energy.The weapon deals an extra 1d6 positive damage to undead. On a critical hit, the undead is also enfeebled 1 until the end of your next turn.", 0 },
                    { new Guid("f1840b68-7c69-4daa-8967-ff8b464a8aca"), 1, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Axe - You can damage a third creature, with the same restrictions.", 2 },
                    { new Guid("27422f01-d52a-46bf-825b-1e4683594ac0"), 2, new Guid("5befb651-cdaf-4afc-b893-6da19235a866"), "While it’s activated, a dancing weapon makes Strikes with an attack modifier of +24 plus its item bonus to attack rolls. It uses the weapon’s normal damage but has a +0 Strength modifier. The weapon’s abilities that automatically trigger on a hit or critical hit still function, but the weapon can’t be activated or benefit from any of your abilities while dancing.", 0 },
                    { new Guid("67b40e55-6393-4b43-8be4-9d8a6a2cdf5d"), 0, new Guid("5befb651-cdaf-4afc-b893-6da19235a866"), "A dancing weapon flies autonomously and strikes your foes.", 0 },
                    { new Guid("df27e8fb-9b52-4d80-8f87-fff9fbbbdda1"), 0, new Guid("7e9d4453-15b3-4ce9-b9b7-305949c66255"), "The acid damage dealt by this weapon ignores the target’s acid resistance. Increase the acid damage dealt to armor or a shield on a critical hit to 6d6.", 0 },
                    { new Guid("1cb19254-c8f0-4214-8e82-4070dd4a805c"), 0, new Guid("70aebf9d-a280-4f70-9822-ea951a9c0023"), "Acid sizzles across the surface of the weapon. When you hit with the weapon, add 1d6 acid damage to the damage dealt. In addition, on a critical hit, the target’s armor (if any) takes 3d6 acid damage (before applying Hardness); if the target has a shield raised, the shield takes this damage instead.", 0 },
                    { new Guid("89f4c857-4818-4bd6-a2dd-7c98a3a9bb42"), 1, new Guid("fd86cf2b-0c9f-4e6d-bb9b-16df35fad858"), "When you critically succeed at an attack roll with this weapon against a chaotic creature, instead of rolling, count each weapon damage die as average damage rounded up (3 for d4, 4 for d6, 5 for d8, 6 for d10, 7 for d12).", 0 },
                    { new Guid("1527ad18-d41f-4eda-b9df-293ddfe5b247"), 0, new Guid("fd86cf2b-0c9f-4e6d-bb9b-16df35fad858"), "Complex and symmetrical, an axiomatic rune imbues a weapon with lawful energy. A weapon with this rune deals an additional 1d6 lawful damage against chaotic targets. If you are chaotic, you are enfeebled 2 while carrying or wielding this weapon.", 0 },
                    { new Guid("eb05e944-f51c-4cc7-89c0-5f832b21620b"), 1, new Guid("f860a640-0e15-4a5c-afab-6d6db3a08f79"), "When you critically succeed at a Strike with this weapon against a lawful creature, roll 1d6. On a 1 or 2, you deal double minimum damage; on a 3 or 4, double your damage normally; on a 5 or 6, you deal double maximum damage.", 0 },
                    { new Guid("8f72b0cc-7525-4564-9df2-b6a023da280a"), 0, new Guid("f860a640-0e15-4a5c-afab-6d6db3a08f79"), "An anarchic rune is jagged and asymmetrical, channeling chaotic energy. A weapon with this rune deals an additional 1d6 chaotic damage against lawful targets. If you are lawful, you are enfeebled 2 while carrying or wielding this weapon.", 0 },
                    { new Guid("fe507108-08ea-4fa8-9696-d9bbcde9f30d"), 0, new Guid("1e2e2357-47c3-4f71-9491-5aab77b26b6a"), "The weapon performs divination magic on the blood of your foes, granting you insight into their abilities and weaknesses.", 0 },
                    { new Guid("6cf96412-3272-43cb-83f2-41320ad6b139"), 1, new Guid("5befb651-cdaf-4afc-b893-6da19235a866"), "The weapon has a space of 5 feet, but it doesn’t block or impede enemies attempting to move though that space, nor does it benefit from or provide flanking. The weapon can’t move through an enemy’s space. The weapon can’t use reactions, and its Fly actions don’t trigger reactions.", 0 },
                    { new Guid("a01f1855-ee53-4a05-a8df-6815537cd982"), 2, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Bow - The Athletics check to pull the missile free is DC 20.", 2 },
                    { new Guid("cd67c2b3-dfb9-436f-bfb2-4d2b9ffa99cb"), 3, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Brawling - The target takes a –4 circumstance penalty to its save.", 2 },
                    { new Guid("599a9463-1762-4b29-ac06-e33170e67683"), 4, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Club - You can knock the target up to 15 feet away.", 2 },
                    { new Guid("43a36fa8-f7a4-4c49-8cf7-0bd08378d2f9"), 0, new Guid("72606c00-caaf-4ac6-9fed-e8cc51c39593"), "The save DC is 34, and the deafness is permanent. Sonic damage dealt by this weapon ignores the target’s sonic resistance.", 0 },
                    { new Guid("5d42cd08-c0ce-4e2d-9853-af20869429f2"), 0, new Guid("f5847e4b-aea8-4e00-911f-f010b728daed"), "This weapon lets out a peal of thunder when it hits, dealing an extra 1d6 sonic damage on a successful Strike. On a critical hit, the target has to succeed at a DC 24 Fortitude save or be deafened for 1 minute (or 1 hour on a critical failure).", 0 },
                    { new Guid("ba1bd5b1-7d85-499c-9c30-9f4bb7e6a8e4"), 0, new Guid("9968c8a7-4e09-4887-b62d-2e4ae3591aec"), "A spell-storing rune creates a reservoir of eldritch energy within the etched weapon. A spellcaster can spend 1 minute to cast a spell of 3rd level or lower into the weapon. The spell must have a casting of 2 actions or fewer and must be able to target a creature other than the caster. The spell has no immediate effect—it is instead stored for later. When you wield a spell-storing weapon, you immediately know the name and level of the stored spell. A spell-storing weapon found as treasure has a 50% chance of having a spell of the GM’s choice stored in it.", 0 },
                    { new Guid("4cbc3872-d879-462c-aa7a-a0afee19dd37"), 0, new Guid("c7825ff9-b173-4c02-9d7b-f0f53efc3601"), "Attacks with a speed weapon are supernaturally swift. While wielding a speed weapon, you gain the quickened condition, but you can use the additional action granted only to make a Strike with the etched weapon.", 0 },
                    { new Guid("1d296e50-3de8-49d9-9338-172e371c75bb"), 0, new Guid("bd875c19-2d25-4ba7-9ec4-45511a22aa17"), "Electricity damage dealt by this weapon ignores the target’s electricity resistance (and the other creatures’ on a critical hit).", 0 },
                    { new Guid("35aab7a3-912e-47aa-912d-5bdaaac06309"), 0, new Guid("b0fddee5-3b99-44a0-b38b-603c6b91442a"), "With a moment of manipulation, you can shift this weapon into a different weapon with a similar form.", 0 },
                    { new Guid("14bb656e-55be-4111-aa46-a37ddf6df5db"), 0, new Guid("75f92632-1173-4d98-8546-7d8e023ce6e0"), "When you make a thrown Strike with this weapon, it flies back to your hand after the Strike is complete. If your hands are full when the weapon returns, it falls to the ground in your space.", 0 },
                    { new Guid("2437c2d7-9210-4723-8ecd-2b926c969c00"), 0, new Guid("660df2ec-e557-4f8b-b764-68de9070e59f"), "The edges of a keen weapon are preternaturally sharp. Attacks with this weapon are a critical hit on a 19 on the die as long as that result is a success. This property has no effect on a 19 if the result would be a failure.", 0 },
                    { new Guid("af94facc-6c5b-47fe-a33e-cb9711835db1"), 0, new Guid("86c792b6-6ee5-46a1-9688-3799a701c313"), "Holy weapons command powerful celestial energy. A weapon with this rune deals an extra 1d6 good damage against evil targets. If you are evil, you are enfeebled 2 while carrying or wielding this weapon.", 0 },
                    { new Guid("d612d63e-e996-4b72-8832-f2ae5fc4fa7f"), 14, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Sword - The target is flat-footed until the end of your next turn.", 2 },
                    { new Guid("7854668c-239b-48d7-8fde-665c616dc95c"), 13, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Spear - The clumsy condition lasts for 2 rounds.", 2 },
                    { new Guid("0e4f1eda-1a64-41b0-b0fc-6d0745cd2e28"), 12, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Sling - The target also takes a –10-foot status penalty to its Speed for 1 round if it fails the save.", 2 },
                    { new Guid("1373aa1b-fa84-4f3c-95d9-be6f309a3dd1"), 11, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Shield - You can knock the target up to 10 feet away.", 2 },
                    { new Guid("b4ebc733-fb21-472f-981b-8cf1cba27f9e"), 10, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Polearm - You can move the target up to 10 feet.", 2 },
                    { new Guid("673bb822-d06d-4a2e-a554-e2dd5498a7df"), 9, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Pick - The extra damage from the critical specialization effect increases to 4 per weapon damage die.", 2 },
                    { new Guid("6477c63d-db7e-46d2-bf72-909ce094dd99"), 8, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Knife - The target takes a –5-foot status penalty to its Speed while it has the persistent bleed damage.", 2 },
                    { new Guid("1a5bff82-c11a-44b9-98cc-3bf9f40fab75"), 7, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Hammer - You can also knock the target 5 feet away from you.", 2 },
                    { new Guid("9b9297c4-3560-437f-abb6-b8956fc1c407"), 6, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Flail - You move the target 5 feet. You can't move it away from you, but you can move it in another direction of your choice.", 2 },
                    { new Guid("856c5687-33ec-487e-a7eb-7d4652b566b4"), 5, new Guid("d0409cb7-277d-4700-90b1-344123d3b827"), "Dart - The base persistent bleed damage increases to 2d6.", 2 },
                    { new Guid("dbba7b53-ed42-4314-8b51-eb91c19ac5c0"), 0, new Guid("fc4fd64f-3b91-43be-bc8a-f4d8c2c1f172"), "Originally created as a means of slaying the legendary jabberwock, vorpal weapons prove equally effective against nearly any foe with a head.", 0 },
                    { new Guid("e16b5907-0caa-483c-84c1-5d1643ee91d9"), 3, new Guid("5befb651-cdaf-4afc-b893-6da19235a866"), "Each round, when the weapon is finished using its actions, attempt a DC 6 flat check. On a failure, the activation ends and the weapon falls to the ground. You can’t activate the item again for 10 minutes.", 0 }
                });

