            migrationBuilder.InsertData(
                table: "HazardAction_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("8c6ac794-a869-4f98-8fda-c9157022eb44"), 0, new Guid("202a3139-430a-4841-8488-9eefbe0089fe"), "The trap pops up in a grid intersection and makes a spinning blade Strike against one adjacent creature (if any), then rolls initiative.", 0 },
                    { new Guid("f79173f5-49dc-4322-8be4-c4591b89d643"), 0, new Guid("edea22d4-1f12-48a8-b1f1-b6ee4de1b4f7"), "The trap makes a poisoned dart Strike against the triggering creature.", 0 },
                    { new Guid("eb77450e-c55c-43e4-b3c1-aadb7c0fe4e5"), 0, new Guid("08abae5d-5e71-45ca-9a37-9d44a955d84c"), "The trap makes a poisoned dart Strike against the triggering creature, then rolls initiative.", 0 },
                    { new Guid("1b710bb7-2c56-42fd-a03d-2b2861a8b23f"), 0, new Guid("d42112ae-d850-451a-ac03-2aba67ec4a75"), "The exits seal instantly and the trap rolls initiative.", 0 },
                    { new Guid("356c9040-4be1-4428-a454-8e39c037da0c"), 0, new Guid("2eb1837d-c49c-447e-98d7-b30c858912f0"), "The hammer swings down, making a Strike against the triggering creature.", 0 },
                    { new Guid("b3fae5a4-340d-41a7-821b-80713b7affd8"), 0, new Guid("ffe63bc7-f008-4d70-9357-e6ada9e45a25"), "The triggering creature falls in and takes damage from the fall, reduced by 5 feet for falling into the water (typically 12 bludgeoning damage). A creature can Grab an Edge to avoid falling (page 472). The trapdoor then slams shut, and the hazard rolls initiative.", 0 },
                    { new Guid("cabdbcb0-95c9-461d-a9f5-e1858af03802"), 0, new Guid("16402edb-38d3-4cae-a93d-687c9e1814b2"), "This trap summons a specific level 1 creature, determined when the trap is created. The creature rolls initiative and remains for 2d6 rounds, after which the spell ends and the creature disappears. The creature also disappears if someone disables the trap before the duration expires. The summoned creature can use 3 actions each round and can use reactions, unlike most summoned creatures.", 0 },
                    { new Guid("ae24d667-ccda-431a-a998-7e754abfee8e"), 0, new Guid("c2534177-226c-402f-aae3-bc40111eed8d"), "The triggering creature and all creatures within 30 feet of the rift are drawn into another plane. Each creature can attempt a DC 33 Reflex save to avoid this fate.", 0 },
                    { new Guid("21077b3a-26c5-4556-b3e5-b48e4970f323"), 0, new Guid("a2bfaa34-76eb-43d8-a990-32b7437d8304"), "The triggering creature falls in and takes falling damage (typically 10 bludgeoning damage). That creature can use the Grab an Edge reaction to avoid falling.", 0 },
                    { new Guid("73e328d7-b078-4c03-a8ac-2f8f2191835e"), 0, new Guid("d403f5f2-59b1-446b-b31c-a91b8337c776"), "The trap releases an arcane wail of the banshee (DC 40) with a 100-foot-radius emanation instead of 40 feet, targeting all living creatures in the area, and rolls initiative.", 0 },
                    { new Guid("23e284eb-40a6-4934-8d0a-88b4a0c0e23c"), 0, new Guid("6394bcae-4701-476c-81a6-c154f616ddb5"), "The saw blade travels along its path, making one Strike against each creature in the room, twisting and varying its height for a maximum chance of beheading its targets.", 0 },
                    { new Guid("fd11a9dd-3a82-4d6f-9861-62c108f617a5"), 0, new Guid("09e804f4-5f1b-4255-b1d1-31e90811b52a"), "The trap shoots a spear, making a Strike against the creature or object on the floor tile.", 0 },
                    { new Guid("85896c21-0853-44e8-90ea-b304cdbb0f14"), 1, new Guid("57f67171-9fe7-42a8-9338-9dfcff0c17b1"), "Lifting the fallen slab requires a successful DC 25 Athletics check. Hitting the floor panels triggers the trap. The slab uses the same AC and saves as the trap, but it has Hardness 12, HP 48 (BT 24).", 0 },
                    { new Guid("67f6c155-f410-4fdb-bfdf-ea6988d88003"), 0, new Guid("57f67171-9fe7-42a8-9338-9dfcff0c17b1"), "The door falls, closing off the hallway. The stone slab deals 3d8 bludgeoning damage to anyone beneath or adjacent to the slab when it drops and pushes them out of its space in a random direction. A creature that succeeds at a DC 17 Reflex save takes no damage and rolls out of the way in a random direction. On a critical success, they can choose the direction.", 0 },
                    { new Guid("87bdb9c5-4d60-4e50-938d-4bd6467d5e62"), 0, new Guid("28f30837-d2d0-459a-bcf2-49afac323a2e"), "The triggering creature and up to five coconspirators instantly revert to infants, losing all memories, class abilities, and other skills acquired during their lives (DC 44 Fortitude negates). Reversing this effect is nearly impossible, requiring powerful magic such as wish.", 0 },
                    { new Guid("99511947-964d-4238-bba3-e8f5c44be0b4"), 0, new Guid("574be793-dfaa-4b21-ac86-4c65fd08bd92"), "Both blades swing down, each one Striking all creatures under the ceiling grooves.", 0 },
                    { new Guid("50fc5c54-2b32-41dc-960f-7aee5dc71077"), 0, new Guid("0b60cd6f-d1e8-4373-83f8-a14907af7e10"), "The creature is targeted by baleful polymorph (DC 32 Will save).", 0 },
                    { new Guid("5ca24113-9fa9-4802-92db-bf378e003180"), 0, new Guid("09a54c43-77a9-42c6-a041-aab4c55df5ff"), "A spine extends to Strike the triggering creature.", 0 },
                    { new Guid("d9095071-f339-42ec-99a9-b36054c97766"), 0, new Guid("deb0f675-09fc-450b-90d2-e04da0e1c699"), "Each living creature within 60 feet must succeed at a DC 23 Will save or be subjected to the pharaoh’s curse. A cursed creature takes a –2 status penalty to Fortitude saves, and any natural or magical healing it receives is halved. The curse remains until removed by remove curse or similar magic.", 0 },
                    { new Guid("5c6305bf-8791-4678-b24c-ab95f62fa7ab"), 0, new Guid("b1955fcd-433f-45dc-b9ea-d69baa5fd5d9"), "The mirror absorbs the creature into the mirror, replacing it with an evil mirror duplicate (DC 34 Reflex to avoid being absorbed into the mirror), and rolls initiative.", 0 },
                    { new Guid("d1e49618-1459-444d-b843-e65168e0ea3f"), 0, new Guid("a1bbebc2-a500-44f9-8142-b77421a53107"), "The trap deals 3d12 electricity damage to the triggering creature (DC 22 basic Reflex save).", 0 },
                    { new Guid("78b61a1b-9b9c-4637-a632-d5cac2d621b6"), 0, new Guid("29a2a4fe-936b-4b1a-8aa0-bd1e6ca3fc88"), "The wheel begins to spin and rolls initiative.", 0 },
                    { new Guid("806735c8-382d-4647-a8fd-b33e379cebad"), 0, new Guid("21a56455-6731-4be9-bc6b-02130bac5957"), "The triggering creature and all creatures within 30 feet are trapped in a disrupted time flow (DC 38 Fortitude negates). The creatures’ minds move so quickly that each round seems to last a century, but their bodies and magical energies move so slowly that they can’t use any actions except Recall Knowledge. An affected creature must attempt a DC 36 Will saving throw against a warp mind spell immediately and again for every minute of real time that passes while the creature is trapped in the frozen moment. This effect has an unlimited duration but can be counteracted.", 0 },
                    { new Guid("06f5fbcf-7e70-4444-8f61-60927a67cef8"), 0, new Guid("3df56b95-79f0-4ed7-bdb0-d0d0bdddcde2"), "The tube explodes, spraying hallucinogenic powder in a 30-foot cone. Any creature in the cone must succeed at a DC 24 Will save or be confused for 1 round and take a –2 status penalty to Perception checks and saves against mental effects for 1d4 hours. On a critical failure, the penalty is instead –4.", 0 },
                    { new Guid("a9f37fc2-82d6-466c-adc8-552f4b20da56"), 0, new Guid("d1adf885-1c78-4d30-b759-12798dc37a4a"), "The triggering creature sinks into the quicksand up to its waist. The quicksand rolls initiative if it hasn’t already.", 0 },
                    { new Guid("2ac0be1a-c1b5-4269-bbac-40a7665853c4"), 0, new Guid("68d1d3fe-bca2-4a85-864c-1359f24d5dbc"), "The haunt takes control of the triggering creature, forcing it to attack itself. The creature must attempt a DC 29 Will save.", 0 },
                    { new Guid("bbf0858b-6ab3-4a6e-90f3-8e4ca74206a8"), 0, new Guid("ea62e9d7-f1ba-4f23-abb7-0f76ec9dbaeb"), "Fire rains from the sky in a 100-mile radius, dealing 10d6 fire damage to creatures and objects in the area. Each creature or object can attempt a DC 46 basic Reflex save. Any creature reduced to 0 Hit Points by this damage dies instantly. This is not enough damage to completely burn away a forest or level an entire mountain or city, but it typically kills most creatures in the area.", 0 },
                    { new Guid("416e47cd-3a39-4e6b-93ba-d7560655d2aa"), 0, new Guid("dd06ccd9-ca0a-4797-b135-590a5509eb32"), "The triggering creature and all creatures within 10 feet are exposed to yellow mold spores.", 0 },
                    { new Guid("3b3bacc8-6bac-46c7-afff-17183a183c5a"), 1, new Guid("54b9c0cb-563f-412d-aa62-829de3b015c5"), "The pit contains many handholds, so the falling creature can try to Grab an Edge again every 6 seconds. If the creature succeeds, it can start to Climb out from that point (though it might be a very long climb, depending on how far the creature fell). Since the creature falls endlessly, it can rest and even prepare spells while falling, though items dropped while falling are usually lost forever.", 0 },
                    { new Guid("76ef593c-5381-4d39-8935-56aad69cdecf"), 0, new Guid("5ea54988-b386-4036-a0fc-914995d621de"), "Each telekinetic decoration constructs a cloud of objects in the room (three clouds total) and the trap rolls initiative. The creatures in the room when the trap is triggered become the trap’s targets, regardless of whether they leave the room or other creatures later enter the room. Each decoration targets a different creature if possible. A target creature that moves at least 1 mile from the trap ceases being a target, at which point the decoration designates a new target.", 0 },
                    { new Guid("a93c5058-494c-4df1-988e-f0dc6dee552c"), 0, new Guid("c5259ba8-ad21-4900-bcbf-cf1196ef578a"), "The rune detonates a fireball centered on the triggering creature’s square. This is a 3rd level fireball spell that deals 6d6 fire damage (DC 22 basic Reflex save).", 0 },
                    { new Guid("63bd40ef-eda7-4641-8d14-e4cd5efbfbaf"), 0, new Guid("54b9c0cb-563f-412d-aa62-829de3b015c5"), "The triggering creature falls in and continues to fall, potentially forever. That creature can try to Grab an Edge to avoid falling (page 472). The DC to Climb the walls or Grab an Edge is 26", 0 }
                });

